              "textOriginal": "Here's a quick autopsy report anyone with a memory can explain: He passed the ACA. Because of this and the tea party, the GOP enjoyed screaming through their propaganda networks stuff such as \"death panels\". The painted the bleakest picture of America they could think of, a picture that wasn't true, and it worked. People believed it. Hell, they removed the funding for embassy protection while in power and yet Benghazi is somehow Hillary and Obama's fault. C'mon, self-reflection is not needed when propaganda explains it, plain and simple.",
