            "id": "UgyNJ0_UoFf9yyxC8XB4AaABAg.8_pHGkN3e568_qmQdpKNwZ",
            "snippet": {
              "channelId": "UCMtFAi84ehTSYSE9XoHefig",
              "videoId": "ei5dpQ9ZV04",
              "textDisplay": "Valerie Rodger It has been my opinion for years that the reason Republicans don‚Äôt support education is because they want an uneducated electorate. They certainly got ‚Äòem.",
              "textOriginal": "Valerie Rodger It has been my opinion for years that the reason Republicans don‚Äôt support education is because they want an uneducated electorate. They certainly got ‚Äòem.",
              "parentId": "UgyNJ0_UoFf9yyxC8XB4AaABAg",
              "authorDisplayName": "Sula Howell",
              "authorProfileImageUrl": "https://yt3.ggpht.com/ytc/AMLnZu_4KlJ7u2-KihX7UWXSh8oUfsVSkfTWb8uAJbJrnw=s48-c-k-c0x00ffffff-no-rj",
              "authorChannelUrl": "http://www.youtube.com/channel/UCWqoqr0U76DM_AYfWdUJI2w",
              "authorChannelId": {
                "value": "UCWqoqr0U76DM_AYfWdUJI2w"
