              "viewerRating": "none",
              "likeCount": 2,
              "publishedAt": "2017-12-06T23:30:28Z",
              "updatedAt": "2017-12-06T23:30:28Z"
            }
          },
          {
            "kind": "youtube#comment",
            "etag": "55W6PRrXtUxMYys7-9aTne9QTZc",
            "id": "UgyNJ0_UoFf9yyxC8XB4AaABAg.8_pHGkN3e568_qghb1IFXo",
            "snippet": {
              "channelId": "UCMtFAi84ehTSYSE9XoHefig",
              "videoId": "ei5dpQ9ZV04",
              "textDisplay": "The Dems have to accept that Trump won the same way Obama did - by a clear appeal that ignited an emotional reaction.\u003cbr\u003e\u003cbr\u003eObama&#39;s was one of hope and promise - Yes We  Can - and he inspired his followers  in a positive. Trump&#39;s was one of fear and hate, telling people they were right to be bitter and unhappy and told them who to blame for it.\u003cbr\u003e\u003cbr\u003eClinton made the mistake of the elites - believing that people would vote based on a rational comparison of the policies, etc. Listen to Trump supporters and realize that most people do not understand international diplomacy, do not understand economic trends, do not take the time to learn about the issues, and don&#39;t even consider what the candidates actual policies are (or don&#39;t understand that platitudes like &quot;build a wall&quot; are talking points, not policies). Listen to them, and realize they don&#39;t understand the foundations of democracy, so they can&#39;t understand (or don&#39;t care) that muzzling and/or undermining the press is a move away from democracy and towards authoritarianism, they don&#39;t understand or don&#39;t care that a President who can dictate who law enforcement does or does not investigate is a move away from democracy and towards totalitarianism. Maybe they just don&#39;t care if they live under a dictator, as long as that dictator is on \u003cb\u003etheir\u003c/b\u003e side - screw everyone else, and don&#39;t think about the possibility that the dictator could end up targeting you.\u003cbr\u003e\u003cbr\u003eUnderstand that most people vote based on what &quot;feels true&quot; rather than what rational, analytical, critical thought shows \u003cb\u003eis\u003c/b\u003e true, and tailor your message so that even people who couldn&#39;t grasp that Obamacare was the ACA will be able to grasp the intent and import of your position. Realize that you must appeal to emotion as well as thought, or you simply will not be appealing to enough of the electorate.",
              "textOriginal": "The Dems have to accept that Trump won the same way Obama did - by a clear appeal that ignited an emotional reaction.\n\nObama's was one of hope and promise - Yes We  Can - and he inspired his followers  in a positive. Trump's was one of fear and hate, telling people they were right to be bitter and unhappy and told them who to blame for it.\n\nClinton made the mistake of the elites - believing that people would vote based on a rational comparison of the policies, etc. Listen to Trump supporters and realize that most people do not understand international diplomacy, do not understand economic trends, do not take the time to learn about the issues, and don't even consider what the candidates actual policies are (or don't understand that platitudes like \"build a wall\" are talking points, not policies). Listen to them, and realize they don't understand the foundations of democracy, so they can't understand (or don't care) that muzzling and/or undermining the press is a move away from democracy and towards authoritarianism, they don't understand or don't care that a President who can dictate who law enforcement does or does not investigate is a move away from democracy and towards totalitarianism. Maybe they just don't care if they live under a dictator, as long as that dictator is on *their* side - screw everyone else, and don't think about the possibility that the dictator could end up targeting you.\n\nUnderstand that most people vote based on what \"feels true\" rather than what rational, analytical, critical thought shows *is* true, and tailor your message so that even people who couldn't grasp that Obamacare was the ACA will be able to grasp the intent and import of your position. Realize that you must appeal to emotion as well as thought, or you simply will not be appealing to enough of the electorate.",
              "parentId": "UgyNJ0_UoFf9yyxC8XB4AaABAg",
