            "videoId": "9bZkp7q19f0",
            "textDisplay": "Scene:\u003cbr\u003e\u003cbr\u003eA neighbourhood on a street called Privet Drive. An owl, sitting on the street sign flies off to reveal a mysterious appearing old man walking through a forest near the street. He stops at the start of the street and takes out a mechanical device and zaps all the light out of the lampposts. He puts away the device and a cat meows. The man, ALBUS DUMBLEDORE, looks down at the cat, which is a tabby and is sitting on a brick ledge.\u003cbr\u003e\u003cbr\u003e¬†\u003cbr\u003e\u003cbr\u003eDumbledore: I should have known that you would be here...Professor McGonagall.\u003cbr\u003e\u003cbr\u003e¬†\u003cbr\u003e\u003cbr\u003eThe cat meows, sniffs out and the camera pans back to a wall. The cats shadow is seen progressing into a human. There are footsteps and MINERVA MCGONAGALL is revealed.\u003cbr\u003e\u003cbr\u003e¬†\u003cbr\u003e\u003cbr\u003eMcGonagall: Good evening, Professor Dumbledore. Are the rumours true, Albus?\u003cbr\u003e\u003cbr\u003e¬†\u003cbr\u003e\u003cbr\u003eDumbledore: I&#39;m afraid so, Professor. The good, and the bad.\u003cbr\u003e\u003cbr\u003eMcGonagall: And the boy?\u003cbr\u003e\u003cbr\u003eDumbledore: Hagrid is bringing him.\u003cbr\u003e\u003cbr\u003eMcGonagall: Do you think it wise to trust Hagrid with something as important as this?\u003cbr\u003e\u003cbr\u003eAlbus: Ah, Professor, I would trust Hagrid with my life.\u003cbr\u003e\u003cbr\u003e¬†\u003cbr\u003e\u003cbr\u003eThere is a motor sound, and the two professors look up to see a flying motorcycle coming down from the air. It skids on the street and halts. A large man, RUBEUS HAGRID, takes off his goggles.\u003cbr\u003e\u003cbr\u003e¬†\u003cbr\u003e\u003cbr\u003eHagrid: Professor Dumbledore, Sir. Professor McGonagall.\u003cbr\u003e\u003cbr\u003eDumbledore: No problems, I trust, Hagrid?\u003cbr\u003e\u003cbr\u003eHagrid: No, sir. Little tyke fell asleep just as we were flying over Bristol. Heh. Try not to wake him. There you go.\u003cbr\u003e\u003cbr\u003e¬†\u003cbr\u003e\u003cbr\u003eHagrid hands a baby in a blanket over to Dumbledore.\u003cbr\u003e\u003cbr\u003e¬†\u003cbr\u003e\u003cbr\u003eMcGonagall: Albus, do you really think its safe, leaving him with these people? I&#39;ve been watching them all day. They&#39;re the worst sort of Muggles imaginable. They really are\u003cbr\u003e\u003cbr\u003eDumbledore: The only family he has.\u003cbr\u003e\u003cbr\u003e¬†\u003cbr\u003e\u003cbr\u003eThey stop outside a house.\u003cbr\u003e\u003cbr\u003e¬†\u003cbr\u003e\u003cbr\u003eMcGonagall: This boy will be famous. There wont be a child in our world who doesn&#39;t know his name.\u003cbr\u003e\u003cbr\u003eDumbledore: Exactly. He&#39;s better off growing up away from all that. Until he is ready.\u003cbr\u003e\u003cbr\u003e¬†\u003cbr\u003e\u003cbr\u003eHagrid coughs and sniffles, he is crying. He clears his throat.\u003cbr\u003e\u003cbr\u003e¬†\u003cbr\u003e\u003cbr\u003eDumbledore: There, there, Hagrid. It&#39;s not really good-bye, after all.\u003cbr\u003e\u003cbr\u003e¬†\u003cbr\u003e\u003cbr\u003eHagrid nods. Dumbledore takes a letter and places it on the baby, who is now at the foot of the door. The baby has a visible lightning-bolt shaped scar on his forehead.\u003cbr\u003e\u003cbr\u003e¬†\u003cbr\u003e\u003cbr\u003eDumbledore: Good luck...Harry Potter.\u003cbr\u003e\u003cbr\u003e¬†\u003cbr\u003e\u003cbr\u003eThe camera pans into the scar and the opening title shows:\u003cbr\u003e\u003cbr\u003eHARRY POTTER AND THE PHILOSOPHER&#39;S STONE\u003cbr\u003e\u003cbr\u003e\u003cbr\u003eAlmost ten years after the: DURSLEY&#39;s home. The camera pans on a sleeping boy, almost eleven, with a lightning-bolt shaped scar on his forehead.\u003cbr\u003e\u003cbr\u003eThere is a click, and knocking. Outside, a tall woman, PETUNIA DURSLEY, raps the door.\u003cbr\u003e\u003cbr\u003e¬†\u003cbr\u003e\u003cbr\u003ePetunia: Up. Get up. {Knocks} {sighs} Now! {Smacks door of closet which is the boys bedroom}\u003cbr\u003e\u003cbr\u003e¬†\u003cbr\u003e\u003cbr\u003eA large, tubby boy, DUDLEY DURSLEY, suddenly comes running down the stairs above the closet. He stops half-way down and goes back, jumping on the staircase.\u003cbr\u003e\u003cbr\u003e¬†\u003cbr\u003e\u003cbr\u003eDudley: Wake up, cousin! We&#39;re going to the zoo!\u003cbr\u003e\u003cbr\u003e¬†\u003cbr\u003e\u003cbr\u003eDudley laughs, comes down the stairs and runs for the kitchen. The boy, HARRY POTTER, tries to come out of the closetbut is pushed back in by Dudley.\u003cbr\u003e\u003cbr\u003e¬†\u003cbr\u003e\u003cbr\u003ePetunia is in the kitchen, where Dudley has gone.\u003cbr\u003e\u003cbr\u003e¬†\u003cbr\u003e\u003cbr\u003ePetunia: Oh, here he comes, the birthday boy!\u003cbr\u003e\u003cbr\u003e¬†\u003cbr\u003e\u003cbr\u003eA larger man, VERNON DURSLEY, is sitting at the kitchen table.\u003cbr\u003e\u003cbr\u003e¬†\u003cbr\u003e\u003cbr\u003eVernon: Happy birthday, son.\u003cbr\u003e\u003cbr\u003e¬†\u003cbr\u003e\u003cbr\u003ePetunia and Dudley giggle together. Harry comes into the kitchen, dressed in rags.\u003cbr\u003e\u003cbr\u003e¬†\u003cbr\u003e\u003cbr\u003ePetunia: Why don&#39;t you just cook the breakfast, and try not to burn anything.\u003cbr\u003e\u003cbr\u003eHarry: Yes, Aunt Petunia.\u003cbr\u003e\u003cbr\u003e¬†\u003cbr\u003e\u003cbr\u003eHe sets to work.\u003cbr\u003e\u003cbr\u003e¬†\u003cbr\u003e\u003cbr\u003ePetunia: I want everything to be perfect for my Dudley&#39;s special day.\u003cbr\u003e\u003cbr\u003eVernon: Hurry up! Bring my coffee, boy!\u003cbr\u003e\u003cbr\u003eHarry: Yes, Uncle Vernon.\u003cbr\u003e\u003cbr\u003e¬†\u003cbr\u003e\u003cbr\u003ePetunia leads Dudley over to the family room, where there are a vast amount of presents. Dudley stares.\u003cbr\u003e\u003cbr\u003e¬†\u003cbr\u003e\u003cbr\u003eDudley: How many are there?\u003cbr\u003e\u003cbr\u003eVernon: Thirty-six. Counted &#39;em myself.\u003cbr\u003e\u003cbr\u003eDudley: Thirty-six?! But last year last year I got thirty-seven!!\u003cbr\u003e\u003cbr\u003eVernon: Yes, well, some of them are quite a bit bigger than last year!\u003cbr\u003e\u003cbr\u003eDudley: I don&#39;t care how big they are!\u003cbr\u003e\u003cbr\u003ePetunia: Oh, now, now, now. This is what we&#39;re going to do, is that when we go out we&#39;re going to buy you two new presents! How&#39;s that, Pumpkin?\u003cbr\u003e\u003cbr\u003e¬†\u003cbr\u003e\u003cbr\u003eScene:\u003cbr\u003e\u003cbr\u003eOutside, morning. The happy family is heading to the car. Harry goes to get in but is stopped by Vernon.\u003cbr\u003e\u003cbr\u003e¬†\u003cbr\u003e\u003cbr\u003ePetunia: This will be a lovely day at the zoo. I&#39;m really looking forward to it.\u003cbr\u003e\u003cbr\u003eVernon: I&#39;m warning you now, boy. Any funny business, any at all, and you won&#39;t have any meals for a week. Get in.\u003cbr\u003e\u003cbr\u003e¬†\u003cbr\u003e\u003cbr\u003eScene:\u003cbr\u003e\u003cbr\u003eThe zoo. The family is in the reptile house, looking at a large BOA CONSTRICTOR.\u003cbr\u003e\u003cbr\u003e¬†\u003cbr\u003e\u003cbr\u003eDudley: Make it move.\u003cbr\u003e\u003cbr\u003eVernon raps the glass of the cage.\u003cbr\u003e\u003cbr\u003e¬†\u003cbr\u003e\u003cbr\u003eVernon: Move!\u003cbr\u003e\u003cbr\u003e¬†\u003cbr\u003e\u003cbr\u003eDudley raps the glass much harder, and Vernon winces.\u003cbr\u003e\u003cbr\u003e¬†\u003cbr\u003e\u003cbr\u003eDudley: MOVE!\u003cbr\u003e\u003cbr\u003eHarry: He&#39;s asleep!\u003cbr\u003e\u003cbr\u003eDudley: He&#39;s boring.\u003cbr\u003e\u003cbr\u003e¬†\u003cbr\u003e\u003cbr\u003eDudley and his parents retreat to another enclosure. Harry is left with the snake.\u003cbr\u003e\u003cbr\u003e¬†\u003cbr\u003e\u003cbr\u003eHarry: Sorry about him. He doesn&#39;t understand what it&#39;s like, lying there day after day, having people press their ugly faces in on you.\u003cbr\u003e\u003cbr\u003e¬†\u003cbr\u003e\u003cbr\u003eThe snake looks up and blinks.\u003cbr\u003e\u003cbr\u003e¬†\u003cbr\u003e\u003cbr\u003eHarry: Can you...hear me? {The snake nods} It&#39;s just...I&#39;ve never talked to a snake before. Do you...I mean...do you talk to people often? {The snake shakes its head} You&#39;re from Burma, aren&#39;t you? Was it nice there, do you miss your family? {The snake turns its head in the direction of a sign which says, Bred in Captivity} I see. That&#39;s me as well. I never knew my parents, either.\u003cbr\u003e\u003cbr\u003e¬†\u003cbr\u003e\u003cbr\u003eThe now awake snake has attracted Dudley&#39;s attention. He rips over to the cage, knocking Harry to the floor.\u003cbr\u003e\u003cbr\u003e¬†\u003cbr\u003e\u003cbr\u003eDudley: Mummy, dad, come here! You won&#39;t believe what this snake is doing!!\u003cbr\u003e\u003cbr\u003e¬†\u003cbr\u003e\u003cbr\u003eDudley puts his hands on the glass wall. Harry, from the ground, glares at him. Suddenly, the glass disappears. Dudley wretches forward.\u003cbr\u003e\u003cbr\u003e¬†\u003cbr\u003e\u003cbr\u003eDudley: Whoa! Ahh! Ahh!!\u003cbr\u003e\u003cbr\u003e¬†\u003cbr\u003e\u003cbr\u003eDudley falls into the snake enclosure, sputtering in a pool of water. The snake gets out of the exhibit, stopping in front of Harry.\u003cbr\u003e\u003cbr\u003e¬†\u003cbr\u003e\u003cbr\u003eSnake: Thankssssssss.\u003cbr\u003e\u003cbr\u003eHarry: Anytime.\u003cbr\u003e\u003cbr\u003e¬†\u003cbr\u003e\u003cbr\u003eThe snake starts off.\u003cbr\u003e\u003cbr\u003e¬†\u003cbr\u003e\u003cbr\u003eMan: SNAKE!\u003cbr\u003e\u003cbr\u003e¬†\u003cbr\u003e\u003cbr\u003eThere is a lot of screaming as the snake heads for freedom. Dudley gets up to get outbut the glass is now back over the enclosure. He is stuck. He pounds the glass.\u003cbr\u003e\u003cbr\u003e¬†\u003cbr\u003e\u003cbr\u003eDudley: Mum, mummy!\u003cbr\u003e\u003cbr\u003ePetunia: {Sees him} AHH!\u003cbr\u003e\u003cbr\u003eDudley: Mum, help! Help me!\u003cbr\u003e\u003cbr\u003ePetunia: My darling boy! How did you get in there?!\u003cbr\u003e\u003cbr\u003eHarry: {Grins and giggles}\u003cbr\u003e\u003cbr\u003e¬†\u003cbr\u003e\u003cbr\u003eVernon glares down at him and Harry&#39;s grin disappears. Petunia continues screaming: How did you get in there? Dursley, oh, Dursley!\u003cbr\u003e\u003cbr\u003e¬†\u003cbr\u003e\u003cbr\u003eScene:\u003cbr\u003e\u003cbr\u003eBack at the Dursley&#39;s. Petunia and a bundled up Dudley come in.\u003cbr\u003e\u003cbr\u003ePetunia: It&#39;s all right. It&#39;s all right.\u003cbr\u003e\u003cbr\u003e¬†\u003cbr\u003e\u003cbr\u003eThey disappear around the corner. Harry and Vernon enter. Vernon slams the door and shoves Harry against a wall, taking his hair.\u003cbr\u003e\u003cbr\u003e¬†\u003cbr\u003e\u003cbr\u003eHarry: Ow!\u003cbr\u003e\u003cbr\u003eVernon: What happened?\u003cbr\u003e\u003cbr\u003eHarry: I swear I don&#39;t know! One minute the glass was there and then it was gone! It was like magic!\u003cbr\u003e\u003cbr\u003eVernon: {Scoffs and shoves Harry into the closet} There&#39;s no such thing as magic!\u003cbr\u003e\u003cbr\u003e¬†\u003cbr\u003e\u003cbr\u003eScene:\u003cbr\u003e\u003cbr\u003eOutside, some time later. An owl flies by the house and drops a letter, which zooms in the letterbox. It lands away from the house and hoots.\u003cbr\u003e\u003cbr\u003eHarry, inside, goes to collect the mail. He sorts through the letters and sees his, addressed to him. He goes into the kitchen, hands Vernon the rest of the mail, and walks around the other side of the table to see his letter.\u003cbr\u003e\u003cbr\u003e¬†\u003cbr\u003e\u003cbr\u003eVernon: Ah, Marge is ill. Ate a funny whelk.\u003cbr\u003e\u003cbr\u003eDudley: {Sees Harrys letter. He runs and grabs it} Dad, look! Harry&#39;s got a letter!!\u003cbr\u003e\u003cbr\u003eHarry: Hey, give it back! It&#39;s mine!\u003cbr\u003e\u003cbr\u003eVernon: {Laughs} Yours? Who&#39;d be writing to you?\u003cbr\u003e\u003cbr\u003e¬†\u003cbr\u003e\u003cbr\u003eThe family gathers to look at the address. There is a broken seal on the letter. The family looks up and Harry gulps.\u003cbr\u003e\u003cbr\u003e¬†\u003cbr\u003e\u003cbr\u003eScene:\u003cbr\u003e\u003cbr\u003eAnother owl flies by with a letter and drops it off. Inside, Vernon grabs a handful of letters and rips them up.\u003cbr\u003e\u003cbr\u003eIn the closet, Harry hears a whirring noise. He looks out at Vernon drilling wood over the letterbox opening.\u003cbr\u003e\u003cbr\u003e¬†\u003cbr\u003e\u003cbr\u003eVernon: No more mail through this letterbox.\u003cbr\u003e\u003cbr\u003e¬†\u003cbr\u003e\u003cbr\u003eScene:\u003cbr\u003e\u003cbr\u003eOutside, Vernon and Petunia appear. Vernon is about to head off to work. Petunia kisses his cheek.\u003cbr\u003e\u003cbr\u003e¬†\u003cbr\u003e\u003cbr\u003ePetunia: Have a lovely day at the office, dear.\u003cbr\u003e\u003cbr\u003e¬†\u003cbr\u003e\u003cbr\u003eShe stops, looks and sees a bunch of owls.\u003cbr\u003e\u003cbr\u003e¬†\u003cbr\u003e\u003cbr\u003eVernon: Shoo! Go on!\u003cbr\u003e\u003cbr\u003e¬†\u003cbr\u003e\u003cbr\u003eScene:\u003cbr\u003e\u003cbr\u003eInside. Vernon is tossing letters into the fireplace. Harry comes around the corner. Vernon grins evilly and tosses more in.\u003cbr\u003e\u003cbr\u003e¬†\u003cbr\u003e\u003cbr\u003eScene:\u003cbr\u003e\u003cbr\u003eLiving/Family room. The family is sitting around, Harry is serving cookies.\u003cbr\u003e\u003cbr\u003e¬†\u003cbr\u003e\u003cbr\u003eVernon: Fine day Sunday. In my opinion, best day of the week. Why is that, Dudley?\u003cbr\u003e\u003cbr\u003e¬†\u003cbr\u003e\u003cbr\u003eDudley shrugs.\u003cbr\u003e\u003cbr\u003e¬†\u003cbr\u003e\u003cbr\u003eHarry: {Hands cookie to Vernon} Because there&#39;s no post on Sunday? Ah, right you are, Harry. No post on Sunday. Hah! No blasted letters today. No, sir. {Harry sees a shadow outside the window. Outside, millions of owls are perched.} No sir, not one blasted, miserable---\u003cbr\u003e\u003cbr\u003e¬†\u003cbr\u003e\u003cbr\u003eA letter shoots out of the fireplace and zips across Vernons face. There is a rumbling and then zillions of letters come shooting out of the fireplace.\u003cbr\u003e\u003cbr\u003e¬†\u003cbr\u003e\u003cbr\u003eDudley: AHH! Make it stop! Please make it stop! {He jumps on Petunias lap}\u003cbr\u003e\u003cbr\u003ePetunia and Vernon: {Screaming}\u003cbr\u003e\u003cbr\u003eVernon: Go away, ahh!\u003cbr\u003e\u003cbr\u003eDudley: What is it? Please tell me what&#39;s happening!\u003cbr\u003e\u003cbr\u003e¬†\u003cbr\u003e\u003cbr\u003eHarry jumps onto the coffee table to grab a letter. He gets one and starts to run away. Vernon jumps up as well.\u003cbr\u003e\u003cbr\u003e¬†\u003cbr\u003e\u003cbr\u003eVernon: Give me that! Give me that letter!\u003cbr\u003e\u003cbr\u003e¬†\u003cbr\u003e\u003cbr\u003eHe chases Harry and grabs him before Harry gets into his closet.\u003cbr\u003e\u003cbr\u003e¬†\u003cbr\u003e\u003cbr\u003eHarry: Get off! Ahh!\u003cbr\u003e\u003cbr\u003eVernon: Ahh!\u003cbr\u003e\u003cbr\u003eHarry: They&#39;re my letters! Let go of me!\u003cbr\u003e\u003cbr\u003eVernon: That&#39;s it! We&#39;re going away! Far away! Where they can&#39;t find us!\u003cbr\u003e\u003cbr\u003eDudley: Daddy&#39;s gone mad, hasnt he?!\u003cbr\u003e\u003cbr\u003e¬†\u003cbr\u003e\u003cbr\u003eScene:\u003cbr\u003e\u003cbr\u003eA house, on a rock island somewhere out at sea. The family is sleeping, with Harry on the cold, dirt floor. He has drawn a birthday cake which reads, Happy Birthday Harry. Harry looks at Dudley&#39;s watch, which beeps \u003ca href=\"http://www.youtube.com/watch?v=9bZkp7q19f0&amp;t=12m00s\"\u003e12:00\u003c/a\u003e.\u003cbr\u003e\u003cbr\u003e¬†\u003cbr\u003e\u003cbr\u003eHarry: Make a wish, Harry. {Blows}\u003cbr\u003e\u003cbr\u003e¬†\u003cbr\u003e\u003cbr\u003eSuddenly, the door thumps. Harry jumps. The door thumps again and Dudley and Harry jump up and back away. Petunia and Vernon appear, Vernon with a gun. The door bangs again and then cracks open, and a giant man appears.\u003cbr\u003e\u003cbr\u003e¬†\u003cbr\u003e\u003cbr\u003eVernon: Who&#39;s there? Ahh!\u003cbr\u003e\u003cbr\u003eHagrid: Sorry &#39;bout that. {He puts the door back up}\u003cbr\u003e\u003cbr\u003eVernon: I demand that you leave at once, Sir! You are breaking and entering!\u003cbr\u003e\u003cbr\u003ePetunia: Ooh.\u003cbr\u003e\u003cbr\u003e¬†\u003cbr\u003e\u003cbr\u003eHagrid comes over, grabs the gun and bends it upwards.\u003cbr\u003e\u003cbr\u003e¬†\u003cbr\u003e\u003cbr\u003eHagrid: Dry up, Dursley, you great prune. {The gun fires}\u003cbr\u003e\u003cbr\u003eAll: Ahh!\u003cbr\u003e\u003cbr\u003eHagrid: {sees Dudley} Mind, I haven&#39;t seen you since you was a baby, Harrybut you&#39;re a bit more along than I would have expected. Particularly &#39;round the middle!\u003cbr\u003e\u003cbr\u003eDudley: I-I-I&#39;m not Harry.\u003cbr\u003e\u003cbr\u003eHarry appears: I-I am.\u003cbr\u003e\u003cbr\u003eHagrid: Oh, well, of course you are! Got something for ya. &#39;Fraid I might have sat on it at some point! I imagine that it&#39;ll taste fine just the same. Ahh. Baked it myself. {Hands Harry the cake} Words and all. Heh.\u003cbr\u003e\u003cbr\u003eHarry: Thank you! {Opens cake, which reads: Happee Birdae Harry.}\u003cbr\u003e\u003cbr\u003eHagrid: It&#39;s not every day that your young man turns eleven, now is it?\u003cbr\u003e\u003cbr\u003e¬†\u003cbr\u003e\u003cbr\u003eHagrid sits down on the couch, takes out an umbrella and points it at the empty fire. Poof, poof! Two sparks fly out and the fire starts. The family gapes.\u003cbr\u003e\u003cbr\u003e¬†\u003cbr\u003e\u003cbr\u003eHarry: {puts cake down} Excuse me, who are you?\u003cbr\u003e\u003cbr\u003eHagrid: Rubeus Hagrid. Keeper of keys and grounds at Hogwarts. Course, you&#39;ll know all about Hogwarts.\u003cbr\u003e\u003cbr\u003eHarry: Sorry, no.\u003cbr\u003e\u003cbr\u003eHagrid: No? Blimey, Harry, didn&#39;t you ever wonder where your mum and dad learned it all?\u003cbr\u003e\u003cbr\u003eHarry: Learnt what?\u003cbr\u003e\u003cbr\u003eHagrid: You&#39;re a wizard, Harry.\u003cbr\u003e\u003cbr\u003eHarry: I-I&#39;m a what?\u003cbr\u003e\u003cbr\u003eHarry: A wizard. And a thumping good one at that, I&#39;d wager. Once you train up a little.\u003cbr\u003e\u003cbr\u003eHarry: No, you&#39;ve made a mistake. I can&#39;t be...a-a wizard. I mean, I&#39;m just... Harry. Just Harry.\u003cbr\u003e\u003cbr\u003eHagrid: Well, Just Harry, did you ever make anything happen? Anything you couldn&#39;t explain when you were angry or scared? {Harry softens his expression} Ah.\u003cbr\u003e\u003cbr\u003eDudley: {whimpers}\u003cbr\u003e\u003cbr\u003e¬†\u003cbr\u003e\u003cbr\u003eHagrid hands Harry the same letter that has been sent the past while. Harry opens it.\u003cbr\u003e\u003cbr\u003e¬†\u003cbr\u003e\u003cbr\u003eHarry: Dear, Mr. Potter. We are pleased to inform you that you have been accepted at Hogwarts&#39; School of Witchcraft and Wizardry!\u003cbr\u003e\u003cbr\u003eVernon: Hell not be going! We swore when we took him in wed put an end to this rubbish!\u003cbr\u003e\u003cbr\u003eHarry: You knew?? You knew all along and you never told me?\u003cbr\u003e\u003cbr\u003ePetunia: Of course we knew. How could you not be? My perfect sister being who she was. Oh, my mother and father were so proud the day she got her letter. We have a witch in the family. Isn&#39;t it wonderful? I was the only one to see her for what she was. A freak! And then she met that Potter, and then she had you, and I knew you&#39;d be just the same, just as strange, just as ... abnormal. And then, if you please, she went and got herself blown up! And we got landed with you.\u003cbr\u003e\u003cbr\u003eHarry: Blown up? You told me my parents died in a car crash!\u003cbr\u003e\u003cbr\u003eHagrid: A car crash? A car crash kill James and Lily Potter?\u003cbr\u003e\u003cbr\u003ePetunia: We had to tell him something.\u003cbr\u003e\u003cbr\u003eHagrid: It&#39;s an outrage! It&#39;s a scandal!\u003cbr\u003e\u003cbr\u003eVernon: He&#39;ll not be going!\u003cbr\u003e\u003cbr\u003eHagrid: Oh, and I suppose a great Muggle like yourself&#39;s going to stop him, are you?\u003cbr\u003e\u003cbr\u003eHarry: Muggle?\u003cbr\u003e\u003cbr\u003eHagrid: Non magic folk. This boy&#39;s had his name down ever since he was born! He&#39;s going to the finest school of witchcraft and wizardry in the world, and he&#39;ll be under the greatest headmaster Hogwarts&#39; has ever seen: Albus Dumbledore.\u003cbr\u003e\u003cbr\u003eVernon: I will not pay for some crackpot old fool to teach him magic tricks!\u003cbr\u003e\u003cbr\u003eHagrid: {whips out umbrella and points it at Vernon} Never insult Albus Dumbledore in front of me.\u003cbr\u003e\u003cbr\u003e¬†\u003cbr\u003e\u003cbr\u003eHagrid sees Dudley eating Harry&#39;s cake, and points the umbrella at his rear. A grey tail grows.\u003cbr\u003e\u003cbr\u003e¬†\u003cbr\u003e\u003cbr\u003eDudley: Ahh!\u003cbr\u003e\u003cbr\u003eAll: Ahh! {family chases Dudley}\u003cbr\u003e\u003cbr\u003eHarry: {laughs}\u003cbr\u003e\u003cbr\u003eHagrid: Oh, um, I&#39;d appreciate if you didn&#39;t tell anyone at Hogwarts about that. Strictly speaking, I&#39;m not allowed to do magic.\u003cbr\u003e\u003cbr\u003eHarry: {Nods} Okay.\u003cbr\u003e\u003cbr\u003eHagrid: {checks a clock} Ooh, we&#39;re a bit behind schedule. Best be off. Unless you&#39;d rather stay, of course. Hmm? {Leaves}\u003cbr\u003e\u003cbr\u003e¬†\u003cbr\u003e\u003cbr\u003eHarry grins, looks back, and grins again.\u003cbr\u003e\u003cbr\u003e¬†\u003cbr\u003e\u003cbr\u003eScene:\u003cbr\u003e\u003cbr\u003eStreets of London. Hagrid and Harry are walking.\u003cbr\u003e\u003cbr\u003eHarry: All students must be equipped with...one standard size two pewter cauldron and may bring if they desire either an owl, a cat or a toad. Can we find all this in London?\u003cbr\u003e\u003cbr\u003eHagrid: If you know where to go.\u003cbr\u003e\u003cbr\u003e¬†\u003cbr\u003e\u003cbr\u003eThey go to a corner store and enter, The Leaky Cauldron.\u003cbr\u003e\u003cbr\u003e{Music and talking}\u003cbr\u003e\u003cbr\u003e¬†\u003cbr\u003e\u003cbr\u003eBarkeep Tom: Ah, Hagrid! The usual, I presume?\u003cbr\u003e\u003cbr\u003eHagrid: No thanks, Tom. I&#39;m on official Hogwarts business today. Just helping young Harry here buy his school supplies.\u003cbr\u003e\u003cbr\u003eTom: Bless my soul. It&#39;s Harry Potter.\u003cbr\u003e\u003cbr\u003e¬†\u003cbr\u003e\u003cbr\u003eThe pub goes silent. A man comes up and shakes Harrys hand.\u003cbr\u003e\u003cbr\u003e¬†\u003cbr\u003e\u003cbr\u003eMan: Welcome back, Mr. Potter, welcome back.\u003cbr\u003e\u003cbr\u003e¬†\u003cbr\u003e\u003cbr\u003eA witch comes up and shakes Harrys hand, as well.\u003cbr\u003e\u003cbr\u003e¬†\u003cbr\u003e\u003cbr\u003eWitch: Doris Crockford, Mr. Potter. I can&#39;t believe I&#39;m meeting you at last.\u003cbr\u003e\u003cbr\u003e¬†\u003cbr\u003e\u003cbr\u003eA man in robes with a turban on his head appears. It is PROFESSOR QUIRRELL.\u003cbr\u003e\u003cbr\u003e¬†\u003cbr\u003e\u003cbr\u003eQuirrell: Harry P-potter. C-can&#39;t tell you how pleased I am to meet you.\u003cbr\u003e\u003cbr\u003eHagrid: Hello, Professor. I didn&#39;t see you there. Harry, this is Professor Quirrell. He&#39;ll be your Defense Against the Dark Arts teacher at Hogwarts.\u003cbr\u003e\u003cbr\u003eHarry: Oh, nice to meet you. {Puts out hand. Quirrell refuses}\u003cbr\u003e\u003cbr\u003eQuirrell: F-fearfully fascinating subject. N-not that you need it, e-eh, Potter? Heheh.\u003cbr\u003e\u003cbr\u003eHagrid: Yes, well, must be going now. Lots to buy. Heh.\u003cbr\u003e\u003cbr\u003eHarry: Good-bye.\u003cbr\u003e\u003cbr\u003e¬†\u003cbr\u003e\u003cbr\u003eThe two leave into a back room winery in front of a brick wall.\u003cbr\u003e\u003cbr\u003e¬†\u003cbr\u003e\u003cbr\u003eHagrid: See, Harry, you&#39;re famous!\u003cbr\u003e\u003cbr\u003eHarry: But why am I famous, Hagrid? All those people back there, how is it they know who I am?\u003cbr\u003e\u003cbr\u003eHagrid: I&#39;m not exactly sure I&#39;m the right person to tell you that, Harry. {Taps the brick wall clockwise with his umbrella. The blocks shift and open up to reveal a hidden, busy street.}\u003cbr\u003e\u003cbr\u003eWelcome, Harry, to Diagon Alley. ¬†\u003cbr\u003e\u003cbr\u003e¬†\u003cbr\u003e\u003cbr\u003eHarry grins broadly as they step into the street and walk down it. An owl screeches.\u003cbr\u003e\u003cbr\u003e¬†\u003cbr\u003e\u003cbr\u003eHagrid: Here&#39;s where you&#39;ll get your quills and ink, and over there all your bits and bobs for doing your wizardry.\u003cbr\u003e\u003cbr\u003e¬†\u003cbr\u003e\u003cbr\u003eHarry is amazed as they pass by shops and owls and bats. The camera pans on a broom store, where a group of boys are crowded around a shiny broom.\u003cbr\u003e\u003cbr\u003e¬†\u003cbr\u003e\u003cbr\u003eBoy: It&#39;s a world class racing broom. Look at it, its the new Nimbus 2000! It&#39;s the fastest model yet.\u003cbr\u003e\u003cbr\u003eHarry: But, Hagrid, how am I to pay for all this? I haven&#39;t any money.\u003cbr\u003e\u003cbr\u003eHagrid: Well there&#39;s your money, Harry. Gringotts, the Wizard Bank. T&#39;aint no place safer, &#39;cept perhaps Hogwarts.\u003cbr\u003e\u003cbr\u003e¬†\u003cbr\u003e\u003cbr\u003eInside the bank, they walk down the shiny aisle, passing tiny creatures working.\u003cbr\u003e\u003cbr\u003e¬†\u003cbr\u003e\u003cbr\u003eHarry: Uh, Hagrid, what exactly are those things?\u003cbr\u003e\u003cbr\u003eHagrid: They&#39;re goblins, Harry. Clever as they come goblins but not the most friendly of beasts. Best stick close to me. {Harry sticks to him.} {Hagrid clears his throat as they approach a counter with a goblin in it.} Mr. Harry Potter wishes to make a withdrawal.\u003cbr\u003e\u003cbr\u003e¬†\u003cbr\u003e\u003cbr\u003eThe goblin looks up.\u003cbr\u003e\u003cbr\u003e¬†\u003cbr\u003e\u003cbr\u003eGoblin: And does Mr. Harry Potter have his key?\u003cbr\u003e\u003cbr\u003eHagrid: Oh. Wait a minute. Got it here somewhere. Hah. Here&#39;s the little devil. Oh, and there&#39;s something else as well. Professor Dumbledore gave me this. It&#39;s about you-know-what in vault you-know-which. {Hands Goblin letter wrapped in string.}\u003cbr\u003e\u003cbr\u003eGoblin: Very well.\u003cbr\u003e\u003cbr\u003e¬†\u003cbr\u003e\u003cbr\u003eScene:\u003cbr\u003e\u003cbr\u003eRacing down the depth caverns in a cartlike structure. The cart stops, a goblin, GRIPHOOK, clambers out.\u003cbr\u003e\u003cbr\u003e¬†\u003cbr\u003e\u003cbr\u003eGriphook: Vault 687. Lamp, please. {Hagrid hands him the lamp and he walks to the vault} Key please. {Hagrid hands him the key and he unlocks it}\u003cbr\u003e\u003cbr\u003e¬†\u003cbr\u003e\u003cbr\u003eThe room is filled nearly top to bottom with coins. Harry is amazed.\u003cbr\u003e\u003cbr\u003e¬†\u003cbr\u003e\u003cbr\u003eHagrid: Didn&#39;t think your mum and dad would leave you with nothing, now didja?\u003cbr\u003e\u003cbr\u003e¬†\u003cbr\u003e\u003cbr\u003eThey continue on through the cavern.\u003cbr\u003e\u003cbr\u003e¬†\u003cbr\u003e\u003cbr\u003eGriphook: Vault 713.\u003cbr\u003e\u003cbr\u003eHarry: What&#39;s in there, Hagrid?\u003cbr\u003e\u003cbr\u003eHagrid: Can&#39;t tell you, Harry. It&#39;s Hogwarts business. Very secret.\u003cbr\u003e\u003cbr\u003eGriphook: Stand back. {Slides finger down the door. Clank. Clank. The vault opens to expose a small white stone package. Hagrid hurries in and scoops it up. The eerie light it was shining with disappears.}\u003cbr\u003e\u003cbr\u003e¬†\u003cbr\u003e\u003cbr\u003eHagrid: Best not mention this to anyone, Harry.\u003cbr\u003e\u003cbr\u003eHarry nods.\u003cbr\u003e\u003cbr\u003e¬†\u003cbr\u003e\u003cbr\u003eScene: Outside in the street, walking.\u003cbr\u003e\u003cbr\u003e¬†\u003cbr\u003e\u003cbr\u003eHarry: I still need...a wand.\u003cbr\u003e\u003cbr\u003eHagrid: A wand? Well, you&#39;ll want Ollivanders. No place better. Run along therebut wait. I just got one more thing I got to do. Won&#39;t be long.\u003cbr\u003e\u003cbr\u003e¬†\u003cbr\u003e\u003cbr\u003eHarry goes into the store, quietly. He looks around. There are shelves of wandsbut no people.\u003cbr\u003e\u003cbr\u003e¬†\u003cbr\u003e\u003cbr\u003eHarry: {Softly} Hello? Hello?\u003cbr\u003e\u003cbr\u003e¬†\u003cbr\u003e\u003cbr\u003eThere is a thunk. A man appears on a ladder and looks at Harry. He smiles.\u003cbr\u003e\u003cbr\u003e¬†\u003cbr\u003e\u003cbr\u003eOllivander: I wondered when I&#39;d be seeing you, Mr. Potter. It seems only yesterday that your mother and father were in here buying their first wands. {Picks a wand} Ah. Here we are. {Harry holds it but just stands} Well, give it a wave.\u003cbr\u003e\u003cbr\u003eHarry: Oh! {waves. All the shelves come crashing down. Harry jumps and hurriedly puts the wand back on the counter.}\u003cbr\u003e\u003cbr\u003eOllivander: Apparently not. {Gets another wand.} Perhaps this. {Harry waves at a vase, which blows apart.} No, no, definitely not! No matter...{gets a wand} I wonder. {Hands wand to Harry. Harry glows under it.} Curious, very curious.\u003cbr\u003e\u003cbr\u003eHarry: Sorrybut what&#39;s curious?\u003cbr\u003e\u003cbr\u003eOllivander: I remember every wand I&#39;ve ever sold, Mr. Potter. It just so happens that the phoenix, whose tail feather resides in your wand gave one other feather, just one. It is curious that you should be destined for this wand when its brother gave you that scar. {Points to scar}\u003cbr\u003e\u003cbr\u003eHarry: And...who owned that wand?\u003cbr\u003e\u003cbr\u003eOllivander: Oh, we do not speak his name. The wand chooses the wizard, Mr. Potter. It&#39;s not always clear whybut I think it is clear that we can expect great things from you. After all, He-Who-Must-Not-Be-Named did great things...terrible, yesbut great. {Hands Harry his wand.}\u003cbr\u003e\u003cbr\u003e¬†\u003cbr\u003e\u003cbr\u003eThere is a knock on the window.\u003cbr\u003e\u003cbr\u003e¬†\u003cbr\u003e\u003cbr\u003eHagrid: Harry! Harry! Happy birthday! {Has a snowy owl in a cage which hoots.}\u003cbr\u003e\u003cbr\u003eHarry: Wow.\u003cbr\u003e\u003cbr\u003e¬†\u003cbr\u003e\u003cbr\u003eScene: Later, eating supper. The two, Hagrid and Harry, are at a long table, eating soup.\u003cbr\u003e\u003cbr\u003e¬†\u003cbr\u003e\u003cbr\u003eHagrid: You all right, Harry? You seem very quiet.\u003cbr\u003e\u003cbr\u003eHarry: He killed my parents, didn&#39;t he? The one who gave me this. You know, Hagrid, I know you do.\u003cbr\u003e\u003cbr\u003eHagrid: {Sighs and pushes bowl away} First, and understand this, Harry, &#39;cause it&#39;s very important. Not all wizards are good. Some of them go bad. A few years ago there was one wizard who went as bad as you can go. And his name was V-...his name was V-...\u003cbr\u003e\u003cbr\u003eHarry: Maybe if you wrote it down?\u003cbr\u003e\u003cbr\u003eHagrid: No, I can&#39;t spell it. All right. His name was Voldemort.\u003cbr\u003e\u003cbr\u003eHarry: Voldemort?\u003cbr\u003e\u003cbr\u003eHagrid: Shh!!\u003cbr\u003e\u003cbr\u003e{Harry looks around}\u003cbr\u003e\u003cbr\u003e¬†\u003cbr\u003e\u003cbr\u003eA flashback ensues, consisting off a cloaked man walking towards a house, breaking in with his wand, and proceeding to terrorize. Hagrid narrates.\u003cbr\u003e\u003cbr\u003e¬†\u003cbr\u003e\u003cbr\u003eHagrid: It was dark times, Harry, dark times. Voldemort started to gather some followers, brought &#39;em over to the dark side. Anyone that stood up to him ended up dead. Your parents fought against himbut nobody lived once he decided to kill &#39;em. {Harrys mother, LILY, screams as she is killed by Voldemorts wand} Nobody...not one. Except you. {close-up of baby Harry.}\u003cbr\u003e\u003cbr\u003eHarry: Me? Voldemort tried to kill...me?\u003cbr\u003e\u003cbr\u003eHagrid: Yes. That ain&#39;t no ordinary cut on your forehead, Harry. A mark like that only comes from being touched by a curse...and an evil curse at that.\u003cbr\u003e\u003cbr\u003eHarry: What happened to Vo-...to You-Know-Who?\u003cbr\u003e\u003cbr\u003eHagrid: Some say he died. Codswallop in my opinion. Nope, I reckon he&#39;s out there, still, too tired to go on. But one thing&#39;s absolutely certain. Something about you stumped him that night. That&#39;s why you&#39;re famous, Harry. That&#39;s why everbody knows your name. You&#39;re the boy who lived.\u003cbr\u003e\u003cbr\u003e¬†\u003cbr\u003e\u003cbr\u003e\u003cbr\u003e¬†¬†\u003cbr\u003eScene: London Train Station. Up on a crossing bridge, Harry (with cart and owl) walk beside Hagrid.\u003cbr\u003e\u003cbr\u003e¬†\u003cbr\u003e\u003cbr\u003eA couple look at Hagrid.\u003cbr\u003e\u003cbr\u003e¬†\u003cbr\u003e\u003cbr\u003eHagrid: What&#39;re you looking at? {Looks at watch} Blimey, is that the time?? Sorry, Harry, I&#39;m gonna have to leave you. Dumbledore&#39;ll be wanting his...well, he&#39;ll be wanting to see me. Now, uh, your train leaves in 10 minutes. Here&#39;s your ticket. Stick to it, Harry that&#39;s very important. Stick to your ticket.\u003cbr\u003e\u003cbr\u003e¬†\u003cbr\u003e\u003cbr\u003eHarry looks at his golden ticket.\u003cbr\u003e\u003cbr\u003e¬†\u003cbr\u003e\u003cbr\u003eHarry: Platform 9 ¬æ? But Hagrid, there must be a mistake. This says Platform 9 ¬æ. There&#39;s no such thing...is there? {Harry looks up and Hagrid has vanished.}\u003cbr\u003e\u003cbr\u003e¬†\u003cbr\u003e\u003cbr\u003eScene: Harry is walking down lane between trains. A man rushes by.\u003cbr\u003e\u003cbr\u003e¬†\u003cbr\u003e\u003cbr\u003eMan: Sorry.\u003cbr\u003e\u003cbr\u003eHarry sees a train master.\u003cbr\u003e\u003cbr\u003eHarry: Excuse me, excuse me.\u003cbr\u003e\u003cbr\u003eTrainmaster: {talking to woman and child} Right on your left, ma&#39;am.\u003cbr\u003e\u003cbr\u003eHarry: Excuse me, Sir. Can you tell me where I might find Platform 9 ¬æ?\u003cbr\u003e\u003cbr\u003eTrainmaster: 9 ¬æ? Think youre being funny, do ya? {Leaves}\u003cbr\u003e\u003cbr\u003e¬†\u003cbr\u003e\u003cbr\u003eA woman, daughter, and four boys walk by, pushing carts.\u003cbr\u003e\u003cbr\u003e¬†\u003cbr\u003e\u003cbr\u003eMrs. Weasley: It&#39;s the same year after year. Always packed with Muggles, of course.\u003cbr\u003e\u003cbr\u003eHarry: Muggles?\u003cbr\u003e\u003cbr\u003eMrs. Weasley: Come on. Platform 9 ¬æ this way! All right, Percy, you first.\u003cbr\u003e\u003cbr\u003e¬†\u003cbr\u003e\u003cbr\u003eA tall boy with red hair comes forward and runs towards a brick wall. Amazingly, he disappears right into it. Harry is amazed.\u003cbr\u003e\u003cbr\u003e¬†\u003cbr\u003e\u003cbr\u003eMrs. Weasley: Fred, you next.\u003cbr\u003e\u003cbr\u003eGeorge: He&#39;s not Fred, I am!\u003cbr\u003e\u003cbr\u003eFred: Honestly, woman, you call yourself our mother!\u003cbr\u003e\u003cbr\u003eMrs. Weasley: Oh, I&#39;m sorry, George.\u003cbr\u003e\u003cbr\u003eFred: I&#39;m only joking. I am Fred. {He runs through the wall, and is followed by his twin brother.}\u003cbr\u003e\u003cbr\u003e¬†\u003cbr\u003e\u003cbr\u003eHarry shakes his head in disbelief.\u003cbr\u003e\u003cbr\u003e¬†\u003cbr\u003e\u003cbr\u003eHarry: Excuse me! C-could you tell me how to\u003cbr\u003e\u003cbr\u003eMrs. Weasley: How to get on the platform? Yes, not to worry, dear. It&#39;s Ron&#39;s first time to Hogwarts as well. {pan to a red haired boy who smiles} Now, all you&#39;ve got to do is walk straight at the wall between platforms 9 and 10. Best do it at a bit of a run if youre nervous.\u003cbr\u003e\u003cbr\u003eGinny (daughter): Good luck.\u003cbr\u003e\u003cbr\u003e¬†\u003cbr\u003e\u003cbr\u003eHarry takes a breath and runs at the wall. He shuts his eyes and emerges on the other side a magnificent station with a red train and bundles of people. A whistle blows, and Harry sighs with relief.\u003cbr\u003e\u003cbr\u003e¬†\u003cbr\u003e\u003cbr\u003eScene: The train is traveling through unknown country. Pan to inside compartment, where Harry is sitting. The red headed boy, RON, appears, dirt on his nose.\u003cbr\u003e\u003cbr\u003e¬†\u003cbr\u003e\u003cbr\u003eRon: Excuse me, do you mind? Everywhere else is full.\u003cbr\u003e\u003cbr\u003eHarry: No, not at all.\u003cbr\u003e\u003cbr\u003eRon: {sits across from Harry} I&#39;m Ron, by the way. Ron Weasley.\u003cbr\u003e\u003cbr\u003eHarry: I&#39;m Harry. Harry Potter.\u003cbr\u003e\u003cbr\u003e{Ron goes agape.}\u003cbr\u003e\u003cbr\u003eRon: So-so it&#39;s true?! I mean, do you really have the...the...\u003cbr\u003e\u003cbr\u003eHarry: The what?\u003cbr\u003e\u003cbr\u003eRon: {whispers} Scar...?\u003cbr\u003e\u003cbr\u003eHarry: Oh, yeah. {lifts up hair}\u003cbr\u003e\u003cbr\u003eRon: Wicked.\u003cbr\u003e\u003cbr\u003eA trolley comes by the compartment, full of sweets.\u003cbr\u003e\u003cbr\u003eWoman: Anything off the trolley, dears?\u003cbr\u003e\u003cbr\u003eRon: {Holds up mushed sandwiches} No, thanks, I&#39;m all set. {smacks lips.}\u003cbr\u003e\u003cbr\u003eHarry: {pulls out coins} We&#39;ll take the lot!\u003cbr\u003e\u003cbr\u003eRon: Whoa!\u003cbr\u003e\u003cbr\u003e¬†\u003cbr\u003e\u003cbr\u003eScene: Eating bundles of sweets.\u003cbr\u003e\u003cbr\u003eRon&#39;s rat, Scabbers, is perched on Ron&#39;s knee, a box over its head.\u003cbr\u003e\u003cbr\u003e¬†\u003cbr\u003e\u003cbr\u003eHarry: Bertie Bott&#39;s Every Flavour Beans?\u003cbr\u003e\u003cbr\u003eRon: They mean every flavour! There&#39;s chocolate and peppermint, and there&#39;s also spinach, liver and tripe. George sweared he got a bogey-flavoured one once!\u003cbr\u003e\u003cbr\u003e¬†\u003cbr\u003e\u003cbr\u003eHarry quickly takes the bean he was chewing out of his mouth.\u003cbr\u003e\u003cbr\u003e¬†\u003cbr\u003e\u003cbr\u003eHarry: {picks up blue and gold package} These aren&#39;t real chocolate frogs, are they?\u003cbr\u003e\u003cbr\u003eRon: It&#39;s only a spell. Besides, it&#39;s the cards you want. Each pack&#39;s got a famous witch or wizard. I got about 500 meself.\u003cbr\u003e\u003cbr\u003eFrog: Ribbit. {The frog jumps onto the window and climbs up, then leaps out the window...disappearing.}\u003cbr\u003e\u003cbr\u003eRon: Oh, that&#39;s rotten luck. They&#39;ve only got one good jump in them to begin with.\u003cbr\u003e\u003cbr\u003eHarry: Hey, I got Dumbledore!\u003cbr\u003e\u003cbr\u003eRon: I got about 6 of him.\u003cbr\u003e\u003cbr\u003eHarry: Hey, he&#39;s gone!\u003cbr\u003e\u003cbr\u003eRon: Well, you can&#39;t expect him to hang around all day, can you? {Scabbers squeaks} This is Scabbers, by the way, pitiful, isn&#39;t he?\u003cbr\u003e\u003cbr\u003eHarry: Just a little bit.\u003cbr\u003e\u003cbr\u003eRon: Fred gave me a spell as to turn him yellow. Want to see?\u003cbr\u003e\u003cbr\u003eHarry: Yeah!\u003cbr\u003e\u003cbr\u003eRon: {clears throat} Ahem. Sun-\u003cbr\u003e\u003cbr\u003e¬†\u003cbr\u003e\u003cbr\u003eA girl, HERMIONE GRANGER, with bushy brown hair appears at the doorway.\u003cbr\u003e\u003cbr\u003e¬†\u003cbr\u003e\u003cbr\u003eHermione: Has anyone seen a toad? A boy named Neville&#39;s lost one.\u003cbr\u003e\u003cbr\u003eRon: No.\u003cbr\u003e\u003cbr\u003eHermione: Oh, are you doing magic? Let&#39;s see then.\u003cbr\u003e\u003cbr\u003eRon: Aghhhemm. Sunshine, daisesbutter mellow, turn this stupid fat rat yellow!\u003cbr\u003e\u003cbr\u003e{Zap. Nothing happens. Ron shrugs.}\u003cbr\u003e\u003cbr\u003eHermione: Are you sure that&#39;s a real spell? Well, it&#39;s not very good, is it? Of course I&#39;ve only tried a few simple spells myself, and they&#39;ve all worked for me. For example...{Hermione goes over and sits across from Harry. He points her hand at his glasses and Harry tenses} Oculus Reparo. {The glasses, which noseband is battered, are repaired. Harry takes them off, amazed.} That&#39;s better, isn&#39;t it? Holy Cricket, you&#39;re Harry Potter. I&#39;m Hermione Granger...and you are...?\u003cbr\u003e\u003cbr\u003eRon: {full mouth} I&#39;m...Ron Weasley.\u003cbr\u003e\u003cbr\u003eHermione: Pleasure. You two better change into your robes. I expect we&#39;ll be arriving soon. {Gets up and leaves, then comes back and looks at Ron.} You&#39;ve got dirt, on your nose, by the way, did you know? Just there. {Points} {Ron scratches his nose, embarrassed.}\u003cbr\u003e\u003cbr\u003e¬†\u003cbr\u003e\u003cbr\u003eScene: Darkness, the train blows its whistle and pulls into an outdoor station. Hagrid walks along the side aisle, with a lantern. People begin pouring out of the train.\u003cbr\u003e\u003cbr\u003e¬†\u003cbr\u003e\u003cbr\u003eHagrid: Right, then! First years! This way, please! Come on, now, don&#39;t be shy! Come on now, hurry up!\u003cbr\u003e\u003cbr\u003e¬†\u003cbr\u003e\u003cbr\u003eHarry and Ron walk up to Hagrid.\u003cbr\u003e\u003cbr\u003e¬†\u003cbr\u003e\u003cbr\u003eHagrid: Hello, Harry.\u003cbr\u003e\u003cbr\u003eHarry: Hey, Hagrid.\u003cbr\u003e\u003cbr\u003eRon: Whoaa!\u003cbr\u003e\u003cbr\u003eHagrid: Right then. This way to the boats! Come on, now, follow me.\u003cbr\u003e\u003cbr\u003e¬†\u003cbr\u003e\u003cbr\u003eScene:\u003cbr\u003e\u003cbr\u003eA number of boats are plugging across a vast lake, where up ahead a huge castle can be seen. People are in awe.\u003cbr\u003e\u003cbr\u003eRon: Wicked.\u003cbr\u003e\u003cbr\u003e¬†\u003cbr\u003e\u003cbr\u003eScene: On a higher level, Professor McGonagall is waiting. She raps her fingers on a stone railing, and then goes to the top of the stairs to greet the newcomers.\u003cbr\u003e\u003cbr\u003e¬†\u003cbr\u003e\u003cbr\u003eMcGonagall: Welcome to Hogwarts. Now, in a few moments, you will pass through these doors and join your classmates. But before you can take your seats you must be sorted into your houses. They are Gryffindor, Ravenclaw, Hufflepuff, and Slytherin. Now, while you are here, your house will be like your family. Your triumphs will earn you house points. Any rule breaking, and you will lose points. At the end of the year, the house with the most points is awarded the house cup\u003cbr\u003e\u003cbr\u003e¬†\u003cbr\u003e\u003cbr\u003eNEVILLE LONGBOTTOM, a scared looking boy, spots his toad sitting near McGonagall. He jumps forward.\u003cbr\u003e\u003cbr\u003e¬†\u003cbr\u003e\u003cbr\u003eNeville: Trevor! {McGonagall stares down at him} Sorry. {He backs away.}\u003cbr\u003e\u003cbr\u003eMcGonagall: The sorting ceremony will begin momentarily. {leaves}\u003cbr\u003e\u003cbr\u003e¬†\u003cbr\u003e\u003cbr\u003eDRACO MALFOY, a slicked back evil looking boy speaks up.\u003cbr\u003e\u003cbr\u003e¬†\u003cbr\u003e\u003cbr\u003eDraco: It&#39;s true then, what they&#39;re saying on the train. Harry Potter has come to Hogwarts. {Students whisper, Harry Potter?} This is Crabbe, and Goyle {nods to thugs} and I&#39;m Malfoy...Draco Malfoy. {Ron snickers at his name} Think my name&#39;s funny, do you? No need to ask yours. Red hair, and a hand me down robe? You must be a Weasley. Well soon find that some wizarding families are better than others, Potter. Dont want to go making friends with the wrong sort. I can help you there. {extends hand.}\u003cbr\u003e\u003cbr\u003eHarry: I think I can tell who the wrong sort are for myself, thanks.\u003cbr\u003e\u003cbr\u003e¬†\u003cbr\u003e\u003cbr\u003eDraco glares. McGonagall returns and smacks him on the shoulder with a paper. He retreats with one last glare.\u003cbr\u003e\u003cbr\u003e¬†\u003cbr\u003e\u003cbr\u003eMcGonagall: We&#39;re ready for you now.\u003cbr\u003e\u003cbr\u003e¬†\u003cbr\u003e\u003cbr\u003eShe leads everyone through two large doors and into the Great Hall, where there are four long tables with many kids, as well as floating candles. The roof appears to be the sky.\u003cbr\u003e\u003cbr\u003e¬†\u003cbr\u003e\u003cbr\u003eHermione: It&#39;s not real, the ceiling. It&#39;s just bewitched to look like the night sky. I read about it in Hogwarts: A History.\u003cbr\u003e\u003cbr\u003eMcGonagall: All right, will you wait along here, please? Now, before we begin, Professor Dumbldedore would like to say a few words.\u003cbr\u003e\u003cbr\u003e¬†\u003cbr\u003e\u003cbr\u003eDumbledore rises from the main table.\u003cbr\u003e\u003cbr\u003e¬†\u003cbr\u003e\u003cbr\u003eDumbledore: I have a few start of term notices I wish to announce. The first years please note that the dark forest is strictly forbidden to all students. Also, our caretaker, Mr. Filch {signals to ragged old man with a cat with red eyes} has asked me to remind you that the 3rd floor corridor on the right hand side is out of bounds to everyone who does not wish to die a most painful death. Thank you.\u003cbr\u003e\u003cbr\u003eMcGonagall: When I call your name, you will come forth, I shall place the sorting hat on your head, and you will be sorted into your houses. Hermione Granger.\u003cbr\u003e\u003cbr\u003eHermione: Oh, no. Okay, relax. {She goes up}\u003cbr\u003e\u003cbr\u003eRon: Mental that one, I&#39;m telling you.\u003cbr\u003e\u003cbr\u003eHarry nods in agreement.\u003cbr\u003e\u003cbr\u003eSorting Hat: Ah, right then...hmm...right. Okay...Gryffindor!!\u003cbr\u003e\u003cbr\u003e(Cheering)\u003cbr\u003e\u003cbr\u003e¬†\u003cbr\u003e\u003cbr\u003eHermione jumps off with a smile.\u003cbr\u003e\u003cbr\u003e¬†\u003cbr\u003e\u003cbr\u003eMcGonagall: Draco Malfoy.\u003cbr\u003e\u003cbr\u003e¬†\u003cbr\u003e\u003cbr\u003eDraco saunters up proudly. The tattered hat nearly freaks before touching down on Dracos head.\u003cbr\u003e\u003cbr\u003e¬†\u003cbr\u003e\u003cbr\u003eSorting Hat: SLYTHERIN!\u003cbr\u003e\u003cbr\u003e¬†\u003cbr\u003e\u003cbr\u003eRon: There isn&#39;t a witch or wizard who went bad who wasnt in Slytherin.\u003cbr\u003e\u003cbr\u003eMcGonagall: Susan Bones.\u003cbr\u003e\u003cbr\u003e¬†\u003cbr\u003e\u003cbr\u003eA small, redhead goes up.\u003cbr\u003e\u003cbr\u003eHarry looks around and spots a black haired, pale teacher, SEVERUS SNAPE, looking at him. His scar hurts.\u003cbr\u003e\u003cbr\u003e¬†\u003cbr\u003e\u003cbr\u003eHarry: Ahh! {puts hand on forehead}\u003cbr\u003e\u003cbr\u003eRon: Harry, what is it?\u003cbr\u003e\u003cbr\u003eHarry: Nothing...it&#39;s nothing, I&#39;m fine.\u003cbr\u003e\u003cbr\u003e¬†\u003cbr\u003e\u003cbr\u003eSorting Hat: Let&#39;s see...I know...Hufflepuff!\u003cbr\u003e\u003cbr\u003eMcGonagall: Ronald Weasley.\u003cbr\u003e\u003cbr\u003e¬†\u003cbr\u003e\u003cbr\u003eRon gulps and walks up. He sits down and the hat is put on.\u003cbr\u003e\u003cbr\u003e¬†\u003cbr\u003e\u003cbr\u003eSorting Hat: Ah! Another Weasley. I know just where to put you...Gryffindor!!\u003cbr\u003e\u003cbr\u003eRon: {Sighs}\u003cbr\u003e\u003cbr\u003e(Cheering)\u003cbr\u003e\u003cbr\u003e¬†\u003cbr\u003e\u003cbr\u003eMcGonagall: Harry Potter.\u003cbr\u003e\u003cbr\u003e¬†\u003cbr\u003e\u003cbr\u003eEverything goes silent. Harry walks up and sits down.\u003cbr\u003e\u003cbr\u003e¬†\u003cbr\u003e\u003cbr\u003eSorting Hat: Hmm...difficult, very difficult. Plenty of courage I see, not a bad mind, either. There&#39;s talent, oh yes, and a thirst to prove yourself. But where to put you?\u003cbr\u003e\u003cbr\u003eHarry: {whispers} Not Slytherin. Not Slytherin.\u003cbr\u003e\u003cbr\u003eSorting Hat: Not Slytherin, eh? Are you sure? You could be great, you know. Its all here in your head. And Slytherin will help you on your way to greatness! There&#39;s no doubt about that! No? {Harry whispers: Not Slytherin...anything but Slytherin} Well, if youre sure...better be...GRYFFINDOR!!\u003cbr\u003e\u003cbr\u003e¬†\u003cbr\u003e\u003cbr\u003eThere is an immense cheering and Harry goes to the Gryffindor table.\u003cbr\u003e\u003cbr\u003eFred and George are also there, and cheer: We got Potter! We got Potter! Harry sits down.\u003cbr\u003e\u003cbr\u003e¬†\u003cbr\u003e\u003cbr\u003eMcGonagall: {dings on a cup} Your attention, please.\u003cbr\u003e\u003cbr\u003eDumbledore: Let the feast...begin.\u003cbr\u003e\u003cbr\u003e¬†\u003cbr\u003e\u003cbr\u003eFood magically appears on all the tables, and the hall is filled with awe and chatter.\u003cbr\u003e\u003cbr\u003e¬†\u003cbr\u003e\u003cbr\u003eHarry: Wow.\u003cbr\u003e\u003cbr\u003e¬†\u003cbr\u003e\u003cbr\u003eDraco looks at all the food, raises his eyebrows and digs in.\u003cbr\u003e\u003cbr\u003eRon stuffs his face.\u003cbr\u003e\u003cbr\u003e¬†\u003cbr\u003e\u003cbr\u003eSEAMUS FINNIGAN, a tiny boy, speaks.\u003cbr\u003e\u003cbr\u003e¬†\u003cbr\u003e\u003cbr\u003eSeamus: I&#39;m half and half. Me dad&#39;s a Muggle. Mam&#39;s a witch. Bit of a nasty shock for him when he found out.\u003cbr\u003e\u003cbr\u003eNeville laughs.\u003cbr\u003e\u003cbr\u003e¬†\u003cbr\u003e\u003cbr\u003eHarry is sitting next to Percy. He leans over.\u003cbr\u003e\u003cbr\u003e¬†\u003cbr\u003e\u003cbr\u003eHarry: Say, Percy, who&#39;s that teacher talking to Professor Quirrell?\u003cbr\u003e\u003cbr\u003ePercy: Oh, that&#39;s Professor Snape, head of Slytherin house.\u003cbr\u003e\u003cbr\u003eHarry: What&#39;s he teach?\u003cbr\u003e\u003cbr\u003ePercy: Potions. But everyone knows it&#39;s the Dark Arts he fancies. He&#39;s been after Quirrells job for years.\u003cbr\u003e\u003cbr\u003e¬†\u003cbr\u003e\u003cbr\u003eRon, having just finished a chicken wing, reaches into the bowl for more, and a ghostly head, SIR NICHOLAS, pops out.\u003cbr\u003e\u003cbr\u003e¬†\u003cbr\u003e\u003cbr\u003eRon: Ahh!\u003cbr\u003e\u003cbr\u003eNick: Hello! How are you? Welcome to Gryffindor.\u003cbr\u003e\u003cbr\u003e¬†\u003cbr\u003e\u003cbr\u003eNumerous ghosts come pouring from the walls, sailing along.\u003cbr\u003e\u003cbr\u003e¬†\u003cbr\u003e\u003cbr\u003eHufflepuff ghost: Whoo-hoo-hoo!\u003cbr\u003e\u003cbr\u003eGirl: Look, its the Bloody Baron!\u003cbr\u003e\u003cbr\u003ePercy: Hello, Sir Nicholas. Have a nice summer?\u003cbr\u003e\u003cbr\u003eNick: Dismal. Once again, my request to join the headless hunt has been denied. {Begins to leave}\u003cbr\u003e\u003cbr\u003eRon: Hey, I know you! You&#39;re Nearly Headless Nick!\u003cbr\u003e\u003cbr\u003eNick: I prefer Sir Nicholas if you don&#39;t mind.\u003cbr\u003e\u003cbr\u003eHermione: Nearly headless? How can you be nearly headless?\u003cbr\u003e\u003cbr\u003eNick: Like this. {Grabs head and pulls it to the side. His head is hanging on just by a thread.}\u003cbr\u003e\u003cbr\u003eRon: Ahh!\u003cbr\u003e\u003cbr\u003eHermione: Eugh.\u003cbr\u003e\u003cbr\u003e¬†\u003cbr\u003e\u003cbr\u003eScene:\u003cbr\u003e\u003cbr\u003ePercy is leading the Gryffindors to the staircases.\u003cbr\u003e\u003cbr\u003e¬†\u003cbr\u003e\u003cbr\u003ePercy: Gryffindors, follow me please. Keep up. Thank you.\u003cbr\u003e\u003cbr\u003eBoy: Ravenclaw, follow me. This way.\u003cbr\u003e\u003cbr\u003ePercy: This is the most direct path to the dormitories. Oh, and keep an eye on the staircases...they like to change.\u003cbr\u003e\u003cbr\u003e¬†\u003cbr\u003e\u003cbr\u003eThe camera pans up and we see a vast amount of staircases, people walking on them, and some switching places.\u003cbr\u003e\u003cbr\u003e¬†\u003cbr\u003e\u003cbr\u003ePercy: Keep up, please, and follow me. Quickly now, come on. Come on. {They begin walking up the stairs}\u003cbr\u003e\u003cbr\u003eNeville: Seamus, that picture&#39;s moving!\u003cbr\u003e\u003cbr\u003eRon: Look at that one, Harry!\u003cbr\u003e\u003cbr\u003eHarry: I think she fancies you.\u003cbr\u003e\u003cbr\u003eGirl: Oh, look! Look! Who&#39;s that girl?\u003cbr\u003e\u003cbr\u003eMan in painting: Welcome to Hogwarts.\u003cbr\u003e\u003cbr\u003eGirl: Who&#39;s that?\u003cbr\u003e\u003cbr\u003e¬†\u003cbr\u003e\u003cbr\u003eScene:\u003cbr\u003e\u003cbr\u003eApproaching the Gryffindor dorms. They come up to a large painting of a large woman in a pink dress.\u003cbr\u003e\u003cbr\u003e¬†\u003cbr\u003e\u003cbr\u003eWoman: Password?\u003cbr\u003ePercy: Caput Draconis. {The woman nods and the painting opens to reveal a gape in the wall.} Follow me, everyone. Keep up, quickly, come on.\u003cbr\u003e\u003cbr\u003eGirl: Oh, wow.\u003cbr\u003e\u003cbr\u003ePercy: {Inside common room} Gather &#39;round here. Welcome to the Gryffindor Common Room. Boys&#39; dormitories, upstairs and down to your left. Girls, the same on your right. You&#39;ll find that your belongings have already been brought up.\u003cbr\u003e\u003cbr\u003e¬†\u003cbr\u003e\u003cbr\u003eScene: Mid-night. Harry is sitting by a window in his pj&#39;s, with his owl, Hedwig. He pets the owl and looks out the window, sighing with content.\u003cbr\u003e\u003cbr\u003e¬†\u003cbr\u003e\u003cbr\u003e\u003cbr\u003e¬†\u003cbr\u003eScene: Morning. Harry and Ron are running through the stone halls to their class. They rush in. In the class, a tabby cat is sitting on a desk.\u003cbr\u003e\u003cbr\u003e¬†\u003cbr\u003e\u003cbr\u003eRon: Whew, amazing, can you imagine the look on old McGonagall&#39;s face if we were late?\u003cbr\u003e\u003cbr\u003e¬†\u003cbr\u003e\u003cbr\u003eThe cat jumps off the desk and turns into Professor McGonagall. The two boys are amazed.\u003cbr\u003e\u003cbr\u003e¬†\u003cbr\u003e\u003cbr\u003eRon: That was bloody brilliant.\u003cbr\u003e\u003cbr\u003eMcGonagall: Thank you for that assessment, Mr. Weasley. Maybe if I were to transfigure Mr. Potter and yourself into a pocketwatch, maybe one of you would be on time.\u003cbr\u003e\u003cbr\u003eHarry: We got lost.\u003cbr\u003e\u003cbr\u003eMcGonagall: Then perhaps a map? I trust you don&#39;t need one to find your seats.\u003cbr\u003e\u003cbr\u003e¬†\u003cbr\u003e\u003cbr\u003eScene: Snape&#39;s potions class. The students are chattering, sitting near steaming cauldrons. The door slams open and Snape comes rushing in.\u003cbr\u003e\u003cbr\u003e¬†\u003cbr\u003e\u003cbr\u003eSnape: There will be no foolish wand waving or silly incantations in this class. As such, I don&#39;t expect many of you to enjoy the subtle science and exact art that is potion making. However, for those select few {looks at Draco, who smiles}, who possess the predisposition, I can teach you how to bewitch the mind and ensnare the senses. I can tell you how to bottle fame, brew glory and even put a stopper {Draco looks on} in death. {Draco raises his eyebrows.} {Snape sees Harry, writing this down, in, his view, not paying attention.} Then again, maybe some of you have come to Hogwarts in possession of abilities so formidable that you feel confidant enough to not...pay...attention.\u003cbr\u003e\u003cbr\u003e¬†\u003cbr\u003e\u003cbr\u003eHermione nudges Harry in the ribs. He looks up.\u003cbr\u003e\u003cbr\u003e¬†\u003cbr\u003e\u003cbr\u003eSnape: Mr. Potter. Our...new...celebrity. Tell me, what would I get if I added powdered root of asphodel to an infusion of wormwood? {Hermione&#39;s hand skyrockets. Harry shrugs.} You don&#39;t know? Well, let&#39;s try again. Where, Mr. Potter, would you look if I asked you to find me a bezoar? {Hermione&#39;s hand shoots up again.}\u003cbr\u003e\u003cbr\u003eHarry: I don&#39;t know, Sir.\u003cbr\u003e\u003cbr\u003eSnape: And what is the difference between Monkshood and Wolfbane?\u003cbr\u003e\u003cbr\u003eHarry: I don&#39;t know, Sir.\u003cbr\u003e\u003cbr\u003eSnape: Pity. Clearly, fame isn&#39;t everything, is it, Mr. Potter?\u003cbr\u003e\u003cbr\u003e¬†\u003cbr\u003e\u003cbr\u003eScene: In the great hall, probably midday. The students are all working on homework.\u003cbr\u003e\u003cbr\u003e¬†\u003cbr\u003e\u003cbr\u003eSeamus is trying a spell on a cup.\u003cbr\u003e\u003cbr\u003e¬†\u003cbr\u003e\u003cbr\u003eSeamus: Eye of rabbit, harp string hum. Turn this water, into rum. {Looks in cup and shakes head.} Eye of rabbit, harp string hum...\u003cbr\u003e\u003cbr\u003eHarry: What&#39;s Seamus trying to do to that glass of water?\u003cbr\u003e\u003cbr\u003eRon: Turn it into rum. Actually managed a weak tea yesterday, before...\u003cbr\u003e\u003cbr\u003e¬†\u003cbr\u003e\u003cbr\u003eZAPOOF! The cup explodes. There is laughter amongst the students. Suddenly, a flock of owls start coming into the hall from the rafters above.\u003cbr\u003e\u003cbr\u003e¬†\u003cbr\u003e\u003cbr\u003eRon: Ah. Mail&#39;s here!\u003cbr\u003e\u003cbr\u003e¬†\u003cbr\u003e\u003cbr\u003eThe owls soar by, dropping parcels to students. Harry gets nothing. He sees the newspaper Ron has put down.\u003cbr\u003e\u003cbr\u003e¬†\u003cbr\u003e\u003cbr\u003eHarry: Can I borrow this? {Ron nods} Thanks.\u003cbr\u003e\u003cbr\u003e¬†\u003cbr\u003e\u003cbr\u003eNeville is unwrapping a gift. It is a clear ball with gold around it.\u003cbr\u003e\u003cbr\u003e¬†\u003cbr\u003e\u003cbr\u003eSeamus: Hey, look! Neville&#39;s got a Remembrall!\u003cbr\u003e\u003cbr\u003eHermione: I&#39;ve read about those. When the smoke turns red {the smoke turns red}, it means you&#39;ve forgotten something.\u003cbr\u003e\u003cbr\u003eNeville: The only problem is, I can&#39;t remember what I&#39;ve forgotten.\u003cbr\u003e\u003cbr\u003eHarry: Hey, Ron, somebody broke into Gringotts. Listen, Believed to be the work of dark witches or wizards unknown, Gringotts goblins, while acknowledging the breach, insist that nothing was taken. The vault in question, number 713, had in fact been emptied earlier that same day. That&#39;s odd. That&#39;s the vault Hagrid and I went to.\u003cbr\u003e\u003cbr\u003e¬†\u003cbr\u003e\u003cbr\u003eScene: Outside, flying practice. The students, Gryffindor and Slytherin, are lined up in two rows with brooms by their sides. The teacher, MADAM HOOCH, comes down the line. She has short hair and hawk yellow eyes.\u003cbr\u003e\u003cbr\u003e¬†\u003cbr\u003e\u003cbr\u003eHooch: Good afternoon, class.\u003cbr\u003e\u003cbr\u003eClass: Good afternoon, Madam Hooch.\u003cbr\u003e\u003cbr\u003eHooch: Good afternoon, Amanda, good afternoon. {to class} Welcome to your first flying lesson. Well, what are you waiting for? Everyone step up to the left side of their broomstick. Come on now, hurry up. Stick your right hand over the broom and say, Up!\u003cbr\u003e\u003cbr\u003eClass: Up!\u003cbr\u003e\u003cbr\u003e¬†\u003cbr\u003e\u003cbr\u003eHarry&#39;s broom flies into his hand.\u003cbr\u003e\u003cbr\u003e¬†\u003cbr\u003e\u003cbr\u003eHarry: Whoa. {Hermione stares as the class continues.}\u003cbr\u003e\u003cbr\u003eDraco: Up! {broomstick flies up and Draco smugly grins.}\u003cbr\u003e\u003cbr\u003eHooch: With feeling!\u003cbr\u003e\u003cbr\u003eHermione: Up. Up. Up. Up.\u003cbr\u003e\u003cbr\u003eRon: Up!! {His broom flies up and conks him on the nose} Ow! {Harry laughs} Shut up, Harry. {laughs}\u003cbr\u003e\u003cbr\u003eHooch: Now, once you&#39;ve got hold of your broom, I want you to mount it. And grip it tight, you don&#39;t want to be sliding off the end. {Class mounts} When I blow my whistle, I want each of you to kick off from the ground, hard. Keep your broom steady, hover for a moment, and then lean forward slightly and touch back down. On my whistle...3...2...{tweet!}\u003cbr\u003e\u003cbr\u003e¬†\u003cbr\u003e\u003cbr\u003eNeville immediately lifts off. He looks quite frightened.\u003cbr\u003e\u003cbr\u003e¬†\u003cbr\u003e\u003cbr\u003eNeville: Oh...\u003cbr\u003e\u003cbr\u003eHooch: Mr. Longbottom.\u003cbr\u003e\u003cbr\u003eGirl: Neville, what are you doing?\u003cbr\u003e\u003cbr\u003eStudents: Neville...Neville...\u003cbr\u003e\u003cbr\u003eBoy: We&#39;re not supposed to take off, yet.\u003cbr\u003e\u003cbr\u003eHooch: {Neville begins soaring away} M-M-Mr. Longbottom Mr. Longbottom!\u003cbr\u003e\u003cbr\u003eNeville: AHH!\u003cbr\u003eHooch: Mr. Longbottom!\u003cbr\u003e\u003cbr\u003eNeville: {soars away} Down! Down! Ahhhh!\u003cbr\u003e\u003cbr\u003eHarry: Neville! {shouting}\u003cbr\u003e\u003cbr\u003eNeville: Help!!!\u003cbr\u003e\u003cbr\u003eHooch: Come back down this instant!\u003cbr\u003e\u003cbr\u003eNeville: AHH!\u003cbr\u003e\u003cbr\u003e¬†\u003cbr\u003e\u003cbr\u003eHe soars through the sky and hits a wall, conking along it and then swooping off. All the while, he is screaming. He begins to zoom back towards the group of students. Hooch holds out her wand to stop him.\u003cbr\u003e\u003cbr\u003e¬†\u003cbr\u003e\u003cbr\u003eNeville: Help!\u003cbr\u003e\u003cbr\u003eHooch: Mr. Longbottom! {Neville approaches. The students scatter and Hooch dives out of the way. Neville goes through the scatter and up a tower.}\u003cbr\u003e\u003cbr\u003eNeville: Ahhhh! Whoa! Ahhh! {zooms past a statue of a man with a sharp spear. Neville&#39;s cloak catches on it. He is flipped off the broom and hangs there.} Oh. Ah...help! {He wavers, then the cloak rips, and he falls, catching on a torchbut then slipping out and falling to the ground.} Ahh!\u003cbr\u003e\u003cbr\u003eHooch: Everyone out of the way! {She runs through the group, and they scatter.} Come on, get up.\u003cbr\u003e\u003cbr\u003eGirl: Is he alright?\u003cbr\u003e\u003cbr\u003eNeville: Owowowow.\u003cbr\u003e\u003cbr\u003eHooch: Oh, oh, oh, oh dear. It&#39;s a broken wrist. Tch, tch, tch. Good boy, come on now, up you get. {Draco reaches down and grabs Neville&#39;s Remembrall, which has fallen. Hooch begins to lead Neville away with her.} Everyone&#39;s to keep their feet firmly on the ground while I take Mr. Longbottom to the hospital wing. Understand? If I see a single broom in the air, the one riding it will find themselves out of Hogwarts before they can say, Quidditch. {Exit.}\u003cbr\u003e\u003cbr\u003eDraco: {snickers} Did you see his face? Maybe if the fat lump had given this a squeeze, he&#39;d have remembered to fall on his fat ass. {Laughs.}\u003cbr\u003e\u003cbr\u003eHarry: Give it here, Malfoy.\u003cbr\u003e\u003cbr\u003eDraco: No. I think I&#39;ll leave it somewhere for Longbottom to find. {hops on broom and soars around group, then through.} How &#39;bout up on the roof?? {soars off and hovers high in the sky.} What&#39;s the matter, Potter? Bit beyond your reach?\u003cbr\u003e\u003cbr\u003e¬†\u003cbr\u003e\u003cbr\u003eHarry grabs his broom and runs to get on it. Hermione stops him.\u003cbr\u003e\u003cbr\u003e¬†\u003cbr\u003e\u003cbr\u003eHermione: Harry, no! You heard what Madam Hooch said! Besides, you don&#39;t even know how to fly. {Harry flies off.} What an idiot.\u003cbr\u003e\u003cbr\u003e¬†\u003cbr\u003e\u003cbr\u003eHarry is now in the air, across from Draco.\u003cbr\u003e\u003cbr\u003e¬†\u003cbr\u003e\u003cbr\u003eHarry: Give it here, Malfoy, or I&#39;ll knock you off your broom!\u003cbr\u003e\u003cbr\u003eDraco: Is that so? {Harry makes a dash for himbut Draco twirls around his broom in a 360.} Have it your way, then! {He throws the Remembrall into the air.}\u003cbr\u003e\u003cbr\u003e¬†\u003cbr\u003e\u003cbr\u003eHarry zooms after the ball, speeding towards a tower. Just as he is about to hit a window, from which McGonagall is working/watching, he catches it, and then heads back to the group. The students all cheer and run to see him.\u003cbr\u003e\u003cbr\u003e¬†\u003cbr\u003e\u003cbr\u003eBoy: Good job, Harry!\u003cbr\u003e\u003cbr\u003eBoy 2: Oh, that was wicked, Harry.\u003cbr\u003e\u003cbr\u003eMcGonagall: {appears quickly} Harry Potter? Follow me. {Harry sullenly follows her. Draco and his goons laugh.}\u003cbr\u003e\u003cbr\u003e¬†\u003cbr\u003e\u003cbr\u003eScene: Professor Quirrells classroom. He is inside, teaching, holding an iguana.\u003cbr\u003e\u003cbr\u003e¬†\u003cbr\u003e\u003cbr\u003eQuirrell: An iguana s-such as this is {McGonagall approaches the class and stops Harry: You wait here.} an essential in-gredient\u003cbr\u003e\u003cbr\u003eMcGonagall: Excuse me, excuse me, Professor Quirrell. Could I borrow Wood for a moment?\u003cbr\u003e\u003cbr\u003eQuirrell: Oh. Y-yes, of course. {a boy, OLIVER WOOD, gets up to leave and Quirrell continues.} And the vampire b-bat...{eerie roar.}\u003cbr\u003e\u003cbr\u003eMcGonagall: Potter, this is Oliver Wood. Wood, I have found you a Seeker!\u003cbr\u003e\u003cbr\u003e¬†\u003cbr\u003e\u003cbr\u003eScene: Harry and Ron are walking through crowded halls. Sir Nicholas and a lady ghost float by.\u003cbr\u003e\u003cbr\u003e¬†\u003cbr\u003e\u003cbr\u003eNick: Have you heard? Harry Potter&#39;s the new Gryffindor Seeker. I always knew hed do well.\u003cbr\u003e\u003cbr\u003eRon: Seeker? But first years never make their house teams! You must be the youngest Quidditch player in\u003cbr\u003e\u003cbr\u003eHarry: A century, according to McGonagall.\u003cbr\u003e\u003cbr\u003e¬†\u003cbr\u003e\u003cbr\u003eFred and George approach and walk along with Ron and Harry.\u003cbr\u003e\u003cbr\u003e¬†\u003cbr\u003e\u003cbr\u003eFred: Hey, well done, Harry, Wood&#39;s just told us!\u003cbr\u003e\u003cbr\u003eRon: Fred and George are on the team, too. Beaters.\u003cbr\u003e\u003cbr\u003eGeorge: Our job is to make sure that you don&#39;t get bloodied up too bad. Can&#39;t make any promises, of course. Rough game, Quidditch.\u003cbr\u003e\u003cbr\u003eFred: Brutal. But no one&#39;s died in years. Someone will vanish occasionally... {They break off from Harry and Ron, who walk across a courtyard. ¬†\u003cbr\u003e\u003cbr\u003eGeorge: But they&#39;ll turn up in a month or two!!\u003cbr\u003e\u003cbr\u003eRon: Oh, go on, Harry, Quidditch is great. Best game there is! And you&#39;ll be great, too! {Hermione jumps up from her work and comes to join them.}\u003cbr\u003e\u003cbr\u003eHarry: But I&#39;ve never even played Quidditch. What if I make a fool of myself?\u003cbr\u003e\u003cbr\u003eHermione: You won&#39;t make a fool of yourself. It&#39;s in your blood.\u003cbr\u003e\u003cbr\u003e¬†\u003cbr\u003e\u003cbr\u003eScene: The three approach a trophy case. Hermione points at a plaque of Quidditch players. One lists Harry&#39;s father as a Seeker.\u003cbr\u003e\u003cbr\u003e¬†\u003cbr\u003e\u003cbr\u003eRon: Whoa. Harry, you never told me your father was a Seeker, too.\u003cbr\u003e\u003cbr\u003eHarry: I-I didn&#39;t know.\u003cbr\u003e\u003cbr\u003e¬†\u003cbr\u003e\u003cbr\u003e\u003cbr\u003e¬†\u003cbr\u003eScene: The three are walking up a staircase. A railing pulls in...Hermione looksbut continues walking.\u003cbr\u003e\u003cbr\u003e¬†\u003cbr\u003e\u003cbr\u003eRon: I&#39;m telling you, it&#39;s spooky. She knows more about you than you do.\u003cbr\u003e\u003cbr\u003eHarry: Who doesn&#39;t?\u003cbr\u003e\u003cbr\u003e¬†\u003cbr\u003e\u003cbr\u003eThe staircase shudders and begins to move. The three grab the railings.\u003cbr\u003e\u003cbr\u003e¬†\u003cbr\u003e\u003cbr\u003eRon: Ahh!\u003cbr\u003e\u003cbr\u003eHermione: {Gasps.}\u003cbr\u003e\u003cbr\u003eHarry: What&#39;s happening?\u003cbr\u003e\u003cbr\u003eHermione: The staircases change, remember? {The staircase stops, in a new place.}\u003cbr\u003e\u003cbr\u003eHarry: {taps Ron} Let&#39;s go this way.\u003cbr\u003e\u003cbr\u003eRon: Before the staircase moves again. {They all open a door and walk into a spooky, dark room.}\u003cbr\u003e\u003cbr\u003eHarry: Does anyone feel like...we shouldn&#39;t be here?\u003cbr\u003e\u003cbr\u003eHermione: We&#39;re not supposed to be here. This is the 3rd floor. It&#39;s forbidden.\u003cbr\u003e\u003cbr\u003e¬†\u003cbr\u003e\u003cbr\u003eSuddenly, a flame lights on a tall stone support. At that moment, the caretaker&#39;s cat, MRS. NORRIS, comes running in and meows. The group jumps.\u003cbr\u003e\u003cbr\u003e¬†\u003cbr\u003e\u003cbr\u003eHarry: Let&#39;s go.\u003cbr\u003e\u003cbr\u003e{meow}\u003cbr\u003e\u003cbr\u003eRon: It&#39;s Filch&#39;s cat!\u003cbr\u003e\u003cbr\u003eHarry: Run!\u003cbr\u003e\u003cbr\u003e¬†\u003cbr\u003e\u003cbr\u003eThe group runs. Flames are lit as they go. They get to the end of the corridor, to a door. Harry grabs the handlebut it&#39;s locked.\u003cbr\u003e\u003cbr\u003e¬†\u003cbr\u003e\u003cbr\u003eHarry: It&#39;s locked!\u003cbr\u003e\u003cbr\u003eRon: That&#39;s it, we&#39;re done for!\u003cbr\u003e\u003cbr\u003eHermione: Oh, move over! {pushes through and pulls out wand} Alohomora. {The door opens.} Get in. {They bustle in.}\u003cbr\u003e\u003cbr\u003eRon: Alohomora?\u003cbr\u003e\u003cbr\u003eHermione: Standard book of spells, Chapter 7.\u003cbr\u003e\u003cbr\u003e¬†\u003cbr\u003e\u003cbr\u003eFilch appears at the start of the corridor with a light. Mrs. Norris looks at him.\u003cbr\u003e\u003cbr\u003e¬†\u003cbr\u003e\u003cbr\u003eFilch: Anyone here, my sweet? {meow} Come on. {exit.}\u003cbr\u003e\u003cbr\u003eHermione: Filch is gone.\u003cbr\u003e\u003cbr\u003eRon: Probably thinks this door&#39;s locked.\u003cbr\u003e\u003cbr\u003eHermione: It was locked.\u003cbr\u003e\u003cbr\u003eHarry: And for good reason. {Ron and Hermione turn to stand with Harry. There is a massively huge three headed dog sleeping in front of them. The dog, FLUFFY, begins to wake. It growls, yawns, and growls more...noticing the intruders.}\u003cbr\u003e\u003cbr\u003eAll: AHHHHHHH! {The three bolt, running out of the door. They turn quickly to shut the door and battle against the dog. They get the door shut and run.}\u003cbr\u003e\u003cbr\u003e¬†\u003cbr\u003e\u003cbr\u003eScene:\u003cbr\u003e\u003cbr\u003eBack in the Gryffindor room. They are breathless.\u003cbr\u003e\u003cbr\u003e¬†\u003cbr\u003e\u003cbr\u003eRon: What do they think they&#39;re doing?? Keeping a thing like that locked up in a school.\u003cbr\u003e\u003cbr\u003eHermione: You don&#39;t use your eyes, do you? Didn&#39;t you see what it was standing on?\u003cbr\u003e\u003cbr\u003eRon: I wasn&#39;t looking at its feet! I was a bit preoccupied with its heads. Or maybe you didn&#39;t notice, there were three! {they begin to climb the stairs to the dorms.}\u003cbr\u003e\u003cbr\u003eHermione: It was standing on a trap door. Which means it wasn&#39;t there by accident. It&#39;s guarding something.\u003cbr\u003e\u003cbr\u003eHarry: Guarding something?\u003cbr\u003e\u003cbr\u003eHermione: That&#39;s right. Now, if you two don&#39;t mind, I&#39;m going to bed before either of you come up with another clever idea to get us killed...or worse, expelled! {turns and leaves, shutting the door to her dorms.}\u003cbr\u003e\u003cbr\u003eRon: She needs to sort out her priorities!\u003cbr\u003e\u003cbr\u003eHarry nods.\u003cbr\u003e\u003cbr\u003e¬†\u003cbr\u003e\u003cbr\u003eScene: Outside, day time. Oliver and Harry appear, carrying a trunk. They put it down.\u003cbr\u003e\u003cbr\u003e¬†\u003cbr\u003e\u003cbr\u003eOliver: Quidditch is easy enough to understand. Each time has seven players, 3 chasers, 2 beaters, 1 keeper and a seeker that&#39;s you. There are three kinds of balls. {picks up a red one} This one&#39;s called the Quaffle. Now, the chasers handle the Quaffle and try to put it through one of those three hoops. {Points to a faraway Quidditch pitch.} The keeper, that&#39;s me, defends the hoops. {throws ball to Harry.} With me so far?\u003cbr\u003e\u003cbr\u003eHarry: {throws back} I think so. What are those? {points to two squirming chained down balls.}\u003cbr\u003e\u003cbr\u003eOliver: ...You better take this. {hands Harry a small bat. He bends down and releases one ball. With an angry growl, it flies off into the air. The two boys watch it.} Careful now, it&#39;s comin&#39; back. {The balls comes whizzing down, and Harry cracks at it with the bat. The ball soars off through a statue.} Eh, not bad, Potter, you&#39;d make a fair beater...Uh-oh. {The ball zooms down, and Oliver grabs it, wriggling to get it back in the box. He succeeds and is out of breath.} Bludger. Nasty little buggers. But the only ball I want you to worry about is this...the Golden Snitch. {hands Harry a walnut sized golden ball.}\u003cbr\u003e\u003cbr\u003eHarry: I like this ball.\u003cbr\u003e\u003cbr\u003eOliver: Ah, you like it now. Just wait. It&#39;s wicked fast and damn near impossible to see.\u003cbr\u003e\u003cbr\u003eHarry: What do I do with it?\u003cbr\u003e\u003cbr\u003eOliver: You catch it...before the other team&#39;s seeker. You catch this, the game is over. You catch this, Potter, and we win.\u003cbr\u003e\u003cbr\u003e{The ball flutters out two delicate wings and jumps into the air. Harry keeps an eye on it.}\u003cbr\u003e\u003cbr\u003eHarry: Whoa.\u003cbr\u003e\u003cbr\u003e¬†\u003cbr\u003e\u003cbr\u003eScene: PROFESSOR FLITWICK&#39;s class. The teacher is very short, and is standing on a bunch of books.\u003cbr\u003e\u003cbr\u003e¬†\u003cbr\u003e\u003cbr\u003eFlitwick: One of a wizard&#39;s most rudimentary skills is levitation the ability to make objects fly. Uh, do you all have your feathers? {Hermione raises hers.} Good. Now, uh, don&#39;t forget the nice wrist movement we&#39;ve been practicing, hmm? The swish and flick. Everyone. {All} The swish and flick. Good. And enunciate. Wingardium Leviosa. Off you go then.\u003cbr\u003e\u003cbr\u003eDraco: Wingardium Levio-saaa.\u003cbr\u003e\u003cbr\u003e{All practice.}\u003cbr\u003e\u003cbr\u003eRon: Wingardrium Leviosar. {whacks with wand numerous times.}\u003cbr\u003e\u003cbr\u003eHermione: Stop, stop, stop. You&#39;re going to take someone&#39;s eye out. Besides, youre saying it wrong. It&#39;s Leviosa, not Leviosar.\u003cbr\u003e\u003cbr\u003eRon: You do it then if you&#39;re so clever. Go on, go on.\u003cbr\u003e\u003cbr\u003e¬†\u003cbr\u003e\u003cbr\u003eHermione straightens up and swishes her wand.\u003cbr\u003e\u003cbr\u003e¬†\u003cbr\u003e\u003cbr\u003eHermione: {crisply} Wingardium Leviosa. {The feather glows and lifts up. Ron puts his head on his books dejectedly.}\u003cbr\u003e\u003cbr\u003eFlitwick: Oh, well done! See here, everyone! Ms. Granger&#39;s done it! Oh, splendid!\u003cbr\u003e\u003cbr\u003e¬†\u003cbr\u003e\u003cbr\u003eSeamus begins swishing at his feather.\u003cbr\u003e\u003cbr\u003e¬†\u003cbr\u003e\u003cbr\u003eSeamus: Wingard Levosa. Wingard Levosa. {Flitwick to Hermione: Well done, dear.}\u003cbr\u003e\u003cbr\u003e¬†\u003cbr\u003e\u003cbr\u003eBOOOM!!! Seamus&#39; feather explodes. Flitwick gasps.\u003cbr\u003e\u003cbr\u003e¬†\u003cbr\u003e\u003cbr\u003eFlitwick: Whooaaa! Ooh.\u003cbr\u003e\u003cbr\u003eHarry: I think we&#39;re going to need another feather over here, Professor.\u003cbr\u003e\u003cbr\u003e¬†\u003cbr\u003e\u003cbr\u003eScene: Neville, Harry, Ron and Seamus are walking through a courtyard with other students all around.\u003cbr\u003e\u003cbr\u003e¬†\u003cbr\u003e\u003cbr\u003eRon: It&#39;s Leviosa, not Leviosar. Honestly, she&#39;s a nightmare. No wonder she hasn&#39;t got any friends!\u003cbr\u003e\u003cbr\u003e¬†\u003cbr\u003e\u003cbr\u003eHermione bustles past, sniffling.\u003cbr\u003e\u003cbr\u003e¬†\u003cbr\u003e\u003cbr\u003eHarry: I think she heard you.\u003cbr\u003e\u003cbr\u003e¬†\u003cbr\u003e\u003cbr\u003eScene: Night, in the great hall. It is Halloween. Everyone is eating candy, and Jack O&#39;Lanterns are keeping the place lit. There is chatter.\u003cbr\u003e\u003cbr\u003e¬†\u003cbr\u003e\u003cbr\u003eHarry: Where&#39;s Hermione?\u003cbr\u003e\u003cbr\u003eNeville: Parvati Patil said that she wouldn&#39;t come out of the girl&#39;s bathroom. She said that she&#39;d been in there all afternoon...crying.\u003cbr\u003e\u003cbr\u003e{Ron and Harry exchange glances. Suddenly, Professor Quirrell comes flying into the room, screaming.}\u003cbr\u003e\u003cbr\u003eQuirrell: TROLL! IN THE DUNGEON! T-TROOLLL IN THE DUNGEON!! {stops and there is utter silence.} Thought you ought to know. {falls over in a dead faint.}\u003cbr\u003e\u003cbr\u003e¬†\u003cbr\u003e\u003cbr\u003eThe room is silent, and then everyone freaks, screaming and running.\u003cbr\u003e\u003cbr\u003e¬†\u003cbr\u003e\u003cbr\u003eDumbledore: SILLLLLEEENNNNCEEEEE! {Everyone stops.} Everyone will please, not panic. Now, Prefects will lead their houses back to the dormitories. Teachers will follow me to the dungeons.\u003cbr\u003e\u003cbr\u003eGirl: Hufflepuff, this way!\u003cbr\u003e\u003cbr\u003eBoy: Stay together!\u003cbr\u003e\u003cbr\u003e¬†\u003cbr\u003e\u003cbr\u003eSnape looks aghast, and he disappears through a doorway.\u003cbr\u003e\u003cbr\u003e¬†\u003cbr\u003e\u003cbr\u003eScene: Percy is leading the house down a hall.\u003cbr\u003e\u003cbr\u003e¬†\u003cbr\u003e\u003cbr\u003ePercy: Gryffindors...keep up please. And stay alert!\u003cbr\u003e\u003cbr\u003eHarry: How could a troll get in?\u003cbr\u003e\u003cbr\u003eRon: Not by itself. Trolls are really stupid. Probably people playing jokes. {Suddenly, Harry stops and pulls Ron aside.} What?\u003cbr\u003e\u003cbr\u003eHarry: Hermione! She doesn&#39;t know!\u003cbr\u003e\u003cbr\u003e¬†\u003cbr\u003e\u003cbr\u003eThe two run off, down corridors. They start running down a hall when they stop, because there is a grunting noise. Harry pulls Ron into a doorway and a large, ugly TROLL thunks by into a room.\u003cbr\u003e\u003cbr\u003e¬†\u003cbr\u003e\u003cbr\u003eHarry: He&#39;s going into the Girl&#39;s Bathroom!\u003cbr\u003e\u003cbr\u003e¬†\u003cbr\u003e\u003cbr\u003eScene: In the bathroom, Hermione emerges from a stall, wiping her eyes. She stops when she sees something. The troll is standing there. Hermione backs up, into the stall just as the troll raises its club and smashes the top part of the stalls. Hermione screams. Harry and Ron come bursting in.\u003cbr\u003e\u003cbr\u003e¬†\u003cbr\u003e\u003cbr\u003eHarry: Hermione, move!\u003cbr\u003e\u003cbr\u003e¬†\u003cbr\u003e\u003cbr\u003eThe troll smashes the remaining stalls.\u003cbr\u003e\u003cbr\u003e¬†\u003cbr\u003e\u003cbr\u003eHermione: Help! Help! {The boys start throwing wood pieces at the troll.}\u003cbr\u003e\u003cbr\u003eRon: Hey, pea brain! {Ron throws wood and hits the troll on the head. Hermione escapes from the stalls to under a sinkbut the troll sees her and goes to smash her. It cracks the sink and barely misses Hermione. Harry cringes.}\u003cbr\u003e\u003cbr\u003eHermione: Ahhh! Help!\u003cbr\u003e\u003cbr\u003e¬†\u003cbr\u003e\u003cbr\u003eHarry gets out his wand. He runs forward and grabs the troll&#39;s club, and is lifted up.\u003cbr\u003e\u003cbr\u003e¬†\u003cbr\u003e\u003cbr\u003eHarry: Whooa! Whoa, whoa! {He lands on the troll&#39;s head, and is hurled forward, then back, and his wand goes up the troll&#39;s nose.}\u003cbr\u003e\u003cbr\u003eRon: Ew.\u003cbr\u003e\u003cbr\u003e¬†\u003cbr\u003e\u003cbr\u003eThe troll snorts, and whips around.\u003cbr\u003e\u003cbr\u003e¬†\u003cbr\u003e\u003cbr\u003eHarry: Whoa, whoa whoa!\u003cbr\u003e\u003cbr\u003e¬†\u003cbr\u003e\u003cbr\u003eThe troll gets Harry off its head and is holding him by one leg, upside down. It gears up its club and swipes at Harry. He pulls himself up, then down. The troll swipes again.\u003cbr\u003e\u003cbr\u003e¬†\u003cbr\u003e\u003cbr\u003eHarry: Do something! {swipe}\u003cbr\u003e\u003cbr\u003eRon: What? {swipe}\u003cbr\u003e\u003cbr\u003eHarry: Anything! Hurry up!\u003cbr\u003e\u003cbr\u003e¬†\u003cbr\u003e\u003cbr\u003eRon grabs his wand. Under the sink, Hermione waves her hand.\u003cbr\u003e\u003cbr\u003e¬†\u003cbr\u003e\u003cbr\u003eHermione: Swish and flick!\u003cbr\u003e\u003cbr\u003eRon: Wingardium Leviosa! {flick. The club is lifted out of the troll&#39;s hand and hovers above its head. The troll looks up, confused, just as the club comes crashing back down. (Ron: Cool.) ¬†It hits the troll&#39;s head and the troll wavers, then drops Harry, who crawls away, and comes crashing down, hard.\u003cbr\u003e\u003cbr\u003e¬†\u003cbr\u003e\u003cbr\u003eHermione approaches carefully.\u003cbr\u003e\u003cbr\u003e¬†\u003cbr\u003e\u003cbr\u003eHermione: Is it...dead?\u003cbr\u003e\u003cbr\u003eHarry: I don&#39;t think so. Just knocked out. {He grabs his wand...which is covered in goo.} Ew. Troll bogies.\u003cbr\u003e\u003cbr\u003e¬†\u003cbr\u003e\u003cbr\u003eSuddenly, McGonagall, Snape and Quirrell come rushing in.\u003cbr\u003e\u003cbr\u003eThey all gasp.\u003cbr\u003e\u003cbr\u003e¬†\u003cbr\u003e\u003cbr\u003eMcGonagall: Oh! Oh, my goodness! E-Explain yourselves, both of you!\u003cbr\u003e\u003cbr\u003eRon and Harry: Well, what it is...\u003cbr\u003e\u003cbr\u003eHermione: It&#39;s my fault, Professor McGonagall. {The teachers, and Ron and Harry, gape}\u003cbr\u003e\u003cbr\u003eMcGonagall: Ms. Granger?\u003cbr\u003e\u003cbr\u003eHermione: I went looking for the troll. I&#39;d read about them and thought I could handle it. But I was wrong. If Harry and Ron hadn&#39;t come and found me...I&#39;d probably be dead.\u003cbr\u003e\u003cbr\u003eMcGonagall: Be that as it may...it was an extremely foolish thing to do. {Harry looks at Snape&#39;s leg...which has a large cut on it. Snape notices and covers it up, glaring at Harry.} I would have expected more rational behaviour on your part, Ms. Granger. 5 points will be taken from Gryffindor for your serious lack of judgment. As for you two gentlemen I just hope you realize how fortunate you are. Not many students could take on a full grown mountain troll and live to tell the tale. 5 points...will be awarded to each of you. For sheer dumb luck. {Snape and McGonagall exit.}\u003cbr\u003e\u003cbr\u003eQuirrell: Perhaps you ought to go...M-might wake up...heh. {Exit Ron and Harry and Hermione.} {Troll roars.} Ahh! Hehe....\u003cbr\u003e\u003cbr\u003e¬†\u003cbr\u003e\u003cbr\u003eScene: The next morning, in the great hall. The gang is sitting, eating. Harry is twirling his food on a fork.\u003cbr\u003e\u003cbr\u003e¬†\u003cbr\u003e\u003cbr\u003eRon: Take a bit of toast, mate, go on.\u003cbr\u003e\u003cbr\u003eHermione: Ron&#39;s right, Harry. You&#39;re gonna need your strength today.\u003cbr\u003e\u003cbr\u003eHarry: I&#39;m not hungry.\u003cbr\u003e\u003cbr\u003e¬†\u003cbr\u003e\u003cbr\u003eSnape appears.\u003cbr\u003e\u003cbr\u003e¬†\u003cbr\u003e\u003cbr\u003eSnape: Good luck today, Potter. Then again, now that you&#39;ve proven yourself against a troll, a little game of Quidditch should be easy work for you...even if it is against Slytherin. {Leaves, limping.}\u003cbr\u003e\u003cbr\u003eHarry: That explains the blood.\u003cbr\u003e\u003cbr\u003eHermione: Blood?\u003cbr\u003e\u003cbr\u003eHarry: Listen, last night, I&#39;m guessing Snape let the troll in as a diversion so he could try and get past that 3 headed dog. But, he got himself bitten, that&#39;s why he&#39;s limping.\u003cbr\u003e\u003cbr\u003eHermione: But why would anyone go near that dog?\u003cbr\u003e\u003cbr\u003eHarry: The day I was at Gringotts, Hagrid took something out of one of the vaults. He said it was Hogwarts&#39; business, very secret.\u003cbr\u003e\u003cbr\u003eHermione: So you&#39;re saying...\u003cbr\u003e\u003cbr\u003eHarry: That&#39;s what the dog&#39;s guarding. That&#39;s what Snape wants.\u003cbr\u003e\u003cbr\u003e{An owl screeches. It is Hedwig. She is carrying a very large, long parcel. She drops it off.}\u003cbr\u003e\u003cbr\u003eHermione: Bit early for mail, isn&#39;t it?\u003cbr\u003e\u003cbr\u003eHarry: But I-I never get mail.\u003cbr\u003e\u003cbr\u003eRon: Let&#39;s open it.\u003cbr\u003e\u003cbr\u003e{They open it.}\u003cbr\u003e\u003cbr\u003eHarry: It&#39;s a broomstick!\u003cbr\u003eRon: Thats not just any broomstick, Harry. It&#39;s a Nimbus 2000!\u003cbr\u003e\u003cbr\u003eHarry: But who...?\u003cbr\u003e\u003cbr\u003e{He sees Professor McGonagall up at the head table, stroking Hedwig. She smiles and Harry nods.}\u003cbr\u003e\u003cbr\u003e¬†\u003cbr\u003e\u003cbr\u003eScene: Inside a Quidditch tower. The Gryffindor team is marching towards the starting gate. They reach it and stop, behind a closed double door.\u003cbr\u003e\u003cbr\u003e¬†\u003cbr\u003e\u003cbr\u003eOIiver: Scared, Harry?\u003cbr\u003e\u003cbr\u003eHarry: A little bit.\u003cbr\u003e\u003cbr\u003eOliver: That&#39;s all right. I felt the same way before my first game.\u003cbr\u003e\u003cbr\u003eHarry: What happened?\u003cbr\u003eOliver: Er, I don&#39;t really remember. I took a bludger to the head 2 minutes in. Woke up in the hospital a week later.\u003cbr\u003e\u003cbr\u003e¬†\u003cbr\u003e\u003cbr\u003eHarry gulps and looks straight ahead as the doors open. They mount their brooms and zoom out onto the enormous pitch. There is cheering. The commentator, LEE JORDAN, is talking from a tower.\u003cbr\u003e\u003cbr\u003e¬†\u003cbr\u003e\u003cbr\u003eLee: Hello, and welcome to Hogwarts&#39; first Quidditch game of the season! Today&#39;s game Slytherin versus Gryffindor!!!\u003cbr\u003e\u003cbr\u003e¬†\u003cbr\u003e\u003cbr\u003e{Cheering. Close-up of Gryffindor students. They are cheering. Neville: Gryffindor!}\u003cbr\u003e\u003cbr\u003e¬†\u003cbr\u003e\u003cbr\u003eThe players take their positions in the air in a circle. Harry weaves in, highest amongst. He looks down.\u003cbr\u003e\u003cbr\u003e¬†\u003cbr\u003e\u003cbr\u003eLee: The players take their positions as Madam Hooch steps out onto the field to begin the game.\u003cbr\u003e\u003cbr\u003eHooch: Now, I want a nice clean game...from all of you. {looks at Slytherin. She kicks the trunk, and the bludgers zoom out.}\u003cbr\u003e\u003cbr\u003eLee: The bludgers are up...followed by the Golden Snitch. Remember, the snitch is worth 150 points. The seeker who catches the Snitch ends the game.\u003cbr\u003e\u003cbr\u003e¬†\u003cbr\u003e\u003cbr\u003eThe snitch zooms around each Seeker&#39;s head, then disappears. Hooch grabs the Quaffle.\u003cbr\u003e\u003cbr\u003e¬†\u003cbr\u003e\u003cbr\u003eLee: The Quaffle is released...and the game begins!\u003cbr\u003e\u003cbr\u003e¬†\u003cbr\u003e\u003cbr\u003eGryffindor takes possession of the ball and a chaser, ANGELINA JOHNSON, zooms past Slytherins towards their goal, and throws the ball, and scores! There is a ding.\u003cbr\u003e\u003cbr\u003e¬†\u003cbr\u003e\u003cbr\u003eLee: Angelina Johnson scores! 10 points for Gryffindor! {He presses a button and a 10 shows up beside a plaque with Gryffindors name.}\u003cbr\u003e\u003cbr\u003e¬†\u003cbr\u003e\u003cbr\u003eHarry, in the air, claps.\u003cbr\u003e\u003cbr\u003e¬†\u003cbr\u003e\u003cbr\u003eHarry: Yes! {a bludger zooms by him.} Whoa!\u003cbr\u003e\u003cbr\u003e¬†\u003cbr\u003e\u003cbr\u003eIn the stands, Gryffindor cheers.\u003cbr\u003e\u003cbr\u003e¬†\u003cbr\u003e\u003cbr\u003eHagrid: Well done!\u003cbr\u003e\u003cbr\u003eLee: Slytherin takes possession of the Quaffle. Bletchley passes to Captain Marcus Flint.\u003cbr\u003e\u003cbr\u003e¬†\u003cbr\u003e\u003cbr\u003eFlint dodges people and throws for the Gryffindor hoops. Oliver appears and whacks the ball away with his broom. He smirks at Flint, who glares. Johnson and KATIE BELL pass the Quaffle back and forth as they strategize to score. Johnson takes it, throws, and once again scores!\u003cbr\u003e\u003cbr\u003e¬†\u003cbr\u003e\u003cbr\u003eRon and Seamus: Yay!\u003cbr\u003e\u003cbr\u003eHarry: Yes!\u003cbr\u003e\u003cbr\u003eLee: Another 10 points to Gryffindor! {ding.}\u003cbr\u003e\u003cbr\u003eGryffindors: Yay!\u003cbr\u003e\u003cbr\u003e¬†\u003cbr\u003e\u003cbr\u003eThe Slytherins decide to get messy. They dodge, kick, and try to score. Once again, Oliver blocks.\u003cbr\u003e\u003cbr\u003e¬†\u003cbr\u003e\u003cbr\u003eFlint: Give me that! {he grabs a beaters bat from one and whacks a bludger right at Oliver. It hits Oliver in the stomach and he falls to the ground.}\u003cbr\u003e\u003cbr\u003e¬†\u003cbr\u003e\u003cbr\u003eCrowd: {Booing}\u003cbr\u003e\u003cbr\u003eHarry is visibly upset.\u003cbr\u003e\u003cbr\u003eSlytherin laughs.\u003cbr\u003e\u003cbr\u003e¬†\u003cbr\u003e\u003cbr\u003eThe Slytherin members head off. One jumps over George (or Fred) and scores. Harry is upset again. Slytherin cheers.\u003cbr\u003e\u003cbr\u003e¬†\u003cbr\u003e\u003cbr\u003eFlint: {to other members} Take that side!\u003cbr\u003e\u003cbr\u003e¬†\u003cbr\u003e\u003cbr\u003eThey box Johnson in and sent her into the capes covering one of the towers. She falls down in and is out. The crowd boos. Slytherin scores once again. Suddenly, Harry sees the Snitch. He starts to head off after it and then his broom starts bucking and turning.\u003cbr\u003e\u003cbr\u003e¬†\u003cbr\u003e\u003cbr\u003eHarry: Whoa! Whooa!\u003cbr\u003e\u003cbr\u003eHagrid: What&#39;s going on with Harry&#39;s broomstick?\u003cbr\u003e\u003cbr\u003e¬†\u003cbr\u003e\u003cbr\u003eHermione looks through binoculars at Harry, then at Snape, who is muttering something.\u003cbr\u003e\u003cbr\u003e¬†\u003cbr\u003e\u003cbr\u003eHermione: It&#39;s Snape! He&#39;s jinxing the broom!\u003cbr\u003e\u003cbr\u003eRon: Jinxing the broom? What do we do?\u003cbr\u003e\u003cbr\u003eHermione: Leave it to me. {She hands Ron her binoculars and leaves.}\u003cbr\u003e\u003cbr\u003e¬†\u003cbr\u003e\u003cbr\u003eHarry is knocked around, then falls, dangling by one arm from the broom.\u003cbr\u003e\u003cbr\u003e¬†\u003cbr\u003e\u003cbr\u003eRon: Come on, Hermione!\u003cbr\u003e\u003cbr\u003e¬†\u003cbr\u003e\u003cbr\u003eHermione is hurrying up a tower. She appears underneath Snape and touches his cloak with her wand.\u003cbr\u003e\u003cbr\u003e¬†\u003cbr\u003e\u003cbr\u003eHermione: Lacarnum Inflamarae.\u003cbr\u003e\u003cbr\u003e¬†\u003cbr\u003e\u003cbr\u003eA spark ignites and Snape&#39;s cloak catches fire. Hermione leaves.\u003cbr\u003e\u003cbr\u003e¬†\u003cbr\u003e\u003cbr\u003eMan: Fire! You&#39;re on fire!\u003cbr\u003e\u003cbr\u003eSnape: What? Oh! {knocks the man back, who falls into Quirrell, who then also falls. Snape bats out the fire and acts as though nothing happened. The broom stop bucking, and Harry climbs back on. The Slytherin seeker is after the Snitch. Harry takes off.}\u003cbr\u003e\u003cbr\u003e¬†\u003cbr\u003e\u003cbr\u003eRon: Go!\u003cbr\u003e\u003cbr\u003eHagrid: Go go go!\u003cbr\u003e\u003cbr\u003e¬†\u003cbr\u003e\u003cbr\u003eHarry rams the Slytherin Seeker, then is butted out. He returns, smashing the Seeker again as the Snitch dives. The boys followbut they approach the ground quickly. The Slytherin Seeker backs out, and Harry pulls up his broom as he follows the Snitch, feet above the ground. Harry stands up, and steps forward, trying to grab the ball. He goes too far, and topples off the broom with a yelp, tumbling on the ground. He gets up and lurches.\u003cbr\u003e\u003cbr\u003e¬†\u003cbr\u003e\u003cbr\u003eThe crowd gasps. Hermione appears beside a tower to see.\u003cbr\u003e\u003cbr\u003e¬†\u003cbr\u003e\u003cbr\u003eHagrid: Looks like he&#39;s gonna be sick!\u003cbr\u003e\u003cbr\u003e¬†\u003cbr\u003e\u003cbr\u003eHarry lurches and the Snitch pops out of his mouth. It lands in his hands.\u003cbr\u003e\u003cbr\u003e¬†\u003cbr\u003e\u003cbr\u003eLee: He&#39;s got the Snitch! Harry Potter receives 150 points for catching the Snitch!\u003cbr\u003e\u003cbr\u003eHooch: {Blows whistle} Gryffindor win!\u003cbr\u003e\u003cbr\u003eAll: YAY!\u003cbr\u003e\u003cbr\u003eDraco: No!\u003cbr\u003e\u003cbr\u003eHagrid: Yes!\u003cbr\u003e\u003cbr\u003eHermione: Whoo-hoo!\u003cbr\u003e\u003cbr\u003eMcGonagall: {Giggles happily}\u003cbr\u003e\u003cbr\u003e¬†\u003cbr\u003e\u003cbr\u003eHarry raises the Snitch into the air and the crowd, and his team, cheers.\u003cbr\u003e\u003cbr\u003e¬†\u003cbr\u003e\u003cbr\u003eCrowd: Go go Gryffindor! Go go Gryffindor! Go go Gryffindor! Go go Gryffindor!\u003cbr\u003e\u003cbr\u003e¬†\u003cbr\u003e\u003cbr\u003e\u003cbr\u003e¬†\u003cbr\u003e\u003cbr\u003eScene:\u003cbr\u003eHarry, Hermione and Ron are walking along a path with Hagrid, talking.\u003cbr\u003e\u003cbr\u003e¬†\u003cbr\u003e\u003cbr\u003eHagrid: Nonsense. Why would Snape put a curse on Harry&#39;s broom?\u003cbr\u003e\u003cbr\u003eHarry: Who knows. Why was he trying to get past that 3 headed dog on Halloween?\u003cbr\u003e\u003cbr\u003eHagrid: Who told you &#39;bout Fluffy?\u003cbr\u003e\u003cbr\u003eRon: Fluffy?\u003cbr\u003eHermione: That thing has a name?\u003cbr\u003e\u003cbr\u003eHagrid: Well, of course he&#39;s got a name. He&#39;s mine. I bought him off an Irish feller I met down at the pub last year. Then I lent him to Dumbledore to guard the\u003cbr\u003e\u003cbr\u003eHarry: Yes?\u003cbr\u003e\u003cbr\u003eHagrid: Shouldn&#39;ta said that. Don&#39;t ask any more questions. That&#39;s top secret, that is.\u003cbr\u003e\u003cbr\u003eHarry: But Hagrid, whatever Fluffy&#39;s guarding, Snape&#39;s trying to steal it!\u003cbr\u003e\u003cbr\u003eHagrid: Codswallop. Professor Snape is a Hogwarts teacher.\u003cbr\u003e\u003cbr\u003eHermione: Hogwarts teacher or not, I know a curse when I see one. I&#39;ve read all about them. You have to keep eye contact. And Snape wasn&#39;t blinking.\u003cbr\u003e\u003cbr\u003eHarry: Exactly.\u003cbr\u003e\u003cbr\u003eHagrid: {sighs} Now, you listen to me, all three of you. You&#39;re meddlin&#39; in things that ought not to be meddled in. It&#39;s dangerous. What that dog is guarding is strictly between Professor Dumbledore and Nicholas Flamel.\u003cbr\u003e\u003cbr\u003eHarry: Nicholas Flamel?\u003cbr\u003e\u003cbr\u003eHagrid: I shouldn&#39;t have said that. I should not have said that. I should not have said that. {Exit.}\u003cbr\u003e\u003cbr\u003eHarry: Nicholas Flamel...Who&#39;s Nicholas Flamel?\u003cbr\u003e\u003cbr\u003eHermione: I don&#39;t know.\u003cbr\u003e\u003cbr\u003e¬†\u003cbr\u003e\u003cbr\u003eScene: Christmas. The camera pans up to a snowy castle, then to Hagrid, who is bringing in a large tree. Inside the great hall, students are leaving and ghosts are singing (Merry Christmas, Merry Christmas, ring the Hogwarts bell. Merry Christmas, Merry Christmas...) Hermione approaches the empty tables, wheeling a cart. She goes to Ron and Harry, who are playing chess.\u003cbr\u003e\u003cbr\u003e¬†\u003cbr\u003e\u003cbr\u003eHarry: Knight to E-5.\u003cbr\u003e\u003cbr\u003e¬†\u003cbr\u003e\u003cbr\u003eA piece moves across the board.\u003cbr\u003e\u003cbr\u003e¬†\u003cbr\u003e\u003cbr\u003eRon thinks for a moment.\u003cbr\u003e\u003cbr\u003e¬†\u003cbr\u003e\u003cbr\u003eRon: Queen to E-5.\u003cbr\u003e\u003cbr\u003e¬†\u003cbr\u003e\u003cbr\u003eA queen walks over to E-5 and clinks the knight away.\u003cbr\u003e\u003cbr\u003e¬†\u003cbr\u003e\u003cbr\u003eHermione: That&#39;s totally barbaric!\u003cbr\u003e\u003cbr\u003eRon: That&#39;s wizard&#39;s chess. I see you&#39;ve packed.\u003cbr\u003e\u003cbr\u003eHermione: See you haven&#39;t.\u003cbr\u003e\u003cbr\u003eRon: Change of plans. My parents decided to go to Romania to visit my brother, Charlie. He&#39;s studying dragons there!\u003cbr\u003e\u003cbr\u003eHermione: Good. You can help Harry, then. He&#39;s going to go the library for information on Nicholas Flamel.\u003cbr\u003e\u003cbr\u003eRon: We&#39;ve looked a hundred times!\u003cbr\u003e\u003cbr\u003eHermione: Not in the restricted section...Happy Christmas. {exits.}\u003cbr\u003e\u003cbr\u003eRon: I think we&#39;ve had a bad influence on her.\u003cbr\u003e\u003cbr\u003e¬†\u003cbr\u003e\u003cbr\u003eScene:\u003cbr\u003e\u003cbr\u003eX-mas morning. Hedwig is perched in the boys&#39; room, and Harry is asleep in bed.\u003cbr\u003e\u003cbr\u003e¬†\u003cbr\u003e\u003cbr\u003eRon: {calling from downstairs} Harry, wake up! Come on Harry, wake up!\u003cbr\u003e\u003cbr\u003e¬†\u003cbr\u003e\u003cbr\u003eHarry gets up and runs to a balcony overlooking the common room, where Ron is standing next to a tree. He is wearing a sweater with an R on it.\u003cbr\u003e\u003cbr\u003e¬†\u003cbr\u003e\u003cbr\u003eRon: Happy Christmas, Harry.\u003cbr\u003e\u003cbr\u003eHarry: Happy Christmas, Ron. What are you wearing?\u003cbr\u003e\u003cbr\u003eRon: Oh, Mum made it for me. Looks like you&#39;ve got one too!\u003cbr\u003e\u003cbr\u003eHarry: I&#39;ve got presents?\u003cbr\u003e\u003cbr\u003eRon: Yeah!\u003cbr\u003e\u003cbr\u003eHarry: Oh! {Harry runs down the stairs.}\u003cbr\u003e\u003cbr\u003eRon: There they are. {Ron sits on a couch arm and eats jelly beans as Harry picks up a silver wrapped package. Harry takes out the card.}\u003cbr\u003e\u003cbr\u003eHarry: &quot;Your father left this in my possession before he died. It is time it was returned to you. Use it well.&quot;\u003cbr\u003e\u003cbr\u003e¬†\u003cbr\u003e\u003cbr\u003eHarry opens the present. It is a cloak.\u003cbr\u003e\u003cbr\u003e¬†\u003cbr\u003e\u003cbr\u003eRon: What is it?\u003cbr\u003e\u003cbr\u003eHarry: Some kind of...cloak.\u003cbr\u003e\u003cbr\u003eRon: Well, let&#39;s see then. Put it on.\u003cbr\u003e\u003cbr\u003e¬†\u003cbr\u003e\u003cbr\u003eHarry puts the cloak on, and all of him disappears except for his head.\u003cbr\u003e\u003cbr\u003e¬†\u003cbr\u003e\u003cbr\u003eRon: Whoa!\u003cbr\u003e\u003cbr\u003eHarry: My body&#39;s gone!\u003cbr\u003e\u003cbr\u003eRon: I know what that is! That&#39;s an invisibility cloak!\u003cbr\u003e\u003cbr\u003eHarry: I&#39;m invisible??\u003cbr\u003e\u003cbr\u003eRon: {gets up} They&#39;re really rare. I wonder who gave it to you.\u003cbr\u003e\u003cbr\u003eHarry: {comes over} There was no name. It just said, &quot;Use it well.&quot;\u003cbr\u003e\u003cbr\u003e¬†\u003cbr\u003e\u003cbr\u003eScene:\u003cbr\u003e\u003cbr\u003eLate at night. A lantern and hand appearbut nothing else. The ensemble walk through the dark library and into the Restricted Section. The lamp is put down, and the cloak removed. Harry appears.\u003cbr\u003e\u003cbr\u003e¬†\u003cbr\u003e\u003cbr\u003eHarry: {Reading books} Famous fire eaters...15th Century Fiends...Flamel...Nicholas Flamel...where are you?\u003cbr\u003e\u003cbr\u003e¬†\u003cbr\u003e\u003cbr\u003eHarry picks up a book and opens it. A man&#39;s face appears.\u003cbr\u003e\u003cbr\u003e¬†\u003cbr\u003e\u003cbr\u003eMan: AHHHHHHHHHHHHHHHH!!!!!!!!\u003cbr\u003e\u003cbr\u003e¬†\u003cbr\u003e\u003cbr\u003eHarry slams the book shuts and puts it back.\u003cbr\u003e\u003cbr\u003e¬†\u003cbr\u003e\u003cbr\u003eFilchs voice: Who&#39;s there?! {Harry whips around, grabbing his cloak. The lamp falls and shatters.} I know you&#39;re in there. You can&#39;t hide. {Harry puts on his cloak and creeps around Filch.} Who is it? Show yourself!\u003cbr\u003e\u003cbr\u003e¬†\u003cbr\u003e\u003cbr\u003eHarry runs from the room, breathing heavily. He gets into the hall, where Mrs. Norris is. The cat meows and begins to follow him. Harry runs around a corner, just as Snape and Quirrell appear. Snape pushes Quirrell into the wall.\u003cbr\u003e\u003cbr\u003e¬†\u003cbr\u003e\u003cbr\u003eQuirrell: Severus...I-I thought...\u003cbr\u003e\u003cbr\u003eSnape: You don&#39;t want me as your enemy, Quirrell.\u003cbr\u003e\u003cbr\u003eQuirrell: W-what do you m-mean?\u003cbr\u003e\u003cbr\u003eSnape: You know perfectly well what I mean. {Snape senses something. Harry stops breathing. Snape reaches out to grab somethingbut doesn&#39;t. He whips his finger back in front of Quirrell&#39;s face.} We&#39;ll have another chat soon...when you&#39;ve had time to decide where your loyalties lie.\u003cbr\u003e\u003cbr\u003e¬†\u003cbr\u003e\u003cbr\u003eFilch appears, carrying the broken lamp.\u003cbr\u003e\u003cbr\u003e¬†\u003cbr\u003e\u003cbr\u003eFilch: Oh, Professors. I found this, in the Restricted Section. It&#39;s still hot. That means there&#39;s a student out of bed.\u003cbr\u003e\u003cbr\u003e¬†\u003cbr\u003e\u003cbr\u003eThey all dart off. A door opens, and closes. On the other side, there is a vast, empty room that has a large mirror in the center. Harry appears and walks over to the mirror. In it, he sees two people appear.\u003cbr\u003e\u003cbr\u003e¬†\u003cbr\u003e\u003cbr\u003eHarry: Mum? {the woman nods and smiles} Dad? {nods and smiles. Harry reaches out to touch thembut only gets the mirror. Then, his mother puts her hand on his shoulder. He puts his own hand on his own shoulders, as if trying to feel her there.\u003cbr\u003e\u003cbr\u003e¬†\u003cbr\u003e\u003cbr\u003eScene:\u003cbr\u003e\u003cbr\u003eThe boys&#39; room. Harry comes whipping in, invisible.\u003cbr\u003e\u003cbr\u003e¬†\u003cbr\u003e\u003cbr\u003eHarry: Ron! You&#39;ve really got to see this! Ron! You&#39;ve got to see this! {pulls back covers. Ron wakes up.} Ron, Ron, come on. Get out of bed!\u003cbr\u003e\u003cbr\u003eRon: Why?\u003cbr\u003e\u003cbr\u003eHarry: There&#39;s something you&#39;ve got to see. Now, come on!\u003cbr\u003e\u003cbr\u003e¬†\u003cbr\u003e\u003cbr\u003eScene:\u003cbr\u003e\u003cbr\u003eBack in the mirror room. Harry and Ron appear as if magically and Harry runs to the mirror.\u003cbr\u003e\u003cbr\u003e¬†\u003cbr\u003e\u003cbr\u003eHarry: Come on. Come. Come look, it&#39;s my parents!\u003cbr\u003e\u003cbr\u003eRon: I only see me.\u003cbr\u003e\u003cbr\u003eHarry: {moves over} Look in properly. Go on. Stand there. There. You see them, don&#39;t you? Thats my dad\u003cbr\u003e\u003cbr\u003eRon: That&#39;s me! Only, I&#39;m head boy...and I&#39;m holding the Quidditch cup! And bloody hell, I&#39;m Quidditch Captain too! I look good. Harry, do you think this mirror shows the future?\u003cbr\u003e\u003cbr\u003eHarry: How can it? Both my parents are dead. {Harry smiles sadly.}\u003cbr\u003e\u003cbr\u003e¬†\u003cbr\u003e\u003cbr\u003eScene:\u003cbr\u003e\u003cbr\u003eAnother night. Harry is sitting in front of the mirror. Dumbledore appears behind him.\u003cbr\u003e\u003cbr\u003e¬†\u003cbr\u003e\u003cbr\u003eDumbledore: Back again, Harry? {Harry turns around and stands up.} I see that you, like so many before you, have discovered the delights of the Mirror of Erised. I trust by now you realize what it does. Let me give you a clue. The happiest man on earth would look into the mirror and see only himself, exactly as he is.\u003cbr\u003e\u003cbr\u003eHarry: So, then it shows us what we want? Whatever we want?\u003cbr\u003e\u003cbr\u003eDumbledore: Yes...and no. It shows us nothing more or less than the deepest, most desperate desires of our hearts. Now you, who have never known your family, you see them standing beside you. But remember this, Harry. This mirror gives us neither knowledge or truth. Men have wasted away in front of it, even gone mad. That is why tomorrow it will be moved to a new home, and I must ask you not to go looking for it again. It does not do to dwell on dreams, Harry, and forget to live. {Harry looks back at the mirror.}\u003cbr\u003e\u003cbr\u003e¬†\u003cbr\u003e\u003cbr\u003eScene:\u003cbr\u003e\u003cbr\u003eDaytime. It is all snowy. Harry is out in a main courtyard, bundled up, with Hedwig on his arm. He stops and she lifts off, soaring away into the sky. When she returns, it is spring time.\u003cbr\u003e\u003cbr\u003e¬†\u003cbr\u003e\u003cbr\u003eScene:\u003cbr\u003e\u003cbr\u003eIn the library. Harry and Ron are seated, reading. Hermione comes up with a huge book. She thumps it onto the table. Harry jumps.\u003cbr\u003e\u003cbr\u003e¬†\u003cbr\u003e\u003cbr\u003eHermione: I had you looking in the wrong section! How could I be so stupid? I checked this out a few weeks ago for a bit of light reading.\u003cbr\u003e\u003cbr\u003eRon: This is light?\u003cbr\u003e\u003cbr\u003eHermione: {glares} Of course! Here it is! &quot;Nicholas Flamel is the only known maker of the Philosopher&#39;s Stone!&quot;\u003cbr\u003e\u003cbr\u003eRon and Harry: The what?\u003cbr\u003e\u003cbr\u003eHermione: Honestly, don&#39;t you two read? &quot;The Philosopher&#39;s Stone is a legendary substance with astonishing powers. It will turn any metal into pure gold and produces the Elixir of Life, which will make the drinker immortal.&quot;\u003cbr\u003e\u003cbr\u003eRon: Immortal?\u003cbr\u003e\u003cbr\u003eHermione: It means you&#39;ll never die.\u003cbr\u003e\u003cbr\u003eRon: I know what it means!\u003cbr\u003e\u003cbr\u003eHarry: Shh!\u003cbr\u003e\u003cbr\u003eHermione: &quot;The only stone currently in existence belongs to Mr. Nicholas Flamel, the noted alchemist, who last year celebrated his 665th birthday!&quot; That&#39;s what Fluffy&#39;s guarding on the 3rd floor. That&#39;s what&#39;s under the trapdoor...the Philosopher&#39;s Stone!\u003cbr\u003e\u003cbr\u003e¬†\u003cbr\u003e\u003cbr\u003eThey all look at each other.\u003cbr\u003e\u003cbr\u003e¬†\u003cbr\u003e\u003cbr\u003eScene:\u003cbr\u003e\u003cbr\u003eNighttime. Hermione, Ron and Harry are running across the wet ground to Hagrids hut. They knock on the door and it opens.\u003cbr\u003e\u003cbr\u003e¬†\u003cbr\u003e\u003cbr\u003eHarry: Hagrid!\u003cbr\u003e\u003cbr\u003eHagrid: {clad in oven mitts and an apron} Oh, hello. Sorry, don&#39;t wish to be rudebut I&#39;m in no fit state to entertain today. {Closes door.}\u003cbr\u003e\u003cbr\u003eAll 3: We know about the Philosopher&#39;s Stone!\u003cbr\u003e\u003cbr\u003e{Door reopens.}\u003cbr\u003e\u003cbr\u003eHagrid: Oh.\u003cbr\u003e\u003cbr\u003e{They all come into Hagrid&#39;s small hut.}\u003cbr\u003e\u003cbr\u003eHarry: We think Snape&#39;s trying to steal it.\u003cbr\u003e\u003cbr\u003eHagrid: Snape? Blimey, Harry, you&#39;re not still on about him, are you?\u003cbr\u003e\u003cbr\u003eHarry: Hagrid, we know he&#39;s after the Stone. We just don&#39;t know why.\u003cbr\u003e\u003cbr\u003eHagrid: Snape is one of the teachers protecting the Stone! He&#39;s not about to steal it!\u003cbr\u003e\u003cbr\u003eHarry: What?\u003cbr\u003e\u003cbr\u003eHagrid: You heard. Right. Come on, now, I&#39;m a bit preoccupied today.\u003cbr\u003e\u003cbr\u003eHarry: Wait a minute. {Ron and a big black boarhound, FANG, meet. Fang sniffs Ron.} One of the teachers?\u003cbr\u003eHermione: {sitting in a large chair} Of course! There are other things defending the Stone, aren&#39;t there? Spells, enchantments.\u003cbr\u003e\u003cbr\u003eHagrid: That&#39;s right. Waste of bloody time, if you ask me.\u003cbr\u003e\u003cbr\u003e{Hermione looks at Ron, who is being sniffed in the face by Fang. Ron shuffles away.} Ain&#39;t no one gonna get past Fluffy. Hehe, not a soul knows how. Except for me and Dumbledore. I shouldn&#39;t have told you that. I shouldn&#39;t have told you that. {A cauldron over a fire begins to rattle.} Oh! {Hagrid hurries over and grabs something} Ooh! Ooh! Ooh! Ooh! {puts the thing, an egg, on the table. The group crowds around.}\u003cbr\u003e\u003cbr\u003eHarry: Uh, Hagrid, what exactly is that?\u003cbr\u003e\u003cbr\u003eHagrid: That? It&#39;s a ... its um...\u003cbr\u003e\u003cbr\u003eRon: I know what that is! But Hagrid, how did you get one?\u003cbr\u003e\u003cbr\u003eHagrid: I won it. Off a stranger I met down at a pub. Seemed quite glad to be rid off it, as a matter of fact.\u003cbr\u003e\u003cbr\u003e¬†\u003cbr\u003e\u003cbr\u003eThe egg rattles and cracks. Pieces fly off as a dragon emerges. It squeaks and slips on an egg piece.\u003cbr\u003e\u003cbr\u003e¬†\u003cbr\u003e\u003cbr\u003eHermione: Is that...a dragon?\u003cbr\u003e\u003cbr\u003eRon: That&#39;s not just a dragon. That&#39;s a Norwegian Ridgeback! My brother Charlie works with these in Romania.\u003cbr\u003e\u003cbr\u003eHagrid: Isn&#39;t he beautiful? Oh. Bless him, look. He knows his mummy. Hehe. Hallo, Norbert. {The dragon squeaks as it looks at Hagrid.}\u003cbr\u003e\u003cbr\u003eHarry: Norbert?\u003cbr\u003e\u003cbr\u003eHagrid: Yeah, well, he&#39;s got to have a name, doesn&#39;t he?\u003cbr\u003e\u003cbr\u003eRon: {laughs}\u003cbr\u003e\u003cbr\u003eHagrid: Don&#39;t you, Norbert? {raises fingers back and forth across Norberts chin} Dededede.\u003cbr\u003e\u003cbr\u003e¬†\u003cbr\u003e\u003cbr\u003eNorbert backs away, hiccups and blows a fireball of fire into Hagrid&#39;s beard.\u003cbr\u003e\u003cbr\u003e¬†\u003cbr\u003e\u003cbr\u003eHagrid: Ohh! Oooh, ooh, ooh, well...he&#39;ll have to be trained up a bit, of course. {Norbert hiccups. Hagrid sees someone looking in the window.} Who&#39;s that? {The person scampers away.}\u003cbr\u003e\u003cbr\u003eHarry: Malfoy.\u003cbr\u003e\u003cbr\u003eHagrid: Oh, dear.\u003cbr\u003e\u003cbr\u003e¬†\u003cbr\u003e\u003cbr\u003eScene:\u003cbr\u003e\u003cbr\u003eThe three are walking back through a corridor. An owl screeches.\u003cbr\u003e\u003cbr\u003e¬†\u003cbr\u003e\u003cbr\u003eHarry: Hagrid always wanted a dragon. He told me so the first time I met him.\u003cbr\u003e\u003cbr\u003eRon: It&#39;s crazy. And worse, Malfoy knows.\u003cbr\u003e\u003cbr\u003eHarry: I don&#39;t understand. Is that bad?\u003cbr\u003e\u003cbr\u003eRon: It&#39;s bad.\u003cbr\u003e\u003cbr\u003e¬†\u003cbr\u003e\u003cbr\u003eThey stop as McGonagall, in her nightgown, appears.\u003cbr\u003e\u003cbr\u003e¬†\u003cbr\u003e\u003cbr\u003eMcGonagall: Good evening.\u003cbr\u003e\u003cbr\u003e¬†\u003cbr\u003e\u003cbr\u003eMalfoy appears smugly beside her.\u003cbr\u003e\u003cbr\u003e¬†\u003cbr\u003e\u003cbr\u003eScene:\u003cbr\u003e\u003cbr\u003eMcGonagall&#39;s classroom. The three accused are standing in front of McGonagall&#39;s desk, while Malfoy is feet away, smirking.\u003cbr\u003e\u003cbr\u003e¬†\u003cbr\u003e\u003cbr\u003eMcGonagall: Nothing, I repeat, nothing gives a student the right to walk about the school at night. Therefore, as punishment for your actions, 50 points will be taken.\u003cbr\u003e\u003cbr\u003eHarry: 50?!\u003cbr\u003e\u003cbr\u003eMcGonagall: Each. And to ensure it doesn&#39;t happen again, all four of you will receive detention.\u003cbr\u003e\u003cbr\u003e¬†\u003cbr\u003e\u003cbr\u003eMalfoy nods, then his smile vanishes.\u003cbr\u003e\u003cbr\u003e¬†\u003cbr\u003e\u003cbr\u003eDraco: Excuse me, Professor. Perhaps I heard you wrong. I thought you said...&quot;the four of us.&quot;\u003cbr\u003e\u003cbr\u003e¬†\u003cbr\u003e\u003cbr\u003eMcGonagall: No, you heard me correctly, Mr. Malfoy. You see, as honorable as your intentions were, you too were out of bed after hours. You will serve detention with your classmates.\u003cbr\u003e\u003cbr\u003e¬†\u003cbr\u003e\u003cbr\u003eHarry, Ron and Hermione grin, and Draco sags.\u003cbr\u003e\u003cbr\u003e¬†\u003cbr\u003e\u003cbr\u003eScene:\u003cbr\u003e\u003cbr\u003eOutside, at night, the four students are being led to Hagrid&#39;s hut by Mr. Filch.\u003cbr\u003e\u003cbr\u003e¬†\u003cbr\u003e\u003cbr\u003eFilch: A pity they let the old punishments die. There was a time detention would find you hanging by your thumbs in the dungeons. God, I miss the screaming. {Draco gulps, and Hermione rushes by.} You&#39;ll be serving detention with Hagrid tonight. He&#39;s got a little job to do inside the dark forest. {Hagrid appears with a crossbow. He sniffles.} A sorry lot this, Hagrid. Oh, good God, man, you&#39;re not still on about that bloody dragon, are you?\u003cbr\u003e\u003cbr\u003e¬†\u003cbr\u003e\u003cbr\u003eHagrid: {sniffs and sighs} Norbert&#39;s gone. Dumbledore sent him off to Romania to live in a colony.\u003cbr\u003e\u003cbr\u003eHermione: Well, that&#39;s good, isn&#39;t it? He&#39;ll be with his own kind.\u003cbr\u003e\u003cbr\u003eHagrid: Yeahbut what if he don&#39;t like Romania? {Filch rolls eyes.} What if the other dragons are mean to him? He&#39;s only a baby, after all.\u003cbr\u003e\u003cbr\u003eFilch: Oh, for Gods sake, pull yourself together, man. You&#39;re going into the forest, after all. Got to have your wits about you.\u003cbr\u003e\u003cbr\u003eDraco: The forest? I thought that was a joke! We can&#39;t go in there. Students aren&#39;t allowed. And there are...{a howl sounds}...werewolves!\u003cbr\u003e\u003cbr\u003eFilch: There&#39;s more than werewolves in those trees, lad. You can be sure of that. {Draco looks frightened.} Nighty-night. {Exit.}\u003cbr\u003e\u003cbr\u003eHagrid: Right. Let&#39;s go.\u003cbr\u003e\u003cbr\u003e¬†\u003cbr\u003e\u003cbr\u003eScene: In the forest. The group walks along a path to a tree. Hagrid stops, bends down and dips his fingers in a silver puddle. He pulls out his fingers and rubs them together. A silver trail smears with his fingers.\u003cbr\u003e\u003cbr\u003e¬†\u003cbr\u003e\u003cbr\u003eHarry: Hagrid, what&#39;s that?\u003cbr\u003e\u003cbr\u003eHagrid: What we&#39;re here for. See that? That&#39;s unicorn&#39;s blood, that is. I found one dead a few weeks ago. Now, this one&#39;s been injured bad by something. {Harry suddenly sees a large cloaked figure walking through the trees. He looks at Hagrid.} So, it&#39;s our job to find the poor beast. Ron, Hermione, you&#39;ll come with me.\u003cbr\u003e\u003cbr\u003eRon: {weakly} Okay.\u003cbr\u003e\u003cbr\u003eHagrid: And Harry, you&#39;ll go with Malfoy. {Draco grimaces, and Harry nods.}\u003cbr\u003e\u003cbr\u003eDraco: Okay. Then I get Fang!\u003cbr\u003e\u003cbr\u003eHagrid: Fine. Just so you know, he&#39;s a bloody coward. {Fang whines.}\u003cbr\u003e\u003cbr\u003e¬†\u003cbr\u003e\u003cbr\u003eScene:\u003cbr\u003e\u003cbr\u003eHarry and Draco are walking through the forest, Fang leading. Draco has the lamp.\u003cbr\u003e\u003cbr\u003e¬†\u003cbr\u003e\u003cbr\u003eDraco: You wait till my father hears about this. This is servant&#39;s stuff.\u003cbr\u003e\u003cbr\u003eHarry: If I didn&#39;t know better, Draco, I&#39;d say you were scared.\u003cbr\u003e\u003cbr\u003eDraco: Scared, Potter?! {Scoffs} {howl} Did you hear that? Come on, Fang. Scared.\u003cbr\u003e\u003cbr\u003e¬†\u003cbr\u003e\u003cbr\u003eScene:\u003cbr\u003e\u003cbr\u003eThe group approaches a flat ground with gnarled roots all over. Fang stops, then growls.\u003cbr\u003e\u003cbr\u003e¬†\u003cbr\u003e\u003cbr\u003eHarry: What is it, Fang?\u003cbr\u003e\u003cbr\u003e¬†\u003cbr\u003e\u003cbr\u003eUp ahead, a cloaked figure is crouched over a dead unicorn, drinking its blood. The figure raises its head, silver blood dripping from its mouth.\u003cbr\u003e\u003cbr\u003e¬†\u003cbr\u003e\u003cbr\u003eHarry gasps and grabs his scar, which is hurting.\u003cbr\u003e\u003cbr\u003e¬†\u003cbr\u003e\u003cbr\u003eDraco: {A look of pure fear} AHHHHHHHHH!!! AHHH! {runs away, with Fang} HELP!!!!!\u003cbr\u003e\u003cbr\u003e¬†\u003cbr\u003e\u003cbr\u003eHarry is left by himself. The figure slides over the unicorn and rises erect. It advances towards Harry, who backs upbut trips. He crawls backwards. Suddenly, there is the sound of hoofbeats. A figure leaps over Harry and lands near the cloaked figure. It is a silver centaur, FIRENZE. It rears, and the cloaked figure retreats, flying away.\u003cbr\u003e\u003cbr\u003e¬†\u003cbr\u003e\u003cbr\u003eFirenze: Harry Potter, you must leave. You are known to many creatures here. The forest is not safe at this time. Especially for you.\u003cbr\u003e\u003cbr\u003eHarry: {rises} But what was that thing you saved me from?\u003cbr\u003e\u003cbr\u003eFirenze: A monstrous creature. It is a terrible crime to slay a unicorn. Drinking the blood of a unicorn will keep you alive even if you are an inch from death. But at a terrible price. You have slain something so pure that the moment the blood touches your lips, you will have a half-life. A cursed life.\u003cbr\u003e\u003cbr\u003eHarry: But who would choose such a life?\u003cbr\u003e\u003cbr\u003eFirenze: Can you think of no one?\u003cbr\u003e\u003cbr\u003eHarry: Do you mean to say...that that thing that killed the unicorn...that was drinking its blood...that was Voldemort?\u003cbr\u003e\u003cbr\u003eFirenze: Do you know what is hidden in the school at this very moment?\u003cbr\u003e\u003cbr\u003eHarry: The Philosopher&#39;s Stone.\u003cbr\u003e\u003cbr\u003e¬†\u003cbr\u003e\u003cbr\u003eSuddenly, a dog (Fang) barks. Harry looks up and sees Hagrid, Hermione, Ron and Draco appear.\u003cbr\u003e\u003cbr\u003e¬†\u003cbr\u003e\u003cbr\u003eHermione: Harry!\u003cbr\u003e\u003cbr\u003eHagrid: Hello there, Firenze. I see you&#39;ve met our young Mr. Potter. You all right there, Harry? {Harry nods}\u003cbr\u003e\u003cbr\u003eFirenze: Harry Potter, this is where I leave you. You&#39;re safe now. Good luck.\u003cbr\u003e¬†\u003cbr\u003e{Close up on the dead unicorn.}\u003cbr\u003e\u003cbr\u003e¬†\u003cbr\u003eScene:\u003cbr\u003e\u003cbr\u003eGryffindor common room. Right after &#39;attack.&#39; The group is around the fire. Hermione and Ron are seatedbut Harry stands.\u003cbr\u003e\u003cbr\u003e¬†\u003cbr\u003e\u003cbr\u003eHermione: You mean, You-Know-Who&#39;s out there, right now, in the forest?\u003cbr\u003e\u003cbr\u003eHarry: But he&#39;s weak. He&#39;s living off the unicorns. Don&#39;t you see? We had it wrong. Snape doesn&#39;t want the stone for himself, he wants the stone for Voldemort. With the Elixir of Life, Voldemort will be strong again. He&#39;ll He&#39;ll come back. {Sits down.}\u003cbr\u003e\u003cbr\u003eRon: But if he comes back, you don&#39;t think he&#39;ll try to kill you, do you?\u003cbr\u003e\u003cbr\u003eHarry: I think if he&#39;d had the chance, he might have tried to kill me tonight.\u003cbr\u003e\u003cbr\u003eRon: {Gulp} And to think, I&#39;ve been worrying about my Potions final!\u003cbr\u003e\u003cbr\u003eHermione: Hang on a minute. We&#39;re forgetting one thing. Who&#39;s the one wizard Voldemort always feared?\u003cbr\u003e\u003cbr\u003e{The boys shrug.} Dumbledore! As long as Dumbledore&#39;s around, you&#39;re safe. As long as Dumbledore&#39;s around, you can&#39;t be touched. {Harry smiles slightly.}\u003cbr\u003e\u003cbr\u003e¬†\u003cbr\u003e\u003cbr\u003eScene:\u003cbr\u003e\u003cbr\u003eSome time later. In the outdoor courtyard. The three are walking.\u003cbr\u003e\u003cbr\u003e¬†\u003cbr\u003e\u003cbr\u003eHermione: I&#39;ve always heard Hogwarts&#39; end of the year exams were frightfulbut I found that rather enjoyable.\u003cbr\u003e\u003cbr\u003eRon: Speak for yourself. All right there, Harry?\u003cbr\u003e\u003cbr\u003eHarry: My scar. It keeps burning.\u003cbr\u003e\u003cbr\u003eHermione: It&#39;s happened before.\u003cbr\u003e\u003cbr\u003eHarry: Not like this.\u003cbr\u003e\u003cbr\u003eRon: Perhaps you should see the nurse.\u003cbr\u003e\u003cbr\u003eHarry: I think it&#39;s a warning. It means dangers coming. Uhh! {He rubs scar and then sees Hagrid across the field, at his hut.} Oh. Of course! {runs for hut.}\u003cbr\u003e\u003cbr\u003eHermione: What is it?\u003cbr\u003e\u003cbr\u003eHarry: Don&#39;t you think it&#39;s a bit odd that what Hagrid wants more than anything is a dragon, and a stranger shows up and just happens to have one? {They approach Hagrid, who is playing the Harry Potter theme on his flute.} I mean, how many people wander around with dragon eggs in their pockets? Why didn&#39;t I see it before? Hagrid, who gave you the dragon egg? {Hagrid stops playing.} What did he look like?\u003cbr\u003e\u003cbr\u003eHagrid: I don&#39;t know. I never saw his face. He kept his hood up.\u003cbr\u003e\u003cbr\u003eHarry: The stranger, though, you and he must have talked.\u003cbr\u003e\u003cbr\u003eHagrid: Well, he wanted to know what sort of creatures I looked after. I told him. I said, &quot;After Fluffy, a dragon&#39;s gonna be no problem.&quot;\u003cbr\u003e\u003cbr\u003eHarry: And did he seem interested in Fluffy?\u003cbr\u003e\u003cbr\u003eHagrid: Well, of course he was interested in Fluffy! How often do you come across a three headed dog, even if you&#39;re in the trade? But I told him. I said, &quot;The trick with any beast is to know how to calm him. Take Fluffy, for example, just play him a bit of music and he falls straight to sleep.&quot;\u003cbr\u003e\u003cbr\u003e¬†\u003cbr\u003e\u003cbr\u003eThe three gape.\u003cbr\u003e\u003cbr\u003e¬†\u003cbr\u003e\u003cbr\u003eHagrid: I shouldn&#39;t have told you that. {The three take off.} Where you going?! Wait!\u003cbr\u003e\u003cbr\u003e¬†\u003cbr\u003e\u003cbr\u003eScene:\u003cbr\u003e\u003cbr\u003eMcGonagall&#39;s classroom. The three come tearing in and run up the aisles between desks. They pass a ghost and stop at the desk.\u003cbr\u003e\u003cbr\u003e¬†\u003cbr\u003e\u003cbr\u003eHarry: We have to see Professor Dumbledore, immediately!\u003cbr\u003e\u003cbr\u003eMcGonagall: I&#39;m afraid Professor Dumbledore is not here. He received an urgent owl from the Ministry of Magic and left immediately for London.\u003cbr\u003e\u003cbr\u003eHarry: He&#39;s gone?! Now? But this is important! It&#39;s about...the Philosopher&#39;s Stone.\u003cbr\u003e\u003cbr\u003eMcGonagall: {shocked} How do you know\u003cbr\u003e\u003cbr\u003eHarry: Someone&#39;s going to try and steal it.\u003cbr\u003e\u003cbr\u003eMcGonagall: I don&#39;t know how you three found out about the stonebut I can assure you it is perfectly well-protected. Now would you go back to your dormitories? Quietly. {They leave.}\u003cbr\u003e\u003cbr\u003e¬†\u003cbr\u003e\u003cbr\u003eScene:\u003cbr\u003e\u003cbr\u003eAfter exiting McGonagall&#39;s class, they walk down the hallway.\u003cbr\u003e\u003cbr\u003e¬†\u003cbr\u003e\u003cbr\u003eHarry: That was no stranger Hagrid met in the village. It was Snape, which means he knows how to get past Fluffy.\u003cbr\u003e\u003cbr\u003eHermione: And with Dumbledore gone\u003cbr\u003e\u003cbr\u003e{Snape suddenly appears behind them}\u003cbr\u003e\u003cbr\u003eSnape: Good afternoon. Now, what would three young Gryffindors such as yourselves be doing inside on a day like this?\u003cbr\u003e\u003cbr\u003eHermione: Uh...we were just...\u003cbr\u003e\u003cbr\u003eSnape: You want to be careful. People will think you&#39;re {Harry glares madly at Snape, who looks shocked} up to something. {Exit.}\u003cbr\u003e\u003cbr\u003eHermione: Now what do we do?\u003cbr\u003e\u003cbr\u003eHarry: We go down the trapdoor. Tonight.\u003cbr\u003e\u003cbr\u003e¬†\u003cbr\u003e\u003cbr\u003eScene: Nighttime. In the Gryffindor Common Room. The three friends come down the stairs and begin to walk across the floor. They stop when they hear croaking.\u003cbr\u003e\u003cbr\u003e¬†\u003cbr\u003e\u003cbr\u003eHarry: Trevor.\u003cbr\u003e\u003cbr\u003eRon: Trevor shh! Go, you shouldn&#39;t be here!\u003cbr\u003e\u003cbr\u003eNeville: {appears behind a chair} Neither should you. You&#39;re sneaking out again, arent you?\u003cbr\u003e\u003cbr\u003eHarry: Now, Neville, listen. We were\u003cbr\u003e\u003cbr\u003eNeville: No! I won&#39;t let you! {stands} You&#39;ll get Gryffindor in trouble again! I-I&#39;ll fight you. {holds out fists.}\u003cbr\u003e\u003cbr\u003eHermione: Neville, I&#39;m really, really sorry about this...{takes out wand} Petrificus Totalus.\u003cbr\u003e\u003cbr\u003e¬†\u003cbr\u003e\u003cbr\u003eNeville is frozen and falls backwards onto the ground. Hermione puts her wand back.\u003cbr\u003e\u003cbr\u003e¬†\u003cbr\u003e\u003cbr\u003eRon: {Gulp} You&#39;re a little scary sometimes...you know that? Brilliantbut scary.\u003cbr\u003e\u003cbr\u003eHarry: Let&#39;s go. {Walks by Neville} Sorry.\u003cbr\u003e\u003cbr\u003eHermione: Sorry.\u003cbr\u003e\u003cbr\u003eRon: It&#39;s for your own good, you know. {Exit.}\u003cbr\u003e\u003cbr\u003e¬†\u003cbr\u003e\u003cbr\u003eScene: The three are under the Invisibility cloak, sneaking along the corridor.\u003cbr\u003e\u003cbr\u003e¬†\u003cbr\u003e\u003cbr\u003eHermione: Ow! You stood on my foot!\u003cbr\u003e\u003cbr\u003eRon: Sorry. {A flame lights. Hermione draws out her wand and points it at the door.}\u003cbr\u003e\u003cbr\u003eHermione: Alohomora.\u003cbr\u003e\u003cbr\u003e¬†\u003cbr\u003e\u003cbr\u003eThe door opens and they go in.\u003cbr\u003e\u003cbr\u003e¬†\u003cbr\u003e\u003cbr\u003eRon: Wait a minute...he&#39;s....{a blow of air, and the cape flutters off them.} Sleeping.\u003cbr\u003e\u003cbr\u003eHarry: Snape&#39;s already been here. He&#39;s put a spell on the harp. {They approach the sleeping dog.}\u003cbr\u003e\u003cbr\u003eRon: Uh. It&#39;s got horrible breath!\u003cbr\u003e\u003cbr\u003eHarry: We have to move its paw.\u003cbr\u003e\u003cbr\u003eRon: What?!\u003cbr\u003e\u003cbr\u003eHarry: Come on! {grabs paw, which is blocking the door.} Okay. Push! {They strain and move it. They open the door.} I&#39;ll go first. Don&#39;t follow until I give you a sign. {Fluffy&#39;s eyes open.} If something bad happens, get yourselves out...Does it seem a bit...quiet?\u003cbr\u003e\u003cbr\u003eHermione: The harp. It stopped playing.\u003cbr\u003e\u003cbr\u003e¬†\u003cbr\u003e\u003cbr\u003eDrool from one head comes down on Ron&#39;s shoulder.\u003cbr\u003e\u003cbr\u003e¬†\u003cbr\u003e\u003cbr\u003eRon: Ew! Yuck! Ugh. {All three kids look up and see Fluffy standing there. Fluffy barks and growls, thrashing. It breaks the harp and dives at the three.}\u003cbr\u003e\u003cbr\u003eHarry: Jump! Go! {They all jump through the trapdoor.}\u003cbr\u003e\u003cbr\u003eRon: Ahh! {gasps as he lands on some mushy black ropelike vines.} Whoa. Lucky this plant-thing is here, really.\u003cbr\u003e\u003cbr\u003eHarry: Whoa! {The plant begins to move towards them.} Oh. Ahh! {The plant ties them up.}\u003cbr\u003e\u003cbr\u003eHermione: Stop moving, both of you. This is Devil&#39;s Snare. You have to relax. If you don&#39;t, it will only kill you faster.\u003cbr\u003e\u003cbr\u003eRon: Kill us faster?! Oh, now I can relax!\u003cbr\u003e\u003cbr\u003e¬†\u003cbr\u003e\u003cbr\u003eHermione manages a smile as she is sucked down below.\u003cbr\u003e\u003cbr\u003e¬†\u003cbr\u003e\u003cbr\u003eRon and Harry: Hermione!!\u003cbr\u003e\u003cbr\u003eRon: Now what are we gonna do?!\u003cbr\u003e\u003cbr\u003eHermione&#39;s voice: Just relax!\u003cbr\u003e\u003cbr\u003eHarry: Hermione! Where are you?!\u003cbr\u003e\u003cbr\u003eHermione (from below): Do what I say. Trust me.\u003cbr\u003e\u003cbr\u003e¬†\u003cbr\u003e\u003cbr\u003eHarry relaxes and is sucked through.\u003cbr\u003e\u003cbr\u003e¬†\u003cbr\u003e\u003cbr\u003eRon: Ahh! Harry!\u003cbr\u003e\u003cbr\u003e¬†\u003cbr\u003e\u003cbr\u003eHarry falls through and lands on the hard ground. Hermione goes over to him and he stands up.\u003cbr\u003e\u003cbr\u003e¬†\u003cbr\u003e\u003cbr\u003eRon: Harry!\u003cbr\u003e\u003cbr\u003eHermione: Are you okay?\u003cbr\u003e\u003cbr\u003eHarry: Yeah, yeah, I&#39;m fine.\u003cbr\u003e\u003cbr\u003eRon: Help!\u003cbr\u003e\u003cbr\u003eHermione: He&#39;s not relaxing, is he?\u003cbr\u003e\u003cbr\u003eHarry: Apparently not.\u003cbr\u003e\u003cbr\u003eRon: Help! Help me!\u003cbr\u003e\u003cbr\u003eHermione: We&#39;ve got to do something!\u003cbr\u003e\u003cbr\u003eHarry: What?\u003cbr\u003e\u003cbr\u003eHermione: Uh! I remember reading something in Herbology. {Ron: Help!} Um Devil&#39;s Snare, Devil&#39;s Scare, {The snare shuts Ron&#39;s mouth} it&#39;s deadly fun...but will sulk in the sun! That&#39;s it! Devil&#39;s Snare hates sunlight! {takes out wand and points upwards.} Lumus Solem! {A beam of light shoots out. The Snare shrieks and recoils. Ron falls below.}\u003cbr\u003e\u003cbr\u003eRon: Ahhh!\u003cbr\u003e\u003cbr\u003eHarry: Ron, are you okay?\u003cbr\u003e\u003cbr\u003eRon: Yeah.\u003cbr\u003e\u003cbr\u003eHarry: Okay.\u003cbr\u003e\u003cbr\u003eRon: {stands} Whew. Lucky we didn&#39;t panic!\u003cbr\u003e\u003cbr\u003eHarry: Lucky Hermione pays attention in Herbology.\u003cbr\u003e\u003cbr\u003e¬†\u003cbr\u003e\u003cbr\u003eThere is a sound.\u003cbr\u003e\u003cbr\u003e¬†\u003cbr\u003e\u003cbr\u003eHermione: What is that?\u003cbr\u003e\u003cbr\u003eHarry: I don&#39;t know. Sounds like wings.\u003cbr\u003e\u003cbr\u003e¬†\u003cbr\u003e\u003cbr\u003eThey enter into a room filled with golden &quot;birds.&quot;\u003cbr\u003e\u003cbr\u003e¬†\u003cbr\u003e\u003cbr\u003eHermione: Curious. I&#39;ve never seen birds like these.\u003cbr\u003e\u003cbr\u003eHarry: They&#39;re not birds, they&#39;re keys. And I&#39;ll bet one of them fits that door. {They come upon a broomstick, suspended in the air.}\u003cbr\u003e\u003cbr\u003eHermione: What&#39;s this all about?\u003cbr\u003e\u003cbr\u003eHarry: I don&#39;t know. Strange.\u003cbr\u003e\u003cbr\u003e{Ron creeps over to the door and takes out his wand.}\u003cbr\u003e\u003cbr\u003eRon: {rattles lock.} Alohomora! {Shrugs} Well, it was worth a try.\u003cbr\u003e\u003cbr\u003eHermione: Ugh! What&#39;re we going to do? There must be 1000 keys up there!\u003cbr\u003e\u003cbr\u003eRon: We&#39;re looking for a big old fashioned one. Probably rusty like the handle.\u003cbr\u003e\u003cbr\u003eHarry: There! I see it! {points} The one with the broken wing! {He looks at the broom.}\u003cbr\u003e\u003cbr\u003eHermione: What&#39;s wrong, Harry?\u003cbr\u003e\u003cbr\u003eHarry: It&#39;s too simple.\u003cbr\u003e\u003cbr\u003eRon: Oh, go on, Harry! If Snape can catch it on that old broomstick, you can! You&#39;re the youngest seeker in a century!\u003cbr\u003e\u003cbr\u003e¬†\u003cbr\u003e\u003cbr\u003eHarry nods and grabs the broom. All the keys suddenly go one direction, right at Harry. He climbs on, swiping at them.\u003cbr\u003e\u003cbr\u003e¬†\u003cbr\u003e\u003cbr\u003eRon: This complicates things a bit!\u003cbr\u003e\u003cbr\u003e¬†\u003cbr\u003e\u003cbr\u003eHarry pushes off into the air. He flies off, after the key. The others follow him. Harry grabs the key.\u003cbr\u003e\u003cbr\u003e¬†\u003cbr\u003e\u003cbr\u003eHarry: Catch the key!\u003cbr\u003e\u003cbr\u003e¬†\u003cbr\u003e\u003cbr\u003eHe zooms by and throws the key to Hermione, who catches it and heads for the lock while Harry distracts the other keys. Hermione puts it in the lock.\u003cbr\u003e\u003cbr\u003e¬†\u003cbr\u003e\u003cbr\u003eRon: Hurry up!\u003cbr\u003e\u003cbr\u003e¬†\u003cbr\u003e\u003cbr\u003eThe door opens, and Hermione and Ron rush through, followed by Harry. They shut the door just as the keys slam up against it.\u003cbr\u003e\u003cbr\u003e¬†\u003cbr\u003e\u003cbr\u003eScene:\u003cbr\u003e\u003cbr\u003eThey enter a dark room, with broken pieces all around it.\u003cbr\u003e\u003cbr\u003e¬†\u003cbr\u003e\u003cbr\u003eHermione: I don&#39;t like this. I don&#39;t like this at all.\u003cbr\u003e\u003cbr\u003eHarry: Where are we? A graveyard.\u003cbr\u003e\u003cbr\u003eRon: This is no graveyard. {sighs} It&#39;s a chessboard. {Walks out onto the marble board and flames light, illuminating the board and GIANT players. Harry and Hermione come up with him.}\u003cbr\u003e\u003cbr\u003eHarry: There&#39;s the door.\u003cbr\u003e\u003cbr\u003e¬†\u003cbr\u003e\u003cbr\u003eThey walk across the board, towards the door. Suddenly, as they reach a line of pawns, the pawns bring up their swords. The three jump and back up.\u003cbr\u003e\u003cbr\u003e¬†\u003cbr\u003e\u003cbr\u003eHermione: Now what do we do?\u003cbr\u003e\u003cbr\u003eRon: It&#39;s obvious, isn&#39;t it? We&#39;ve got to play our way across the room. All right. Harry, you take the Bishop&#39;s square. Hermione, you&#39;ll be the Queen&#39;s side castle. As for me, I&#39;ll be a knight. {They all take their places.}\u003cbr\u003e\u003cbr\u003eHermione: What happens now?\u003cbr\u003e\u003cbr\u003eRon: {aboard a horse.} Well, white moves first, and then...we play. {A pawn on the other side moves forward. Ron studies the game.}\u003cbr\u003e\u003cbr\u003eHermione: Ron, you don&#39;t suppose this is going to be like...real wizard&#39;s chess, do you?\u003cbr\u003e\u003cbr\u003eRon: You there! D-5! {A black pawn moves forward, diagonal to the white pawn. The white pawn raises its swords and smashes the black one. The three jump.} Yes, Hermione, I think this is going to be exactly like wizard&#39;s chess!\u003cbr\u003e\u003cbr\u003e¬†\u003cbr\u003e\u003cbr\u003eThe game continues. Pieces smash each other, boom! Boom!\u003cbr\u003e\u003cbr\u003eRon: Castle to E-4! Smash! Ron: Pawn to C-3! Smash! Boom! The Queen turns, and smashes a piece! Harry, Ron and Hermione wince. The Queen turns again. Both Ron and Harry study the game.\u003cbr\u003e\u003cbr\u003e¬†\u003cbr\u003e\u003cbr\u003eHarry: Wait a minute.\u003cbr\u003e\u003cbr\u003eRon: You understand right, Harry. Once I make my move, the Queen will take me...then you&#39;ll be free to check the King.\u003cbr\u003e\u003cbr\u003eHarry: No, Ron! No!\u003cbr\u003e\u003cbr\u003eHermione: What is it?\u003cbr\u003e\u003cbr\u003eHarry: He&#39;s going to sacrifice himself!\u003cbr\u003e\u003cbr\u003eHermione: No, Ron, you can&#39;t! {Ron closes his eyes.} There must be another way!\u003cbr\u003e\u003cbr\u003eRon: {turns to face Hermione.} Do you want to stop Snape or not? Harry, it&#39;s you that has to go on. I know it. Not me, not Hermione, you. {Harry nods.} Knight...to H-3.\u003cbr\u003e\u003cbr\u003e¬†\u003cbr\u003e\u003cbr\u003eRon&#39;s horse moves forward, slides and stops.\u003cbr\u003e\u003cbr\u003e¬†\u003cbr\u003e\u003cbr\u003eRon: Check.\u003cbr\u003e\u003cbr\u003e¬†\u003cbr\u003e\u003cbr\u003eThe Queen turns and advances. Ron breathes faster, clutching the steel reins. The Queen stops. SMASH! Ron goes flying off the horse and lands on the floor, unconscious.\u003cbr\u003e\u003cbr\u003e¬†\u003cbr\u003e\u003cbr\u003eRon: Ahhhh!\u003cbr\u003e\u003cbr\u003eHarry: RON! {Hermione starts walking to him.} NO! Don&#39;t move! Dont forget, we&#39;re still playing. {Hermione moves back. Harry walks the diagonal in front of the King.} Checkmate. {The Kings sword falls onto the ground victory. Harry breathes out and then the two run to Ron. They bend beside him.} Take care of Ron. Then, go to the owlery. Send a message to Dumbledore. Ron&#39;s right...I have to go on.\u003cbr\u003e\u003cbr\u003eHermione: You&#39;ll be okay, Harry. You&#39;re a great wizard, you really are.\u003cbr\u003e\u003cbr\u003eHarry: Not as good as you.\u003cbr\u003e\u003cbr\u003eHermione: {smile} Me? Books and cleverness? There are more important things. Friendship, and bravery. And Harry, just be careful.\u003cbr\u003e\u003cbr\u003e¬†\u003cbr\u003e\u003cbr\u003eHarry nods and stands, walking away.\u003cbr\u003e\u003cbr\u003e¬†\u003cbr\u003e\u003cbr\u003e\u003cbr\u003e¬†\u003cbr\u003eScene:\u003cbr\u003e\u003cbr\u003eHarry walks down a long staircase to an empty room with pillars around it. The Mirror of Erised is in the middle of the room, and a man is standing before it. It is Quirrell. Harry yelps and grabs his scar.\u003cbr\u003e\u003cbr\u003e¬†\u003cbr\u003e\u003cbr\u003eHarry: You? {Quirrell turns around.} No. It can&#39;t be...Snape. He was the one\u003cbr\u003e\u003cbr\u003eQuirrell: Yes. He does seem the type, doesn&#39;t he? Next to me, who would suspect, &quot;p-p-poor s-stuttering Professor Quirrell?&quot;\u003cbr\u003e\u003cbr\u003eHarry: B-but, that day, during the Quidditch Match, Snape tried to kill me.\u003cbr\u003e\u003cbr\u003eQuirrell: No, dear boy. I tried to kill you! And trust me, if Snape&#39;s cloak hadn&#39;t caught fire and broken my eye contact, I would have succeeded. Even with Snape muttering his little counter-curse.\u003cbr\u003e\u003cbr\u003eHarry: Snape was trying to...save me?\u003cbr\u003e\u003cbr\u003eQuirrell: I knew you were a danger right from the off. Especially after Halloween.\u003cbr\u003e\u003cbr\u003eHarry: Th-then you let the troll in.\u003cbr\u003e\u003cbr\u003eQuirrell: Very good Potter, yes. Snape, unfortunately, wasn&#39;t fooled. While everyone else was running to the dungeon, he went to the 3rd floor to head me off. He, of course, never trusted me again. He rarely left me alone. {Quirrell turns back to the mirror and Harry&#39;s scar hurts.} But he doesn&#39;t understand. I&#39;m never alone. Never. Now...what does this mirror do? I see what I desire. I see myself holding the stone. But how do I get it?\u003cbr\u003e\u003cbr\u003e{A raspy voice, VOLDEMORT, calls.}: Use the boy.\u003cbr\u003e\u003cbr\u003eQuirrell: Come here, Potter, now!\u003cbr\u003e\u003cbr\u003e¬†\u003cbr\u003e\u003cbr\u003eHarry walks forward shakily.\u003cbr\u003e\u003cbr\u003e¬†\u003cbr\u003e\u003cbr\u003eQuirrell: Tell me. What do you see?\u003cbr\u003e\u003cbr\u003e¬†\u003cbr\u003e\u003cbr\u003eHarry looks in the mirror. He sees himself. His mirror self brings his hand into his pocket and takes out a red stone! The mirror self winks and puts the stone back. Very subtly, Harry reaches to his pocket. There is a lump. He gasps.\u003cbr\u003e\u003cbr\u003e¬†\u003cbr\u003e\u003cbr\u003eQuirrell: What is it?! What do you see?!\u003cbr\u003e\u003cbr\u003eHarry: I-I&#39;m shaking hands with Dumbledore. I&#39;ve won the house cup.\u003cbr\u003e\u003cbr\u003eVoldemort&#39;s voice: He lies.\u003cbr\u003e\u003cbr\u003eQuirrell: Tell the truth! What do you see?!\u003cbr\u003e\u003cbr\u003eVoldemort&#39;s voice: Let me speak to him.\u003cbr\u003e\u003cbr\u003eQuirrell: Master, you are not strong enough.\u003cbr\u003e\u003cbr\u003eVoldemort&#39;s voice: I have strength enough for this. {Quirrell unwraps his turban and on the side opposite his face, another face is planted. It is Voldemort who appears kind of like a snake. He stretches out and faces Harry via the mirror.} Harry Potter. We meet again.\u003cbr\u003e\u003cbr\u003eHarry: Voldemort.\u003cbr\u003e\u003cbr\u003eVoldemort: Yes. You see what I have become? See what I must do to survive? Live off another. A mere parasite. Unicorn blood can sustain mebut it cannot give me a body of my own. But there is something that can. Something, that conveniently enough, lies in your pocket!\u003cbr\u003e\u003cbr\u003e¬†\u003cbr\u003e\u003cbr\u003eHarry turns and runs.\u003cbr\u003e\u003cbr\u003e¬†\u003cbr\u003e\u003cbr\u003eVoldemort: Stop him! {Quirrell snaps his fingers and fire erupts all around the room. Harry is stuck.} Don&#39;t be a fool! Why suffer a horrific death when you can join me and live?!\u003cbr\u003e\u003cbr\u003eHarry: {shakes his head} Never!\u003cbr\u003e\u003cbr\u003eVoldemort: Haha. Bravery. Your parents had it too. Tell me, Harry, would you like to see your mother and father again? Together, we can bring them back. {In the mirror, Harrys parents faces appear.} All I ask for is something in return. {Harry takes the stone from his pocket.} That&#39;s it, Harry. There is no good and evil. There is only power, and those too weak to seek it. Together, we&#39;ll do extraordinary things. Just give me the stone! {Mother and father vanish.}\u003cbr\u003e\u003cbr\u003eHarry: You liar!\u003cbr\u003e\u003cbr\u003eVoldemort: Kill him!\u003cbr\u003e\u003cbr\u003e¬†\u003cbr\u003e\u003cbr\u003eQuirrell soars into the air and smashes into Harry, one hand on Harrys throat. They fall to the steps. The stone falls out of Harry&#39;s reach as Quirrell chokes him. Harry strains and squeaks. Suddenly, Harry puts his hand on Quirrell&#39;s, trying to get him off. Smoke furls from under his hand.\u003cbr\u003e\u003cbr\u003e¬†\u003cbr\u003e\u003cbr\u003eQuirrell: Ahh! Ahh! {backs up. His hand is crumbling into a mountain of black ash.} What is this magic? {hand dissipates.}\u003cbr\u003e\u003cbr\u003eVoldemort: Fool! Get the stone!\u003cbr\u003e\u003cbr\u003eQuirrell: {Walks forwardbut Harry puts both hands on his face.} Ahhhhhhhhhh!\u003cbr\u003e\u003cbr\u003e¬†\u003cbr\u003e\u003cbr\u003eQuirrell backs up, then his face, which is horrendously burned, crumbles as he walks forward. His whole body is ash. He falls to the floor. Harry gasps. He looks at his own hands and hurries over to the stone. He picks it up and sighs, when he hears something. Turning, Harry sees a dust clouds with Voldemort&#39;s face. The cloud rushes forward, right through Harry!\u003cbr\u003e\u003cbr\u003e¬†\u003cbr\u003e\u003cbr\u003eVoldemort: Arrrhhhhhh!\u003cbr\u003e\u003cbr\u003eHarry: Ahhhhhhhhh! {Voldemort flies away. Harry falls to the ground, unconscious. He holds the stone in an outstretched hand.}\u003cbr\u003e\u003cbr\u003e¬†\u003cbr\u003e\u003cbr\u003eScene:\u003cbr\u003e\u003cbr\u003eThe hospital wing. Harry is bandaged, lying in bed. He awakens, puts on his glasses, and sits up. There are cards and candy all over. Dumbledore approaches him.\u003cbr\u003e\u003cbr\u003e¬†\u003cbr\u003e\u003cbr\u003eDumbledore: Good afternoon, Harry. Ah. Tokens from your admirers?\u003cbr\u003e\u003cbr\u003eHarry: Admirers?\u003cbr\u003e\u003cbr\u003eDumbledore: What happened down in the dungeons between you and Professor Quirrell is a complete secret, so, naturally, the whole school knows. {Both smile.} Ah, I see your friend Ronald has saved you the trouble of opening your Chocolate Frogs.\u003cbr\u003e\u003cbr\u003eHarry: Ron was here? Is he all right? What about Hermione?\u003cbr\u003eDumbledore: Fine. They&#39;re both just fine.\u003cbr\u003e\u003cbr\u003eHarry: But, what happened to the Stone?\u003cbr\u003e\u003cbr\u003eDumbledore: Relax, dear boy. The stone has been destroyed. My friend Nicholas and I had a little chat and agreed it was best all around.\u003cbr\u003e\u003cbr\u003eHarry: But Flamel, he&#39;ll die, won&#39;t he?\u003cbr\u003e\u003cbr\u003eDumbledore: {sits on the bed.} He has enough Elixir to set his affairs in order. But yes, he will die.\u003cbr\u003e\u003cbr\u003eHarry: How is it I got the Stone, sir? One minute I was staring in the mirror, and the next...\u003cbr\u003e\u003cbr\u003eDumbledore: Ah. You see, only a person who wanted to find the Stone, find itbut not use it, would be able to get it. That is one of my more brilliant ideas. And between you and me thats saying something. {Smile both.}\u003cbr\u003e\u003cbr\u003eHarry: Does that mean, with the Stone gone, I mean, that Voldemort can never come back?\u003cbr\u003e\u003cbr\u003eDumbledore: Ah, I&#39;m afraid there are ways in which he can return. Harry, do you know why Professor Quirrell couldn&#39;t bear to have you touch him? {Harry shakes his head.} It was because of your mother. She sacrificed herself for you, and that kind of act leaves a mark. {Harry touches his scar.} No, no, this kind of mark cannot be seen. It lives in your very skin.\u003cbr\u003e\u003cbr\u003eHarry: What is it?\u003cbr\u003e\u003cbr\u003eDumbledore: Love, Harry, love. {Pats Harry&#39;s head and stands up.} Ah. Bertie Bott&#39;s Every Flavour Beans. I was most unfortunate in my youth to come across a vomit flavoured one, and since then I have lost my liking for them. But I think I could be safe with a nice toffee...{takes brown bean and eats it.} Mm. Alas. Earwax.\u003cbr\u003e\u003cbr\u003e¬†\u003cbr\u003e\u003cbr\u003eScene:\u003cbr\u003e\u003cbr\u003eHarry approaches a room where up on a stairwell balcony Hermione and Ron are talking. They stop when they see Harry and lean over the railing.\u003cbr\u003e\u003cbr\u003e¬†\u003cbr\u003e\u003cbr\u003eHarry: All right there, Ron?\u003cbr\u003e\u003cbr\u003eRon: All right? You?\u003cbr\u003e\u003cbr\u003eHarry: {shrug} All right. Hermione?\u003cbr\u003e\u003cbr\u003eHermione: {smile} Never better.\u003cbr\u003e\u003cbr\u003e¬†\u003cbr\u003e\u003cbr\u003eScene:\u003cbr\u003e\u003cbr\u003eIn the great hall. All students are seated, and green banners with snakes on them are around the ceiling.\u003cbr\u003e\u003cbr\u003eDumbledore, at the head table, nods to McGonagall.\u003cbr\u003e\u003cbr\u003eShe dings her glass and the chatter stops. Dumbledore rises.\u003cbr\u003e\u003cbr\u003e¬†\u003cbr\u003e\u003cbr\u003eDumbledore: Another year gone. And now, as I understand it, the house cup needs awarding, and the points stand thus. In fourth place, Gryffindor with 312 points. {Clapping. Harry and Hermione hide their heads.} Third place, Hufflepuff, with 352 points. {Clapping.} In second place, Ravenclaw, with 426 points. {Clapping.} And in first place, with 472 points, Slytherin House.\u003cbr\u003e\u003cbr\u003e¬†\u003cbr\u003e\u003cbr\u003eThere is immense cheering.\u003cbr\u003e\u003cbr\u003e¬†\u003cbr\u003e\u003cbr\u003eStudents: Whoo! Yeah!\u003cbr\u003e\u003cbr\u003eDraco: Nice one, Mate! {sees Ron looking at him and sneers.}\u003cbr\u003e\u003cbr\u003eDumbledore: Yes, yes, well done Slytherin, well done Slytherin. However, recent events must be taken into account. And I have a few last minute points to award. {The Gryffindor students look up.} To Miss Hermione Granger, for the use of cool intellect when others were in great peril, 50 points. {Applause.}\u003cbr\u003e\u003cbr\u003eHarry: {Pats} Good job.\u003cbr\u003e\u003cbr\u003eDumbledore: Second, to Mr. Ronald Weasley, for the best played game of chess {Ron looks at Harry and mouths, &#39;Me?&#39; Harry nods, and mouths, &#39;You!&#39;} that Hogwarts has seen these many years...50 points. {Applause} And third, to Mr. Harry Potter, for pure nerve and outstanding courage, I award Gryffindor house 60 points. {Immense cheering.}\u003cbr\u003e\u003cbr\u003eHermione: We&#39;re tied with Slytherin!\u003cbr\u003e\u003cbr\u003eDumbledore: And finally, it takes a great deal of bravery to stand up to your enemiesbut a great deal more to stand up to your friends. I award 10 points to Neville Longbottom.\u003cbr\u003e\u003cbr\u003e¬†\u003cbr\u003e\u003cbr\u003eImmense cheering erupts. Neville is unbelieving, and sits there while cheering gets louder. Draco is downfallen.\u003cbr\u003e\u003cbr\u003e¬†\u003cbr\u003e\u003cbr\u003eDumbledore: Assuming that my calculations are correct, I believe that a change of direction is in order. {Claps. The green banners change to Gryffindor red and yellow.} Gryffindor wins the House Cup!\u003cbr\u003e\u003cbr\u003e¬†\u003cbr\u003e\u003cbr\u003eCheering.\u003cbr\u003e\u003cbr\u003e¬†\u003cbr\u003e\u003cbr\u003eHagrid: Yes! {grins}\u003cbr\u003e\u003cbr\u003e¬†\u003cbr\u003e\u003cbr\u003eAll students stand and throw their hats into the air, except Draco, who smashes his down onto the table.\u003cbr\u003e\u003cbr\u003e¬†\u003cbr\u003e\u003cbr\u003eSeamus: Neville! {Shakes his hand.}\u003cbr\u003e\u003cbr\u003e¬†\u003cbr\u003e\u003cbr\u003eAll rub each other&#39;s hair and jump around, cheering and laughing.\u003cbr\u003e\u003cbr\u003e¬†\u003cbr\u003e\u003cbr\u003eLee: Yeah! We won!! {Jumps with Harry, who looks back and grins very widely.}\u003cbr\u003e\u003cbr\u003e¬†\u003cbr\u003e\u003cbr\u003eScene:\u003cbr\u003e\u003cbr\u003eThe outdoor train station. Students are walking around, getting in the train.\u003cbr\u003e\u003cbr\u003e¬†\u003cbr\u003e\u003cbr\u003eHagrid: Come on now, hurry up. You&#39;ll be late. Train&#39;s leaving. Go on. Go on. Come on. Hurry up.\u003cbr\u003e\u003cbr\u003e¬†\u003cbr\u003e\u003cbr\u003eHarry hands Hedwig to a train man, and walks to an open door of the train with Hermione. Hermione waves to Hagrid, who waves back. Hermione gets in the train.\u003cbr\u003e\u003cbr\u003e¬†\u003cbr\u003e\u003cbr\u003eHermione: Come on, Harry.\u003cbr\u003e\u003cbr\u003eHarry: One minute. {He walks over to Hagrid.}\u003cbr\u003e\u003cbr\u003eHagrid: Thought you were leaving without saying good-bye, didja? {Hagrid takes a red album out of his coat pocket and hands it to Harry.} This is for you.\u003cbr\u003e\u003cbr\u003e¬†\u003cbr\u003e\u003cbr\u003eHarry opens the album and sees a picture, moving, of him as a baby with his parents. They are all smiling and waving. Harry smiles.\u003cbr\u003e\u003cbr\u003e¬†\u003cbr\u003e\u003cbr\u003eHarry: Thanks, Hagrid. {Shakes Hagrid&#39;s hand, then hugs him tightly.}\u003cbr\u003e\u003cbr\u003eHagrid: Oh. Go on...on with you. {Harry lets go.} Oh, listen, Harry, if that dolt of a cousin of yours, Dudley, gives you any grief, you could always, um, threaten him with a nice pair of ears to go with that tail of his.\u003cbr\u003e\u003cbr\u003eHarry: But Hagrid, we&#39;re not allowed to do magic away from Hogwarts. You know that.\u003cbr\u003e\u003cbr\u003eHagrid: I do. But your cousin don&#39;t, do he? Eh? {chuckle} Off you go.\u003cbr\u003e\u003cbr\u003e¬†\u003cbr\u003e\u003cbr\u003eHarry walks away, back to the train door where Hermione and Ron are waiting.\u003cbr\u003e\u003cbr\u003e¬†\u003cbr\u003e\u003cbr\u003eHermione: Feels strange to be going home, doesn&#39;t it?\u003cbr\u003e\u003cbr\u003eHarry: I&#39;m not going home. Not really.\u003cbr\u003e\u003cbr\u003e¬†\u003cbr\u003e\u003cbr\u003eThe train whistles and they climb aboard. As the train starts to leave and the camera pans up over the whole scene, Harry waves out the window to Hagrid, who waves back and then waves more to other students as the camera pans far back, then the credits begin.",
            "textOriginal": "Scene:\n\nA neighbourhood on a street called Privet Drive. An owl, sitting on the street sign flies off to reveal a mysterious appearing old man walking through a forest near the street. He stops at the start of the street and takes out a mechanical device and zaps all the light out of the lampposts. He puts away the device and a cat meows. The man, ALBUS DUMBLEDORE, looks down at the cat, which is a tabby and is sitting on a brick ledge.\n\n¬†\n\nDumbledore: I should have known that you would be here...Professor McGonagall.\n\n¬†\n\nThe cat meows, sniffs out and the camera pans back to a wall. The cats shadow is seen progressing into a human. There are footsteps and MINERVA MCGONAGALL is revealed.\n\n¬†\n\nMcGonagall: Good evening, Professor Dumbledore. Are the rumours true, Albus?\n\n¬†\n\nDumbledore: I'm afraid so, Professor. The good, and the bad.\n\nMcGonagall: And the boy?\n\nDumbledore: Hagrid is bringing him.\n\nMcGonagall: Do you think it wise to trust Hagrid with something as important as this?\n\nAlbus: Ah, Professor, I would trust Hagrid with my life.\n\n¬†\n\nThere is a motor sound, and the two professors look up to see a flying motorcycle coming down from the air. It skids on the street and halts. A large man, RUBEUS HAGRID, takes off his goggles.\n\n¬†\n\nHagrid: Professor Dumbledore, Sir. Professor McGonagall.\n\nDumbledore: No problems, I trust, Hagrid?\n\nHagrid: No, sir. Little tyke fell asleep just as we were flying over Bristol. Heh. Try not to wake him. There you go.\n\n¬†\n\nHagrid hands a baby in a blanket over to Dumbledore.\n\n¬†\n\nMcGonagall: Albus, do you really think its safe, leaving him with these people? I've been watching them all day. They're the worst sort of Muggles imaginable. They really are\n\nDumbledore: The only family he has.\n\n¬†\n\nThey stop outside a house.\n\n¬†\n\nMcGonagall: This boy will be famous. There wont be a child in our world who doesn't know his name.\n\nDumbledore: Exactly. He's better off growing up away from all that. Until he is ready.\n\n¬†\n\nHagrid coughs and sniffles, he is crying. He clears his throat.\n\n¬†\n\nDumbledore: There, there, Hagrid. It's not really good-bye, after all.\n\n¬†\n\nHagrid nods. Dumbledore takes a letter and places it on the baby, who is now at the foot of the door. The baby has a visible lightning-bolt shaped scar on his forehead.\n\n¬†\n\nDumbledore: Good luck...Harry Potter.\n\n¬†\n\nThe camera pans into the scar and the opening title shows:\n\nHARRY POTTER AND THE PHILOSOPHER'S STONE\n\n\nAlmost ten years after the: DURSLEY's home. The camera pans on a sleeping boy, almost eleven, with a lightning-bolt shaped scar on his forehead.\n\nThere is a click, and knocking. Outside, a tall woman, PETUNIA DURSLEY, raps the door.\n\n¬†\n\nPetunia: Up. Get up. {Knocks} {sighs} Now! {Smacks door of closet which is the boys bedroom}\n\n¬†\n\nA large, tubby boy, DUDLEY DURSLEY, suddenly comes running down the stairs above the closet. He stops half-way down and goes back, jumping on the staircase.\n\n¬†\n\nDudley: Wake up, cousin! We're going to the zoo!\n\n¬†\n\nDudley laughs, comes down the stairs and runs for the kitchen. The boy, HARRY POTTER, tries to come out of the closetbut is pushed back in by Dudley.\n\n¬†\n\nPetunia is in the kitchen, where Dudley has gone.\n\n¬†\n\nPetunia: Oh, here he comes, the birthday boy!\n\n¬†\n\nA larger man, VERNON DURSLEY, is sitting at the kitchen table.\n\n¬†\n\nVernon: Happy birthday, son.\n\n¬†\n\nPetunia and Dudley giggle together. Harry comes into the kitchen, dressed in rags.\n\n¬†\n\nPetunia: Why don't you just cook the breakfast, and try not to burn anything.\n\nHarry: Yes, Aunt Petunia.\n\n¬†\n\nHe sets to work.\n\n¬†\n\nPetunia: I want everything to be perfect for my Dudley's special day.\n\nVernon: Hurry up! Bring my coffee, boy!\n\nHarry: Yes, Uncle Vernon.\n\n¬†\n\nPetunia leads Dudley over to the family room, where there are a vast amount of presents. Dudley stares.\n\n¬†\n\nDudley: How many are there?\n\nVernon: Thirty-six. Counted 'em myself.\n\nDudley: Thirty-six?! But last year last year I got thirty-seven!!\n\nVernon: Yes, well, some of them are quite a bit bigger than last year!\n\nDudley: I don't care how big they are!\n\nPetunia: Oh, now, now, now. This is what we're going to do, is that when we go out we're going to buy you two new presents! How's that, Pumpkin?\n\n¬†\n\nScene:\n\nOutside, morning. The happy family is heading to the car. Harry goes to get in but is stopped by Vernon.\n\n¬†\n\nPetunia: This will be a lovely day at the zoo. I'm really looking forward to it.\n\nVernon: I'm warning you now, boy. Any funny business, any at all, and you won't have any meals for a week. Get in.\n\n¬†\n\nScene:\n\nThe zoo. The family is in the reptile house, looking at a large BOA CONSTRICTOR.\n\n¬†\n\nDudley: Make it move.\n\nVernon raps the glass of the cage.\n\n¬†\n\nVernon: Move!\n\n¬†\n\nDudley raps the glass much harder, and Vernon winces.\n\n¬†\n\nDudley: MOVE!\n\nHarry: He's asleep!\n\nDudley: He's boring.\n\n¬†\n\nDudley and his parents retreat to another enclosure. Harry is left with the snake.\n\n¬†\n\nHarry: Sorry about him. He doesn't understand what it's like, lying there day after day, having people press their ugly faces in on you.\n\n¬†\n\nThe snake looks up and blinks.\n\n¬†\n\nHarry: Can you...hear me? {The snake nods} It's just...I've never talked to a snake before. Do you...I mean...do you talk to people often? {The snake shakes its head} You're from Burma, aren't you? Was it nice there, do you miss your family? {The snake turns its head in the direction of a sign which says, Bred in Captivity} I see. That's me as well. I never knew my parents, either.\n\n¬†\n\nThe now awake snake has attracted Dudley's attention. He rips over to the cage, knocking Harry to the floor.\n\n¬†\n\nDudley: Mummy, dad, come here! You won't believe what this snake is doing!!\n\n¬†\n\nDudley puts his hands on the glass wall. Harry, from the ground, glares at him. Suddenly, the glass disappears. Dudley wretches forward.\n\n¬†\n\nDudley: Whoa! Ahh! Ahh!!\n\n¬†\n\nDudley falls into the snake enclosure, sputtering in a pool of water. The snake gets out of the exhibit, stopping in front of Harry.\n\n¬†\n\nSnake: Thankssssssss.\n\nHarry: Anytime.\n\n¬†\n\nThe snake starts off.\n\n¬†\n\nMan: SNAKE!\n\n¬†\n\nThere is a lot of screaming as the snake heads for freedom. Dudley gets up to get outbut the glass is now back over the enclosure. He is stuck. He pounds the glass.\n\n¬†\n\nDudley: Mum, mummy!\n\nPetunia: {Sees him} AHH!\n\nDudley: Mum, help! Help me!\n\nPetunia: My darling boy! How did you get in there?!\n\nHarry: {Grins and giggles}\n\n¬†\n\nVernon glares down at him and Harry's grin disappears. Petunia continues screaming: How did you get in there? Dursley, oh, Dursley!\n\n¬†\n\nScene:\n\nBack at the Dursley's. Petunia and a bundled up Dudley come in.\n\nPetunia: It's all right. It's all right.\n\n¬†\n\nThey disappear around the corner. Harry and Vernon enter. Vernon slams the door and shoves Harry against a wall, taking his hair.\n\n¬†\n\nHarry: Ow!\n\nVernon: What happened?\n\nHarry: I swear I don't know! One minute the glass was there and then it was gone! It was like magic!\n\nVernon: {Scoffs and shoves Harry into the closet} There's no such thing as magic!\n\n¬†\n\nScene:\n\nOutside, some time later. An owl flies by the house and drops a letter, which zooms in the letterbox. It lands away from the house and hoots.\n\nHarry, inside, goes to collect the mail. He sorts through the letters and sees his, addressed to him. He goes into the kitchen, hands Vernon the rest of the mail, and walks around the other side of the table to see his letter.\n\n¬†\n\nVernon: Ah, Marge is ill. Ate a funny whelk.\n\nDudley: {Sees Harrys letter. He runs and grabs it} Dad, look! Harry's got a letter!!\n\nHarry: Hey, give it back! It's mine!\n\nVernon: {Laughs} Yours? Who'd be writing to you?\n\n¬†\n\nThe family gathers to look at the address. There is a broken seal on the letter. The family looks up and Harry gulps.\n\n¬†\n\nScene:\n\nAnother owl flies by with a letter and drops it off. Inside, Vernon grabs a handful of letters and rips them up.\n\nIn the closet, Harry hears a whirring noise. He looks out at Vernon drilling wood over the letterbox opening.\n\n¬†\n\nVernon: No more mail through this letterbox.\n\n¬†\n\nScene:\n\nOutside, Vernon and Petunia appear. Vernon is about to head off to work. Petunia kisses his cheek.\n\n¬†\n\nPetunia: Have a lovely day at the office, dear.\n\n¬†\n\nShe stops, looks and sees a bunch of owls.\n\n¬†\n\nVernon: Shoo! Go on!\n\n¬†\n\nScene:\n\nInside. Vernon is tossing letters into the fireplace. Harry comes around the corner. Vernon grins evilly and tosses more in.\n\n¬†\n\nScene:\n\nLiving/Family room. The family is sitting around, Harry is serving cookies.\n\n¬†\n\nVernon: Fine day Sunday. In my opinion, best day of the week. Why is that, Dudley?\n\n¬†\n\nDudley shrugs.\n\n¬†\n\nHarry: {Hands cookie to Vernon} Because there's no post on Sunday? Ah, right you are, Harry. No post on Sunday. Hah! No blasted letters today. No, sir. {Harry sees a shadow outside the window. Outside, millions of owls are perched.} No sir, not one blasted, miserable---\n\n¬†\n\nA letter shoots out of the fireplace and zips across Vernons face. There is a rumbling and then zillions of letters come shooting out of the fireplace.\n\n¬†\n\nDudley: AHH! Make it stop! Please make it stop! {He jumps on Petunias lap}\n\nPetunia and Vernon: {Screaming}\n\nVernon: Go away, ahh!\n\nDudley: What is it? Please tell me what's happening!\n\n¬†\n\nHarry jumps onto the coffee table to grab a letter. He gets one and starts to run away. Vernon jumps up as well.\n\n¬†\n\nVernon: Give me that! Give me that letter!\n\n¬†\n\nHe chases Harry and grabs him before Harry gets into his closet.\n\n¬†\n\nHarry: Get off! Ahh!\n\nVernon: Ahh!\n\nHarry: They're my letters! Let go of me!\n\nVernon: That's it! We're going away! Far away! Where they can't find us!\n\nDudley: Daddy's gone mad, hasnt he?!\n\n¬†\n\nScene:\n\nA house, on a rock island somewhere out at sea. The family is sleeping, with Harry on the cold, dirt floor. He has drawn a birthday cake which reads, Happy Birthday Harry. Harry looks at Dudley's watch, which beeps 12:00.\n\n¬†\n\nHarry: Make a wish, Harry. {Blows}\n\n¬†\n\nSuddenly, the door thumps. Harry jumps. The door thumps again and Dudley and Harry jump up and back away. Petunia and Vernon appear, Vernon with a gun. The door bangs again and then cracks open, and a giant man appears.\n\n¬†\n\nVernon: Who's there? Ahh!\n\nHagrid: Sorry 'bout that. {He puts the door back up}\n\nVernon: I demand that you leave at once, Sir! You are breaking and entering!\n\nPetunia: Ooh.\n\n¬†\n\nHagrid comes over, grabs the gun and bends it upwards.\n\n¬†\n\nHagrid: Dry up, Dursley, you great prune. {The gun fires}\n\nAll: Ahh!\n\nHagrid: {sees Dudley} Mind, I haven't seen you since you was a baby, Harrybut you're a bit more along than I would have expected. Particularly 'round the middle!\n\nDudley: I-I-I'm not Harry.\n\nHarry appears: I-I am.\n\nHagrid: Oh, well, of course you are! Got something for ya. 'Fraid I might have sat on it at some point! I imagine that it'll taste fine just the same. Ahh. Baked it myself. {Hands Harry the cake} Words and all. Heh.\n\nHarry: Thank you! {Opens cake, which reads: Happee Birdae Harry.}\n\nHagrid: It's not every day that your young man turns eleven, now is it?\n\n¬†\n\nHagrid sits down on the couch, takes out an umbrella and points it at the empty fire. Poof, poof! Two sparks fly out and the fire starts. The family gapes.\n\n¬†\n\nHarry: {puts cake down} Excuse me, who are you?\n\nHagrid: Rubeus Hagrid. Keeper of keys and grounds at Hogwarts. Course, you'll know all about Hogwarts.\n\nHarry: Sorry, no.\n\nHagrid: No? Blimey, Harry, didn't you ever wonder where your mum and dad learned it all?\n\nHarry: Learnt what?\n\nHagrid: You're a wizard, Harry.\n\nHarry: I-I'm a what?\n\nHarry: A wizard. And a thumping good one at that, I'd wager. Once you train up a little.\n\nHarry: No, you've made a mistake. I can't be...a-a wizard. I mean, I'm just... Harry. Just Harry.\n\nHagrid: Well, Just Harry, did you ever make anything happen? Anything you couldn't explain when you were angry or scared? {Harry softens his expression} Ah.\n\nDudley: {whimpers}\n\n¬†\n\nHagrid hands Harry the same letter that has been sent the past while. Harry opens it.\n\n¬†\n\nHarry: Dear, Mr. Potter. We are pleased to inform you that you have been accepted at Hogwarts' School of Witchcraft and Wizardry!\n\nVernon: Hell not be going! We swore when we took him in wed put an end to this rubbish!\n\nHarry: You knew?? You knew all along and you never told me?\n\nPetunia: Of course we knew. How could you not be? My perfect sister being who she was. Oh, my mother and father were so proud the day she got her letter. We have a witch in the family. Isn't it wonderful? I was the only one to see her for what she was. A freak! And then she met that Potter, and then she had you, and I knew you'd be just the same, just as strange, just as ... abnormal. And then, if you please, she went and got herself blown up! And we got landed with you.\n\nHarry: Blown up? You told me my parents died in a car crash!\n\nHagrid: A car crash? A car crash kill James and Lily Potter?\n\nPetunia: We had to tell him something.\n\nHagrid: It's an outrage! It's a scandal!\n\nVernon: He'll not be going!\n\nHagrid: Oh, and I suppose a great Muggle like yourself's going to stop him, are you?\n\nHarry: Muggle?\n\nHagrid: Non magic folk. This boy's had his name down ever since he was born! He's going to the finest school of witchcraft and wizardry in the world, and he'll be under the greatest headmaster Hogwarts' has ever seen: Albus Dumbledore.\n\nVernon: I will not pay for some crackpot old fool to teach him magic tricks!\n\nHagrid: {whips out umbrella and points it at Vernon} Never insult Albus Dumbledore in front of me.\n\n¬†\n\nHagrid sees Dudley eating Harry's cake, and points the umbrella at his rear. A grey tail grows.\n\n¬†\n\nDudley: Ahh!\n\nAll: Ahh! {family chases Dudley}\n\nHarry: {laughs}\n\nHagrid: Oh, um, I'd appreciate if you didn't tell anyone at Hogwarts about that. Strictly speaking, I'm not allowed to do magic.\n\nHarry: {Nods} Okay.\n\nHagrid: {checks a clock} Ooh, we're a bit behind schedule. Best be off. Unless you'd rather stay, of course. Hmm? {Leaves}\n\n¬†\n\nHarry grins, looks back, and grins again.\n\n¬†\n\nScene:\n\nStreets of London. Hagrid and Harry are walking.\n\nHarry: All students must be equipped with...one standard size two pewter cauldron and may bring if they desire either an owl, a cat or a toad. Can we find all this in London?\n\nHagrid: If you know where to go.\n\n¬†\n\nThey go to a corner store and enter, The Leaky Cauldron.\n\n{Music and talking}\n\n¬†\n\nBarkeep Tom: Ah, Hagrid! The usual, I presume?\n\nHagrid: No thanks, Tom. I'm on official Hogwarts business today. Just helping young Harry here buy his school supplies.\n\nTom: Bless my soul. It's Harry Potter.\n\n¬†\n\nThe pub goes silent. A man comes up and shakes Harrys hand.\n\n¬†\n\nMan: Welcome back, Mr. Potter, welcome back.\n\n¬†\n\nA witch comes up and shakes Harrys hand, as well.\n\n¬†\n\nWitch: Doris Crockford, Mr. Potter. I can't believe I'm meeting you at last.\n\n¬†\n\nA man in robes with a turban on his head appears. It is PROFESSOR QUIRRELL.\n\n¬†\n\nQuirrell: Harry P-potter. C-can't tell you how pleased I am to meet you.\n\nHagrid: Hello, Professor. I didn't see you there. Harry, this is Professor Quirrell. He'll be your Defense Against the Dark Arts teacher at Hogwarts.\n\nHarry: Oh, nice to meet you. {Puts out hand. Quirrell refuses}\n\nQuirrell: F-fearfully fascinating subject. N-not that you need it, e-eh, Potter? Heheh.\n\nHagrid: Yes, well, must be going now. Lots to buy. Heh.\n\nHarry: Good-bye.\n\n¬†\n\nThe two leave into a back room winery in front of a brick wall.\n\n¬†\n\nHagrid: See, Harry, you're famous!\n\nHarry: But why am I famous, Hagrid? All those people back there, how is it they know who I am?\n\nHagrid: I'm not exactly sure I'm the right person to tell you that, Harry. {Taps the brick wall clockwise with his umbrella. The blocks shift and open up to reveal a hidden, busy street.}\n\nWelcome, Harry, to Diagon Alley. ¬†\n\n¬†\n\nHarry grins broadly as they step into the street and walk down it. An owl screeches.\n\n¬†\n\nHagrid: Here's where you'll get your quills and ink, and over there all your bits and bobs for doing your wizardry.\n\n¬†\n\nHarry is amazed as they pass by shops and owls and bats. The camera pans on a broom store, where a group of boys are crowded around a shiny broom.\n\n¬†\n\nBoy: It's a world class racing broom. Look at it, its the new Nimbus 2000! It's the fastest model yet.\n\nHarry: But, Hagrid, how am I to pay for all this? I haven't any money.\n\nHagrid: Well there's your money, Harry. Gringotts, the Wizard Bank. T'aint no place safer, 'cept perhaps Hogwarts.\n\n¬†\n\nInside the bank, they walk down the shiny aisle, passing tiny creatures working.\n\n¬†\n\nHarry: Uh, Hagrid, what exactly are those things?\n\nHagrid: They're goblins, Harry. Clever as they come goblins but not the most friendly of beasts. Best stick close to me. {Harry sticks to him.} {Hagrid clears his throat as they approach a counter with a goblin in it.} Mr. Harry Potter wishes to make a withdrawal.\n\n¬†\n\nThe goblin looks up.\n\n¬†\n\nGoblin: And does Mr. Harry Potter have his key?\n\nHagrid: Oh. Wait a minute. Got it here somewhere. Hah. Here's the little devil. Oh, and there's something else as well. Professor Dumbledore gave me this. It's about you-know-what in vault you-know-which. {Hands Goblin letter wrapped in string.}\n\nGoblin: Very well.\n\n¬†\n\nScene:\n\nRacing down the depth caverns in a cartlike structure. The cart stops, a goblin, GRIPHOOK, clambers out.\n\n¬†\n\nGriphook: Vault 687. Lamp, please. {Hagrid hands him the lamp and he walks to the vault} Key please. {Hagrid hands him the key and he unlocks it}\n\n¬†\n\nThe room is filled nearly top to bottom with coins. Harry is amazed.\n\n¬†\n\nHagrid: Didn't think your mum and dad would leave you with nothing, now didja?\n\n¬†\n\nThey continue on through the cavern.\n\n¬†\n\nGriphook: Vault 713.\n\nHarry: What's in there, Hagrid?\n\nHagrid: Can't tell you, Harry. It's Hogwarts business. Very secret.\n\nGriphook: Stand back. {Slides finger down the door. Clank. Clank. The vault opens to expose a small white stone package. Hagrid hurries in and scoops it up. The eerie light it was shining with disappears.}\n\n¬†\n\nHagrid: Best not mention this to anyone, Harry.\n\nHarry nods.\n\n¬†\n\nScene: Outside in the street, walking.\n\n¬†\n\nHarry: I still need...a wand.\n\nHagrid: A wand? Well, you'll want Ollivanders. No place better. Run along therebut wait. I just got one more thing I got to do. Won't be long.\n\n¬†\n\nHarry goes into the store, quietly. He looks around. There are shelves of wandsbut no people.\n\n¬†\n\nHarry: {Softly} Hello? Hello?\n\n¬†\n\nThere is a thunk. A man appears on a ladder and looks at Harry. He smiles.\n\n¬†\n\nOllivander: I wondered when I'd be seeing you, Mr. Potter. It seems only yesterday that your mother and father were in here buying their first wands. {Picks a wand} Ah. Here we are. {Harry holds it but just stands} Well, give it a wave.\n\nHarry: Oh! {waves. All the shelves come crashing down. Harry jumps and hurriedly puts the wand back on the counter.}\n\nOllivander: Apparently not. {Gets another wand.} Perhaps this. {Harry waves at a vase, which blows apart.} No, no, definitely not! No matter...{gets a wand} I wonder. {Hands wand to Harry. Harry glows under it.} Curious, very curious.\n\nHarry: Sorrybut what's curious?\n\nOllivander: I remember every wand I've ever sold, Mr. Potter. It just so happens that the phoenix, whose tail feather resides in your wand gave one other feather, just one. It is curious that you should be destined for this wand when its brother gave you that scar. {Points to scar}\n\nHarry: And...who owned that wand?\n\nOllivander: Oh, we do not speak his name. The wand chooses the wizard, Mr. Potter. It's not always clear whybut I think it is clear that we can expect great things from you. After all, He-Who-Must-Not-Be-Named did great things...terrible, yesbut great. {Hands Harry his wand.}\n\n¬†\n\nThere is a knock on the window.\n\n¬†\n\nHagrid: Harry! Harry! Happy birthday! {Has a snowy owl in a cage which hoots.}\n\nHarry: Wow.\n\n¬†\n\nScene: Later, eating supper. The two, Hagrid and Harry, are at a long table, eating soup.\n\n¬†\n\nHagrid: You all right, Harry? You seem very quiet.\n\nHarry: He killed my parents, didn't he? The one who gave me this. You know, Hagrid, I know you do.\n\nHagrid: {Sighs and pushes bowl away} First, and understand this, Harry, 'cause it's very important. Not all wizards are good. Some of them go bad. A few years ago there was one wizard who went as bad as you can go. And his name was V-...his name was V-...\n\nHarry: Maybe if you wrote it down?\n\nHagrid: No, I can't spell it. All right. His name was Voldemort.\n\nHarry: Voldemort?\n\nHagrid: Shh!!\n\n{Harry looks around}\n\n¬†\n\nA flashback ensues, consisting off a cloaked man walking towards a house, breaking in with his wand, and proceeding to terrorize. Hagrid narrates.\n\n¬†\n\nHagrid: It was dark times, Harry, dark times. Voldemort started to gather some followers, brought 'em over to the dark side. Anyone that stood up to him ended up dead. Your parents fought against himbut nobody lived once he decided to kill 'em. {Harrys mother, LILY, screams as she is killed by Voldemorts wand} Nobody...not one. Except you. {close-up of baby Harry.}\n\nHarry: Me? Voldemort tried to kill...me?\n\nHagrid: Yes. That ain't no ordinary cut on your forehead, Harry. A mark like that only comes from being touched by a curse...and an evil curse at that.\n\nHarry: What happened to Vo-...to You-Know-Who?\n\nHagrid: Some say he died. Codswallop in my opinion. Nope, I reckon he's out there, still, too tired to go on. But one thing's absolutely certain. Something about you stumped him that night. That's why you're famous, Harry. That's why everbody knows your name. You're the boy who lived.\n\n¬†\n\n\n¬†¬†\nScene: London Train Station. Up on a crossing bridge, Harry (with cart and owl) walk beside Hagrid.\n\n¬†\n\nA couple look at Hagrid.\n\n¬†\n\nHagrid: What're you looking at? {Looks at watch} Blimey, is that the time?? Sorry, Harry, I'm gonna have to leave you. Dumbledore'll be wanting his...well, he'll be wanting to see me. Now, uh, your train leaves in 10 minutes. Here's your ticket. Stick to it, Harry that's very important. Stick to your ticket.\n\n¬†\n\nHarry looks at his golden ticket.\n\n¬†\n\nHarry: Platform 9 ¬æ? But Hagrid, there must be a mistake. This says Platform 9 ¬æ. There's no such thing...is there? {Harry looks up and Hagrid has vanished.}\n\n¬†\n\nScene: Harry is walking down lane between trains. A man rushes by.\n\n¬†\n\nMan: Sorry.\n\nHarry sees a train master.\n\nHarry: Excuse me, excuse me.\n\nTrainmaster: {talking to woman and child} Right on your left, ma'am.\n\nHarry: Excuse me, Sir. Can you tell me where I might find Platform 9 ¬æ?\n\nTrainmaster: 9 ¬æ? Think youre being funny, do ya? {Leaves}\n\n¬†\n\nA woman, daughter, and four boys walk by, pushing carts.\n\n¬†\n\nMrs. Weasley: It's the same year after year. Always packed with Muggles, of course.\n\nHarry: Muggles?\n\nMrs. Weasley: Come on. Platform 9 ¬æ this way! All right, Percy, you first.\n\n¬†\n\nA tall boy with red hair comes forward and runs towards a brick wall. Amazingly, he disappears right into it. Harry is amazed.\n\n¬†\n\nMrs. Weasley: Fred, you next.\n\nGeorge: He's not Fred, I am!\n\nFred: Honestly, woman, you call yourself our mother!\n\nMrs. Weasley: Oh, I'm sorry, George.\n\nFred: I'm only joking. I am Fred. {He runs through the wall, and is followed by his twin brother.}\n\n¬†\n\nHarry shakes his head in disbelief.\n\n¬†\n\nHarry: Excuse me! C-could you tell me how to\n\nMrs. Weasley: How to get on the platform? Yes, not to worry, dear. It's Ron's first time to Hogwarts as well. {pan to a red haired boy who smiles} Now, all you've got to do is walk straight at the wall between platforms 9 and 10. Best do it at a bit of a run if youre nervous.\n\nGinny (daughter): Good luck.\n\n¬†\n\nHarry takes a breath and runs at the wall. He shuts his eyes and emerges on the other side a magnificent station with a red train and bundles of people. A whistle blows, and Harry sighs with relief.\n\n¬†\n\nScene: The train is traveling through unknown country. Pan to inside compartment, where Harry is sitting. The red headed boy, RON, appears, dirt on his nose.\n\n¬†\n\nRon: Excuse me, do you mind? Everywhere else is full.\n\nHarry: No, not at all.\n\nRon: {sits across from Harry} I'm Ron, by the way. Ron Weasley.\n\nHarry: I'm Harry. Harry Potter.\n\n{Ron goes agape.}\n\nRon: So-so it's true?! I mean, do you really have the...the...\n\nHarry: The what?\n\nRon: {whispers} Scar...?\n\nHarry: Oh, yeah. {lifts up hair}\n\nRon: Wicked.\n\nA trolley comes by the compartment, full of sweets.\n\nWoman: Anything off the trolley, dears?\n\nRon: {Holds up mushed sandwiches} No, thanks, I'm all set. {smacks lips.}\n\nHarry: {pulls out coins} We'll take the lot!\n\nRon: Whoa!\n\n¬†\n\nScene: Eating bundles of sweets.\n\nRon's rat, Scabbers, is perched on Ron's knee, a box over its head.\n\n¬†\n\nHarry: Bertie Bott's Every Flavour Beans?\n\nRon: They mean every flavour! There's chocolate and peppermint, and there's also spinach, liver and tripe. George sweared he got a bogey-flavoured one once!\n\n¬†\n\nHarry quickly takes the bean he was chewing out of his mouth.\n\n¬†\n\nHarry: {picks up blue and gold package} These aren't real chocolate frogs, are they?\n\nRon: It's only a spell. Besides, it's the cards you want. Each pack's got a famous witch or wizard. I got about 500 meself.\n\nFrog: Ribbit. {The frog jumps onto the window and climbs up, then leaps out the window...disappearing.}\n\nRon: Oh, that's rotten luck. They've only got one good jump in them to begin with.\n\nHarry: Hey, I got Dumbledore!\n\nRon: I got about 6 of him.\n\nHarry: Hey, he's gone!\n\nRon: Well, you can't expect him to hang around all day, can you? {Scabbers squeaks} This is Scabbers, by the way, pitiful, isn't he?\n\nHarry: Just a little bit.\n\nRon: Fred gave me a spell as to turn him yellow. Want to see?\n\nHarry: Yeah!\n\nRon: {clears throat} Ahem. Sun-\n\n¬†\n\nA girl, HERMIONE GRANGER, with bushy brown hair appears at the doorway.\n\n¬†\n\nHermione: Has anyone seen a toad? A boy named Neville's lost one.\n\nRon: No.\n\nHermione: Oh, are you doing magic? Let's see then.\n\nRon: Aghhhemm. Sunshine, daisesbutter mellow, turn this stupid fat rat yellow!\n\n{Zap. Nothing happens. Ron shrugs.}\n\nHermione: Are you sure that's a real spell? Well, it's not very good, is it? Of course I've only tried a few simple spells myself, and they've all worked for me. For example...{Hermione goes over and sits across from Harry. He points her hand at his glasses and Harry tenses} Oculus Reparo. {The glasses, which noseband is battered, are repaired. Harry takes them off, amazed.} That's better, isn't it? Holy Cricket, you're Harry Potter. I'm Hermione Granger...and you are...?\n\nRon: {full mouth} I'm...Ron Weasley.\n\nHermione: Pleasure. You two better change into your robes. I expect we'll be arriving soon. {Gets up and leaves, then comes back and looks at Ron.} You've got dirt, on your nose, by the way, did you know? Just there. {Points} {Ron scratches his nose, embarrassed.}\n\n¬†\n\nScene: Darkness, the train blows its whistle and pulls into an outdoor station. Hagrid walks along the side aisle, with a lantern. People begin pouring out of the train.\n\n¬†\n\nHagrid: Right, then! First years! This way, please! Come on, now, don't be shy! Come on now, hurry up!\n\n¬†\n\nHarry and Ron walk up to Hagrid.\n\n¬†\n\nHagrid: Hello, Harry.\n\nHarry: Hey, Hagrid.\n\nRon: Whoaa!\n\nHagrid: Right then. This way to the boats! Come on, now, follow me.\n\n¬†\n\nScene:\n\nA number of boats are plugging across a vast lake, where up ahead a huge castle can be seen. People are in awe.\n\nRon: Wicked.\n\n¬†\n\nScene: On a higher level, Professor McGonagall is waiting. She raps her fingers on a stone railing, and then goes to the top of the stairs to greet the newcomers.\n\n¬†\n\nMcGonagall: Welcome to Hogwarts. Now, in a few moments, you will pass through these doors and join your classmates. But before you can take your seats you must be sorted into your houses. They are Gryffindor, Ravenclaw, Hufflepuff, and Slytherin. Now, while you are here, your house will be like your family. Your triumphs will earn you house points. Any rule breaking, and you will lose points. At the end of the year, the house with the most points is awarded the house cup\n\n¬†\n\nNEVILLE LONGBOTTOM, a scared looking boy, spots his toad sitting near McGonagall. He jumps forward.\n\n¬†\n\nNeville: Trevor! {McGonagall stares down at him} Sorry. {He backs away.}\n\nMcGonagall: The sorting ceremony will begin momentarily. {leaves}\n\n¬†\n\nDRACO MALFOY, a slicked back evil looking boy speaks up.\n\n¬†\n\nDraco: It's true then, what they're saying on the train. Harry Potter has come to Hogwarts. {Students whisper, Harry Potter?} This is Crabbe, and Goyle {nods to thugs} and I'm Malfoy...Draco Malfoy. {Ron snickers at his name} Think my name's funny, do you? No need to ask yours. Red hair, and a hand me down robe? You must be a Weasley. Well soon find that some wizarding families are better than others, Potter. Dont want to go making friends with the wrong sort. I can help you there. {extends hand.}\n\nHarry: I think I can tell who the wrong sort are for myself, thanks.\n\n¬†\n\nDraco glares. McGonagall returns and smacks him on the shoulder with a paper. He retreats with one last glare.\n\n¬†\n\nMcGonagall: We're ready for you now.\n\n¬†\n\nShe leads everyone through two large doors and into the Great Hall, where there are four long tables with many kids, as well as floating candles. The roof appears to be the sky.\n\n¬†\n\nHermione: It's not real, the ceiling. It's just bewitched to look like the night sky. I read about it in Hogwarts: A History.\n\nMcGonagall: All right, will you wait along here, please? Now, before we begin, Professor Dumbldedore would like to say a few words.\n\n¬†\n\nDumbledore rises from the main table.\n\n¬†\n\nDumbledore: I have a few start of term notices I wish to announce. The first years please note that the dark forest is strictly forbidden to all students. Also, our caretaker, Mr. Filch {signals to ragged old man with a cat with red eyes} has asked me to remind you that the 3rd floor corridor on the right hand side is out of bounds to everyone who does not wish to die a most painful death. Thank you.\n\nMcGonagall: When I call your name, you will come forth, I shall place the sorting hat on your head, and you will be sorted into your houses. Hermione Granger.\n\nHermione: Oh, no. Okay, relax. {She goes up}\n\nRon: Mental that one, I'm telling you.\n\nHarry nods in agreement.\n\nSorting Hat: Ah, right then...hmm...right. Okay...Gryffindor!!\n\n(Cheering)\n\n¬†\n\nHermione jumps off with a smile.\n\n¬†\n\nMcGonagall: Draco Malfoy.\n\n¬†\n\nDraco saunters up proudly. The tattered hat nearly freaks before touching down on Dracos head.\n\n¬†\n\nSorting Hat: SLYTHERIN!\n\n¬†\n\nRon: There isn't a witch or wizard who went bad who wasnt in Slytherin.\n\nMcGonagall: Susan Bones.\n\n¬†\n\nA small, redhead goes up.\n\nHarry looks around and spots a black haired, pale teacher, SEVERUS SNAPE, looking at him. His scar hurts.\n\n¬†\n\nHarry: Ahh! {puts hand on forehead}\n\nRon: Harry, what is it?\n\nHarry: Nothing...it's nothing, I'm fine.\n\n¬†\n\nSorting Hat: Let's see...I know...Hufflepuff!\n\nMcGonagall: Ronald Weasley.\n\n¬†\n\nRon gulps and walks up. He sits down and the hat is put on.\n\n¬†\n\nSorting Hat: Ah! Another Weasley. I know just where to put you...Gryffindor!!\n\nRon: {Sighs}\n\n(Cheering)\n\n¬†\n\nMcGonagall: Harry Potter.\n\n¬†\n\nEverything goes silent. Harry walks up and sits down.\n\n¬†\n\nSorting Hat: Hmm...difficult, very difficult. Plenty of courage I see, not a bad mind, either. There's talent, oh yes, and a thirst to prove yourself. But where to put you?\n\nHarry: {whispers} Not Slytherin. Not Slytherin.\n\nSorting Hat: Not Slytherin, eh? Are you sure? You could be great, you know. Its all here in your head. And Slytherin will help you on your way to greatness! There's no doubt about that! No? {Harry whispers: Not Slytherin...anything but Slytherin} Well, if youre sure...better be...GRYFFINDOR!!\n\n¬†\n\nThere is an immense cheering and Harry goes to the Gryffindor table.\n\nFred and George are also there, and cheer: We got Potter! We got Potter! Harry sits down.\n\n¬†\n\nMcGonagall: {dings on a cup} Your attention, please.\n\nDumbledore: Let the feast...begin.\n\n¬†\n\nFood magically appears on all the tables, and the hall is filled with awe and chatter.\n\n¬†\n\nHarry: Wow.\n\n¬†\n\nDraco looks at all the food, raises his eyebrows and digs in.\n\nRon stuffs his face.\n\n¬†\n\nSEAMUS FINNIGAN, a tiny boy, speaks.\n\n¬†\n\nSeamus: I'm half and half. Me dad's a Muggle. Mam's a witch. Bit of a nasty shock for him when he found out.\n\nNeville laughs.\n\n¬†\n\nHarry is sitting next to Percy. He leans over.\n\n¬†\n\nHarry: Say, Percy, who's that teacher talking to Professor Quirrell?\n\nPercy: Oh, that's Professor Snape, head of Slytherin house.\n\nHarry: What's he teach?\n\nPercy: Potions. But everyone knows it's the Dark Arts he fancies. He's been after Quirrells job for years.\n\n¬†\n\nRon, having just finished a chicken wing, reaches into the bowl for more, and a ghostly head, SIR NICHOLAS, pops out.\n\n¬†\n\nRon: Ahh!\n\nNick: Hello! How are you? Welcome to Gryffindor.\n\n¬†\n\nNumerous ghosts come pouring from the walls, sailing along.\n\n¬†\n\nHufflepuff ghost: Whoo-hoo-hoo!\n\nGirl: Look, its the Bloody Baron!\n\nPercy: Hello, Sir Nicholas. Have a nice summer?\n\nNick: Dismal. Once again, my request to join the headless hunt has been denied. {Begins to leave}\n\nRon: Hey, I know you! You're Nearly Headless Nick!\n\nNick: I prefer Sir Nicholas if you don't mind.\n\nHermione: Nearly headless? How can you be nearly headless?\n\nNick: Like this. {Grabs head and pulls it to the side. His head is hanging on just by a thread.}\n\nRon: Ahh!\n\nHermione: Eugh.\n\n¬†\n\nScene:\n\nPercy is leading the Gryffindors to the staircases.\n\n¬†\n\nPercy: Gryffindors, follow me please. Keep up. Thank you.\n\nBoy: Ravenclaw, follow me. This way.\n\nPercy: This is the most direct path to the dormitories. Oh, and keep an eye on the staircases...they like to change.\n\n¬†\n\nThe camera pans up and we see a vast amount of staircases, people walking on them, and some switching places.\n\n¬†\n\nPercy: Keep up, please, and follow me. Quickly now, come on. Come on. {They begin walking up the stairs}\n\nNeville: Seamus, that picture's moving!\n\nRon: Look at that one, Harry!\n\nHarry: I think she fancies you.\n\nGirl: Oh, look! Look! Who's that girl?\n\nMan in painting: Welcome to Hogwarts.\n\nGirl: Who's that?\n\n¬†\n\nScene:\n\nApproaching the Gryffindor dorms. They come up to a large painting of a large woman in a pink dress.\n\n¬†\n\nWoman: Password?\nPercy: Caput Draconis. {The woman nods and the painting opens to reveal a gape in the wall.} Follow me, everyone. Keep up, quickly, come on.\n\nGirl: Oh, wow.\n\nPercy: {Inside common room} Gather 'round here. Welcome to the Gryffindor Common Room. Boys' dormitories, upstairs and down to your left. Girls, the same on your right. You'll find that your belongings have already been brought up.\n\n¬†\n\nScene: Mid-night. Harry is sitting by a window in his pj's, with his owl, Hedwig. He pets the owl and looks out the window, sighing with content.\n\n¬†\n\n\n¬†\nScene: Morning. Harry and Ron are running through the stone halls to their class. They rush in. In the class, a tabby cat is sitting on a desk.\n\n¬†\n\nRon: Whew, amazing, can you imagine the look on old McGonagall's face if we were late?\n\n¬†\n\nThe cat jumps off the desk and turns into Professor McGonagall. The two boys are amazed.\n\n¬†\n\nRon: That was bloody brilliant.\n\nMcGonagall: Thank you for that assessment, Mr. Weasley. Maybe if I were to transfigure Mr. Potter and yourself into a pocketwatch, maybe one of you would be on time.\n\nHarry: We got lost.\n\nMcGonagall: Then perhaps a map? I trust you don't need one to find your seats.\n\n¬†\n\nScene: Snape's potions class. The students are chattering, sitting near steaming cauldrons. The door slams open and Snape comes rushing in.\n\n¬†\n\nSnape: There will be no foolish wand waving or silly incantations in this class. As such, I don't expect many of you to enjoy the subtle science and exact art that is potion making. However, for those select few {looks at Draco, who smiles}, who possess the predisposition, I can teach you how to bewitch the mind and ensnare the senses. I can tell you how to bottle fame, brew glory and even put a stopper {Draco looks on} in death. {Draco raises his eyebrows.} {Snape sees Harry, writing this down, in, his view, not paying attention.} Then again, maybe some of you have come to Hogwarts in possession of abilities so formidable that you feel confidant enough to not...pay...attention.\n\n¬†\n\nHermione nudges Harry in the ribs. He looks up.\n\n¬†\n\nSnape: Mr. Potter. Our...new...celebrity. Tell me, what would I get if I added powdered root of asphodel to an infusion of wormwood? {Hermione's hand skyrockets. Harry shrugs.} You don't know? Well, let's try again. Where, Mr. Potter, would you look if I asked you to find me a bezoar? {Hermione's hand shoots up again.}\n\nHarry: I don't know, Sir.\n\nSnape: And what is the difference between Monkshood and Wolfbane?\n\nHarry: I don't know, Sir.\n\nSnape: Pity. Clearly, fame isn't everything, is it, Mr. Potter?\n\n¬†\n\nScene: In the great hall, probably midday. The students are all working on homework.\n\n¬†\n\nSeamus is trying a spell on a cup.\n\n¬†\n\nSeamus: Eye of rabbit, harp string hum. Turn this water, into rum. {Looks in cup and shakes head.} Eye of rabbit, harp string hum...\n\nHarry: What's Seamus trying to do to that glass of water?\n\nRon: Turn it into rum. Actually managed a weak tea yesterday, before...\n\n¬†\n\nZAPOOF! The cup explodes. There is laughter amongst the students. Suddenly, a flock of owls start coming into the hall from the rafters above.\n\n¬†\n\nRon: Ah. Mail's here!\n\n¬†\n\nThe owls soar by, dropping parcels to students. Harry gets nothing. He sees the newspaper Ron has put down.\n\n¬†\n\nHarry: Can I borrow this? {Ron nods} Thanks.\n\n¬†\n\nNeville is unwrapping a gift. It is a clear ball with gold around it.\n\n¬†\n\nSeamus: Hey, look! Neville's got a Remembrall!\n\nHermione: I've read about those. When the smoke turns red {the smoke turns red}, it means you've forgotten something.\n\nNeville: The only problem is, I can't remember what I've forgotten.\n\nHarry: Hey, Ron, somebody broke into Gringotts. Listen, Believed to be the work of dark witches or wizards unknown, Gringotts goblins, while acknowledging the breach, insist that nothing was taken. The vault in question, number 713, had in fact been emptied earlier that same day. That's odd. That's the vault Hagrid and I went to.\n\n¬†\n\nScene: Outside, flying practice. The students, Gryffindor and Slytherin, are lined up in two rows with brooms by their sides. The teacher, MADAM HOOCH, comes down the line. She has short hair and hawk yellow eyes.\n\n¬†\n\nHooch: Good afternoon, class.\n\nClass: Good afternoon, Madam Hooch.\n\nHooch: Good afternoon, Amanda, good afternoon. {to class} Welcome to your first flying lesson. Well, what are you waiting for? Everyone step up to the left side of their broomstick. Come on now, hurry up. Stick your right hand over the broom and say, Up!\n\nClass: Up!\n\n¬†\n\nHarry's broom flies into his hand.\n\n¬†\n\nHarry: Whoa. {Hermione stares as the class continues.}\n\nDraco: Up! {broomstick flies up and Draco smugly grins.}\n\nHooch: With feeling!\n\nHermione: Up. Up. Up. Up.\n\nRon: Up!! {His broom flies up and conks him on the nose} Ow! {Harry laughs} Shut up, Harry. {laughs}\n\nHooch: Now, once you've got hold of your broom, I want you to mount it. And grip it tight, you don't want to be sliding off the end. {Class mounts} When I blow my whistle, I want each of you to kick off from the ground, hard. Keep your broom steady, hover for a moment, and then lean forward slightly and touch back down. On my whistle...3...2...{tweet!}\n\n¬†\n\nNeville immediately lifts off. He looks quite frightened.\n\n¬†\n\nNeville: Oh...\n\nHooch: Mr. Longbottom.\n\nGirl: Neville, what are you doing?\n\nStudents: Neville...Neville...\n\nBoy: We're not supposed to take off, yet.\n\nHooch: {Neville begins soaring away} M-M-Mr. Longbottom Mr. Longbottom!\n\nNeville: AHH!\nHooch: Mr. Longbottom!\n\nNeville: {soars away} Down! Down! Ahhhh!\n\nHarry: Neville! {shouting}\n\nNeville: Help!!!\n\nHooch: Come back down this instant!\n\nNeville: AHH!\n\n¬†\n\nHe soars through the sky and hits a wall, conking along it and then swooping off. All the while, he is screaming. He begins to zoom back towards the group of students. Hooch holds out her wand to stop him.\n\n¬†\n\nNeville: Help!\n\nHooch: Mr. Longbottom! {Neville approaches. The students scatter and Hooch dives out of the way. Neville goes through the scatter and up a tower.}\n\nNeville: Ahhhh! Whoa! Ahhh! {zooms past a statue of a man with a sharp spear. Neville's cloak catches on it. He is flipped off the broom and hangs there.} Oh. Ah...help! {He wavers, then the cloak rips, and he falls, catching on a torchbut then slipping out and falling to the ground.} Ahh!\n\nHooch: Everyone out of the way! {She runs through the group, and they scatter.} Come on, get up.\n\nGirl: Is he alright?\n\nNeville: Owowowow.\n\nHooch: Oh, oh, oh, oh dear. It's a broken wrist. Tch, tch, tch. Good boy, come on now, up you get. {Draco reaches down and grabs Neville's Remembrall, which has fallen. Hooch begins to lead Neville away with her.} Everyone's to keep their feet firmly on the ground while I take Mr. Longbottom to the hospital wing. Understand? If I see a single broom in the air, the one riding it will find themselves out of Hogwarts before they can say, Quidditch. {Exit.}\n\nDraco: {snickers} Did you see his face? Maybe if the fat lump had given this a squeeze, he'd have remembered to fall on his fat ass. {Laughs.}\n\nHarry: Give it here, Malfoy.\n\nDraco: No. I think I'll leave it somewhere for Longbottom to find. {hops on broom and soars around group, then through.} How 'bout up on the roof?? {soars off and hovers high in the sky.} What's the matter, Potter? Bit beyond your reach?\n\n¬†\n\nHarry grabs his broom and runs to get on it. Hermione stops him.\n\n¬†\n\nHermione: Harry, no! You heard what Madam Hooch said! Besides, you don't even know how to fly. {Harry flies off.} What an idiot.\n\n¬†\n\nHarry is now in the air, across from Draco.\n\n¬†\n\nHarry: Give it here, Malfoy, or I'll knock you off your broom!\n\nDraco: Is that so? {Harry makes a dash for himbut Draco twirls around his broom in a 360.} Have it your way, then! {He throws the Remembrall into the air.}\n\n¬†\n\nHarry zooms after the ball, speeding towards a tower. Just as he is about to hit a window, from which McGonagall is working/watching, he catches it, and then heads back to the group. The students all cheer and run to see him.\n\n¬†\n\nBoy: Good job, Harry!\n\nBoy 2: Oh, that was wicked, Harry.\n\nMcGonagall: {appears quickly} Harry Potter? Follow me. {Harry sullenly follows her. Draco and his goons laugh.}\n\n¬†\n\nScene: Professor Quirrells classroom. He is inside, teaching, holding an iguana.\n\n¬†\n\nQuirrell: An iguana s-such as this is {McGonagall approaches the class and stops Harry: You wait here.} an essential in-gredient\n\nMcGonagall: Excuse me, excuse me, Professor Quirrell. Could I borrow Wood for a moment?\n\nQuirrell: Oh. Y-yes, of course. {a boy, OLIVER WOOD, gets up to leave and Quirrell continues.} And the vampire b-bat...{eerie roar.}\n\nMcGonagall: Potter, this is Oliver Wood. Wood, I have found you a Seeker!\n\n¬†\n\nScene: Harry and Ron are walking through crowded halls. Sir Nicholas and a lady ghost float by.\n\n¬†\n\nNick: Have you heard? Harry Potter's the new Gryffindor Seeker. I always knew hed do well.\n\nRon: Seeker? But first years never make their house teams! You must be the youngest Quidditch player in\n\nHarry: A century, according to McGonagall.\n\n¬†\n\nFred and George approach and walk along with Ron and Harry.\n\n¬†\n\nFred: Hey, well done, Harry, Wood's just told us!\n\nRon: Fred and George are on the team, too. Beaters.\n\nGeorge: Our job is to make sure that you don't get bloodied up too bad. Can't make any promises, of course. Rough game, Quidditch.\n\nFred: Brutal. But no one's died in years. Someone will vanish occasionally... {They break off from Harry and Ron, who walk across a courtyard. ¬†\n\nGeorge: But they'll turn up in a month or two!!\n\nRon: Oh, go on, Harry, Quidditch is great. Best game there is! And you'll be great, too! {Hermione jumps up from her work and comes to join them.}\n\nHarry: But I've never even played Quidditch. What if I make a fool of myself?\n\nHermione: You won't make a fool of yourself. It's in your blood.\n\n¬†\n\nScene: The three approach a trophy case. Hermione points at a plaque of Quidditch players. One lists Harry's father as a Seeker.\n\n¬†\n\nRon: Whoa. Harry, you never told me your father was a Seeker, too.\n\nHarry: I-I didn't know.\n\n¬†\n\n\n¬†\nScene: The three are walking up a staircase. A railing pulls in...Hermione looksbut continues walking.\n\n¬†\n\nRon: I'm telling you, it's spooky. She knows more about you than you do.\n\nHarry: Who doesn't?\n\n¬†\n\nThe staircase shudders and begins to move. The three grab the railings.\n\n¬†\n\nRon: Ahh!\n\nHermione: {Gasps.}\n\nHarry: What's happening?\n\nHermione: The staircases change, remember? {The staircase stops, in a new place.}\n\nHarry: {taps Ron} Let's go this way.\n\nRon: Before the staircase moves again. {They all open a door and walk into a spooky, dark room.}\n\nHarry: Does anyone feel like...we shouldn't be here?\n\nHermione: We're not supposed to be here. This is the 3rd floor. It's forbidden.\n\n¬†\n\nSuddenly, a flame lights on a tall stone support. At that moment, the caretaker's cat, MRS. NORRIS, comes running in and meows. The group jumps.\n\n¬†\n\nHarry: Let's go.\n\n{meow}\n\nRon: It's Filch's cat!\n\nHarry: Run!\n\n¬†\n\nThe group runs. Flames are lit as they go. They get to the end of the corridor, to a door. Harry grabs the handlebut it's locked.\n\n¬†\n\nHarry: It's locked!\n\nRon: That's it, we're done for!\n\nHermione: Oh, move over! {pushes through and pulls out wand} Alohomora. {The door opens.} Get in. {They bustle in.}\n\nRon: Alohomora?\n\nHermione: Standard book of spells, Chapter 7.\n\n¬†\n\nFilch appears at the start of the corridor with a light. Mrs. Norris looks at him.\n\n¬†\n\nFilch: Anyone here, my sweet? {meow} Come on. {exit.}\n\nHermione: Filch is gone.\n\nRon: Probably thinks this door's locked.\n\nHermione: It was locked.\n\nHarry: And for good reason. {Ron and Hermione turn to stand with Harry. There is a massively huge three headed dog sleeping in front of them. The dog, FLUFFY, begins to wake. It growls, yawns, and growls more...noticing the intruders.}\n\nAll: AHHHHHHH! {The three bolt, running out of the door. They turn quickly to shut the door and battle against the dog. They get the door shut and run.}\n\n¬†\n\nScene:\n\nBack in the Gryffindor room. They are breathless.\n\n¬†\n\nRon: What do they think they're doing?? Keeping a thing like that locked up in a school.\n\nHermione: You don't use your eyes, do you? Didn't you see what it was standing on?\n\nRon: I wasn't looking at its feet! I was a bit preoccupied with its heads. Or maybe you didn't notice, there were three! {they begin to climb the stairs to the dorms.}\n\nHermione: It was standing on a trap door. Which means it wasn't there by accident. It's guarding something.\n\nHarry: Guarding something?\n\nHermione: That's right. Now, if you two don't mind, I'm going to bed before either of you come up with another clever idea to get us killed...or worse, expelled! {turns and leaves, shutting the door to her dorms.}\n\nRon: She needs to sort out her priorities!\n\nHarry nods.\n\n¬†\n\nScene: Outside, day time. Oliver and Harry appear, carrying a trunk. They put it down.\n\n¬†\n\nOliver: Quidditch is easy enough to understand. Each time has seven players, 3 chasers, 2 beaters, 1 keeper and a seeker that's you. There are three kinds of balls. {picks up a red one} This one's called the Quaffle. Now, the chasers handle the Quaffle and try to put it through one of those three hoops. {Points to a faraway Quidditch pitch.} The keeper, that's me, defends the hoops. {throws ball to Harry.} With me so far?\n\nHarry: {throws back} I think so. What are those? {points to two squirming chained down balls.}\n\nOliver: ...You better take this. {hands Harry a small bat. He bends down and releases one ball. With an angry growl, it flies off into the air. The two boys watch it.} Careful now, it's comin' back. {The balls comes whizzing down, and Harry cracks at it with the bat. The ball soars off through a statue.} Eh, not bad, Potter, you'd make a fair beater...Uh-oh. {The ball zooms down, and Oliver grabs it, wriggling to get it back in the box. He succeeds and is out of breath.} Bludger. Nasty little buggers. But the only ball I want you to worry about is this...the Golden Snitch. {hands Harry a walnut sized golden ball.}\n\nHarry: I like this ball.\n\nOliver: Ah, you like it now. Just wait. It's wicked fast and damn near impossible to see.\n\nHarry: What do I do with it?\n\nOliver: You catch it...before the other team's seeker. You catch this, the game is over. You catch this, Potter, and we win.\n\n{The ball flutters out two delicate wings and jumps into the air. Harry keeps an eye on it.}\n\nHarry: Whoa.\n\n¬†\n\nScene: PROFESSOR FLITWICK's class. The teacher is very short, and is standing on a bunch of books.\n\n¬†\n\nFlitwick: One of a wizard's most rudimentary skills is levitation the ability to make objects fly. Uh, do you all have your feathers? {Hermione raises hers.} Good. Now, uh, don't forget the nice wrist movement we've been practicing, hmm? The swish and flick. Everyone. {All} The swish and flick. Good. And enunciate. Wingardium Leviosa. Off you go then.\n\nDraco: Wingardium Levio-saaa.\n\n{All practice.}\n\nRon: Wingardrium Leviosar. {whacks with wand numerous times.}\n\nHermione: Stop, stop, stop. You're going to take someone's eye out. Besides, youre saying it wrong. It's Leviosa, not Leviosar.\n\nRon: You do it then if you're so clever. Go on, go on.\n\n¬†\n\nHermione straightens up and swishes her wand.\n\n¬†\n\nHermione: {crisply} Wingardium Leviosa. {The feather glows and lifts up. Ron puts his head on his books dejectedly.}\n\nFlitwick: Oh, well done! See here, everyone! Ms. Granger's done it! Oh, splendid!\n\n¬†\n\nSeamus begins swishing at his feather.\n\n¬†\n\nSeamus: Wingard Levosa. Wingard Levosa. {Flitwick to Hermione: Well done, dear.}\n\n¬†\n\nBOOOM!!! Seamus' feather explodes. Flitwick gasps.\n\n¬†\n\nFlitwick: Whooaaa! Ooh.\n\nHarry: I think we're going to need another feather over here, Professor.\n\n¬†\n\nScene: Neville, Harry, Ron and Seamus are walking through a courtyard with other students all around.\n\n¬†\n\nRon: It's Leviosa, not Leviosar. Honestly, she's a nightmare. No wonder she hasn't got any friends!\n\n¬†\n\nHermione bustles past, sniffling.\n\n¬†\n\nHarry: I think she heard you.\n\n¬†\n\nScene: Night, in the great hall. It is Halloween. Everyone is eating candy, and Jack O'Lanterns are keeping the place lit. There is chatter.\n\n¬†\n\nHarry: Where's Hermione?\n\nNeville: Parvati Patil said that she wouldn't come out of the girl's bathroom. She said that she'd been in there all afternoon...crying.\n\n{Ron and Harry exchange glances. Suddenly, Professor Quirrell comes flying into the room, screaming.}\n\nQuirrell: TROLL! IN THE DUNGEON! T-TROOLLL IN THE DUNGEON!! {stops and there is utter silence.} Thought you ought to know. {falls over in a dead faint.}\n\n¬†\n\nThe room is silent, and then everyone freaks, screaming and running.\n\n¬†\n\nDumbledore: SILLLLLEEENNNNCEEEEE! {Everyone stops.} Everyone will please, not panic. Now, Prefects will lead their houses back to the dormitories. Teachers will follow me to the dungeons.\n\nGirl: Hufflepuff, this way!\n\nBoy: Stay together!\n\n¬†\n\nSnape looks aghast, and he disappears through a doorway.\n\n¬†\n\nScene: Percy is leading the house down a hall.\n\n¬†\n\nPercy: Gryffindors...keep up please. And stay alert!\n\nHarry: How could a troll get in?\n\nRon: Not by itself. Trolls are really stupid. Probably people playing jokes. {Suddenly, Harry stops and pulls Ron aside.} What?\n\nHarry: Hermione! She doesn't know!\n\n¬†\n\nThe two run off, down corridors. They start running down a hall when they stop, because there is a grunting noise. Harry pulls Ron into a doorway and a large, ugly TROLL thunks by into a room.\n\n¬†\n\nHarry: He's going into the Girl's Bathroom!\n\n¬†\n\nScene: In the bathroom, Hermione emerges from a stall, wiping her eyes. She stops when she sees something. The troll is standing there. Hermione backs up, into the stall just as the troll raises its club and smashes the top part of the stalls. Hermione screams. Harry and Ron come bursting in.\n\n¬†\n\nHarry: Hermione, move!\n\n¬†\n\nThe troll smashes the remaining stalls.\n\n¬†\n\nHermione: Help! Help! {The boys start throwing wood pieces at the troll.}\n\nRon: Hey, pea brain! {Ron throws wood and hits the troll on the head. Hermione escapes from the stalls to under a sinkbut the troll sees her and goes to smash her. It cracks the sink and barely misses Hermione. Harry cringes.}\n\nHermione: Ahhh! Help!\n\n¬†\n\nHarry gets out his wand. He runs forward and grabs the troll's club, and is lifted up.\n\n¬†\n\nHarry: Whooa! Whoa, whoa! {He lands on the troll's head, and is hurled forward, then back, and his wand goes up the troll's nose.}\n\nRon: Ew.\n\n¬†\n\nThe troll snorts, and whips around.\n\n¬†\n\nHarry: Whoa, whoa whoa!\n\n¬†\n\nThe troll gets Harry off its head and is holding him by one leg, upside down. It gears up its club and swipes at Harry. He pulls himself up, then down. The troll swipes again.\n\n¬†\n\nHarry: Do something! {swipe}\n\nRon: What? {swipe}\n\nHarry: Anything! Hurry up!\n\n¬†\n\nRon grabs his wand. Under the sink, Hermione waves her hand.\n\n¬†\n\nHermione: Swish and flick!\n\nRon: Wingardium Leviosa! {flick. The club is lifted out of the troll's hand and hovers above its head. The troll looks up, confused, just as the club comes crashing back down. (Ron: Cool.) ¬†It hits the troll's head and the troll wavers, then drops Harry, who crawls away, and comes crashing down, hard.\n\n¬†\n\nHermione approaches carefully.\n\n¬†\n\nHermione: Is it...dead?\n\nHarry: I don't think so. Just knocked out. {He grabs his wand...which is covered in goo.} Ew. Troll bogies.\n\n¬†\n\nSuddenly, McGonagall, Snape and Quirrell come rushing in.\n\nThey all gasp.\n\n¬†\n\nMcGonagall: Oh! Oh, my goodness! E-Explain yourselves, both of you!\n\nRon and Harry: Well, what it is...\n\nHermione: It's my fault, Professor McGonagall. {The teachers, and Ron and Harry, gape}\n\nMcGonagall: Ms. Granger?\n\nHermione: I went looking for the troll. I'd read about them and thought I could handle it. But I was wrong. If Harry and Ron hadn't come and found me...I'd probably be dead.\n\nMcGonagall: Be that as it may...it was an extremely foolish thing to do. {Harry looks at Snape's leg...which has a large cut on it. Snape notices and covers it up, glaring at Harry.} I would have expected more rational behaviour on your part, Ms. Granger. 5 points will be taken from Gryffindor for your serious lack of judgment. As for you two gentlemen I just hope you realize how fortunate you are. Not many students could take on a full grown mountain troll and live to tell the tale. 5 points...will be awarded to each of you. For sheer dumb luck. {Snape and McGonagall exit.}\n\nQuirrell: Perhaps you ought to go...M-might wake up...heh. {Exit Ron and Harry and Hermione.} {Troll roars.} Ahh! Hehe....\n\n¬†\n\nScene: The next morning, in the great hall. The gang is sitting, eating. Harry is twirling his food on a fork.\n\n¬†\n\nRon: Take a bit of toast, mate, go on.\n\nHermione: Ron's right, Harry. You're gonna need your strength today.\n\nHarry: I'm not hungry.\n\n¬†\n\nSnape appears.\n\n¬†\n\nSnape: Good luck today, Potter. Then again, now that you've proven yourself against a troll, a little game of Quidditch should be easy work for you...even if it is against Slytherin. {Leaves, limping.}\n\nHarry: That explains the blood.\n\nHermione: Blood?\n\nHarry: Listen, last night, I'm guessing Snape let the troll in as a diversion so he could try and get past that 3 headed dog. But, he got himself bitten, that's why he's limping.\n\nHermione: But why would anyone go near that dog?\n\nHarry: The day I was at Gringotts, Hagrid took something out of one of the vaults. He said it was Hogwarts' business, very secret.\n\nHermione: So you're saying...\n\nHarry: That's what the dog's guarding. That's what Snape wants.\n\n{An owl screeches. It is Hedwig. She is carrying a very large, long parcel. She drops it off.}\n\nHermione: Bit early for mail, isn't it?\n\nHarry: But I-I never get mail.\n\nRon: Let's open it.\n\n{They open it.}\n\nHarry: It's a broomstick!\nRon: Thats not just any broomstick, Harry. It's a Nimbus 2000!\n\nHarry: But who...?\n\n{He sees Professor McGonagall up at the head table, stroking Hedwig. She smiles and Harry nods.}\n\n¬†\n\nScene: Inside a Quidditch tower. The Gryffindor team is marching towards the starting gate. They reach it and stop, behind a closed double door.\n\n¬†\n\nOIiver: Scared, Harry?\n\nHarry: A little bit.\n\nOliver: That's all right. I felt the same way before my first game.\n\nHarry: What happened?\nOliver: Er, I don't really remember. I took a bludger to the head 2 minutes in. Woke up in the hospital a week later.\n\n¬†\n\nHarry gulps and looks straight ahead as the doors open. They mount their brooms and zoom out onto the enormous pitch. There is cheering. The commentator, LEE JORDAN, is talking from a tower.\n\n¬†\n\nLee: Hello, and welcome to Hogwarts' first Quidditch game of the season! Today's game Slytherin versus Gryffindor!!!\n\n¬†\n\n{Cheering. Close-up of Gryffindor students. They are cheering. Neville: Gryffindor!}\n\n¬†\n\nThe players take their positions in the air in a circle. Harry weaves in, highest amongst. He looks down.\n\n¬†\n\nLee: The players take their positions as Madam Hooch steps out onto the field to begin the game.\n\nHooch: Now, I want a nice clean game...from all of you. {looks at Slytherin. She kicks the trunk, and the bludgers zoom out.}\n\nLee: The bludgers are up...followed by the Golden Snitch. Remember, the snitch is worth 150 points. The seeker who catches the Snitch ends the game.\n\n¬†\n\nThe snitch zooms around each Seeker's head, then disappears. Hooch grabs the Quaffle.\n\n¬†\n\nLee: The Quaffle is released...and the game begins!\n\n¬†\n\nGryffindor takes possession of the ball and a chaser, ANGELINA JOHNSON, zooms past Slytherins towards their goal, and throws the ball, and scores! There is a ding.\n\n¬†\n\nLee: Angelina Johnson scores! 10 points for Gryffindor! {He presses a button and a 10 shows up beside a plaque with Gryffindors name.}\n\n¬†\n\nHarry, in the air, claps.\n\n¬†\n\nHarry: Yes! {a bludger zooms by him.} Whoa!\n\n¬†\n\nIn the stands, Gryffindor cheers.\n\n¬†\n\nHagrid: Well done!\n\nLee: Slytherin takes possession of the Quaffle. Bletchley passes to Captain Marcus Flint.\n\n¬†\n\nFlint dodges people and throws for the Gryffindor hoops. Oliver appears and whacks the ball away with his broom. He smirks at Flint, who glares. Johnson and KATIE BELL pass the Quaffle back and forth as they strategize to score. Johnson takes it, throws, and once again scores!\n\n¬†\n\nRon and Seamus: Yay!\n\nHarry: Yes!\n\nLee: Another 10 points to Gryffindor! {ding.}\n\nGryffindors: Yay!\n\n¬†\n\nThe Slytherins decide to get messy. They dodge, kick, and try to score. Once again, Oliver blocks.\n\n¬†\n\nFlint: Give me that! {he grabs a beaters bat from one and whacks a bludger right at Oliver. It hits Oliver in the stomach and he falls to the ground.}\n\n¬†\n\nCrowd: {Booing}\n\nHarry is visibly upset.\n\nSlytherin laughs.\n\n¬†\n\nThe Slytherin members head off. One jumps over George (or Fred) and scores. Harry is upset again. Slytherin cheers.\n\n¬†\n\nFlint: {to other members} Take that side!\n\n¬†\n\nThey box Johnson in and sent her into the capes covering one of the towers. She falls down in and is out. The crowd boos. Slytherin scores once again. Suddenly, Harry sees the Snitch. He starts to head off after it and then his broom starts bucking and turning.\n\n¬†\n\nHarry: Whoa! Whooa!\n\nHagrid: What's going on with Harry's broomstick?\n\n¬†\n\nHermione looks through binoculars at Harry, then at Snape, who is muttering something.\n\n¬†\n\nHermione: It's Snape! He's jinxing the broom!\n\nRon: Jinxing the broom? What do we do?\n\nHermione: Leave it to me. {She hands Ron her binoculars and leaves.}\n\n¬†\n\nHarry is knocked around, then falls, dangling by one arm from the broom.\n\n¬†\n\nRon: Come on, Hermione!\n\n¬†\n\nHermione is hurrying up a tower. She appears underneath Snape and touches his cloak with her wand.\n\n¬†\n\nHermione: Lacarnum Inflamarae.\n\n¬†\n\nA spark ignites and Snape's cloak catches fire. Hermione leaves.\n\n¬†\n\nMan: Fire! You're on fire!\n\nSnape: What? Oh! {knocks the man back, who falls into Quirrell, who then also falls. Snape bats out the fire and acts as though nothing happened. The broom stop bucking, and Harry climbs back on. The Slytherin seeker is after the Snitch. Harry takes off.}\n\n¬†\n\nRon: Go!\n\nHagrid: Go go go!\n\n¬†\n\nHarry rams the Slytherin Seeker, then is butted out. He returns, smashing the Seeker again as the Snitch dives. The boys followbut they approach the ground quickly. The Slytherin Seeker backs out, and Harry pulls up his broom as he follows the Snitch, feet above the ground. Harry stands up, and steps forward, trying to grab the ball. He goes too far, and topples off the broom with a yelp, tumbling on the ground. He gets up and lurches.\n\n¬†\n\nThe crowd gasps. Hermione appears beside a tower to see.\n\n¬†\n\nHagrid: Looks like he's gonna be sick!\n\n¬†\n\nHarry lurches and the Snitch pops out of his mouth. It lands in his hands.\n\n¬†\n\nLee: He's got the Snitch! Harry Potter receives 150 points for catching the Snitch!\n\nHooch: {Blows whistle} Gryffindor win!\n\nAll: YAY!\n\nDraco: No!\n\nHagrid: Yes!\n\nHermione: Whoo-hoo!\n\nMcGonagall: {Giggles happily}\n\n¬†\n\nHarry raises the Snitch into the air and the crowd, and his team, cheers.\n\n¬†\n\nCrowd: Go go Gryffindor! Go go Gryffindor! Go go Gryffindor! Go go Gryffindor!\n\n¬†\n\n\n¬†\n\nScene:\nHarry, Hermione and Ron are walking along a path with Hagrid, talking.\n\n¬†\n\nHagrid: Nonsense. Why would Snape put a curse on Harry's broom?\n\nHarry: Who knows. Why was he trying to get past that 3 headed dog on Halloween?\n\nHagrid: Who told you 'bout Fluffy?\n\nRon: Fluffy?\nHermione: That thing has a name?\n\nHagrid: Well, of course he's got a name. He's mine. I bought him off an Irish feller I met down at the pub last year. Then I lent him to Dumbledore to guard the\n\nHarry: Yes?\n\nHagrid: Shouldn'ta said that. Don't ask any more questions. That's top secret, that is.\n\nHarry: But Hagrid, whatever Fluffy's guarding, Snape's trying to steal it!\n\nHagrid: Codswallop. Professor Snape is a Hogwarts teacher.\n\nHermione: Hogwarts teacher or not, I know a curse when I see one. I've read all about them. You have to keep eye contact. And Snape wasn't blinking.\n\nHarry: Exactly.\n\nHagrid: {sighs} Now, you listen to me, all three of you. You're meddlin' in things that ought not to be meddled in. It's dangerous. What that dog is guarding is strictly between Professor Dumbledore and Nicholas Flamel.\n\nHarry: Nicholas Flamel?\n\nHagrid: I shouldn't have said that. I should not have said that. I should not have said that. {Exit.}\n\nHarry: Nicholas Flamel...Who's Nicholas Flamel?\n\nHermione: I don't know.\n\n¬†\n\nScene: Christmas. The camera pans up to a snowy castle, then to Hagrid, who is bringing in a large tree. Inside the great hall, students are leaving and ghosts are singing (Merry Christmas, Merry Christmas, ring the Hogwarts bell. Merry Christmas, Merry Christmas...) Hermione approaches the empty tables, wheeling a cart. She goes to Ron and Harry, who are playing chess.\n\n¬†\n\nHarry: Knight to E-5.\n\n¬†\n\nA piece moves across the board.\n\n¬†\n\nRon thinks for a moment.\n\n¬†\n\nRon: Queen to E-5.\n\n¬†\n\nA queen walks over to E-5 and clinks the knight away.\n\n¬†\n\nHermione: That's totally barbaric!\n\nRon: That's wizard's chess. I see you've packed.\n\nHermione: See you haven't.\n\nRon: Change of plans. My parents decided to go to Romania to visit my brother, Charlie. He's studying dragons there!\n\nHermione: Good. You can help Harry, then. He's going to go the library for information on Nicholas Flamel.\n\nRon: We've looked a hundred times!\n\nHermione: Not in the restricted section...Happy Christmas. {exits.}\n\nRon: I think we've had a bad influence on her.\n\n¬†\n\nScene:\n\nX-mas morning. Hedwig is perched in the boys' room, and Harry is asleep in bed.\n\n¬†\n\nRon: {calling from downstairs} Harry, wake up! Come on Harry, wake up!\n\n¬†\n\nHarry gets up and runs to a balcony overlooking the common room, where Ron is standing next to a tree. He is wearing a sweater with an R on it.\n\n¬†\n\nRon: Happy Christmas, Harry.\n\nHarry: Happy Christmas, Ron. What are you wearing?\n\nRon: Oh, Mum made it for me. Looks like you've got one too!\n\nHarry: I've got presents?\n\nRon: Yeah!\n\nHarry: Oh! {Harry runs down the stairs.}\n\nRon: There they are. {Ron sits on a couch arm and eats jelly beans as Harry picks up a silver wrapped package. Harry takes out the card.}\n\nHarry: \"Your father left this in my possession before he died. It is time it was returned to you. Use it well.\"\n\n¬†\n\nHarry opens the present. It is a cloak.\n\n¬†\n\nRon: What is it?\n\nHarry: Some kind of...cloak.\n\nRon: Well, let's see then. Put it on.\n\n¬†\n\nHarry puts the cloak on, and all of him disappears except for his head.\n\n¬†\n\nRon: Whoa!\n\nHarry: My body's gone!\n\nRon: I know what that is! That's an invisibility cloak!\n\nHarry: I'm invisible??\n\nRon: {gets up} They're really rare. I wonder who gave it to you.\n\nHarry: {comes over} There was no name. It just said, \"Use it well.\"\n\n¬†\n\nScene:\n\nLate at night. A lantern and hand appearbut nothing else. The ensemble walk through the dark library and into the Restricted Section. The lamp is put down, and the cloak removed. Harry appears.\n\n¬†\n\nHarry: {Reading books} Famous fire eaters...15th Century Fiends...Flamel...Nicholas Flamel...where are you?\n\n¬†\n\nHarry picks up a book and opens it. A man's face appears.\n\n¬†\n\nMan: AHHHHHHHHHHHHHHHH!!!!!!!!\n\n¬†\n\nHarry slams the book shuts and puts it back.\n\n¬†\n\nFilchs voice: Who's there?! {Harry whips around, grabbing his cloak. The lamp falls and shatters.} I know you're in there. You can't hide. {Harry puts on his cloak and creeps around Filch.} Who is it? Show yourself!\n\n¬†\n\nHarry runs from the room, breathing heavily. He gets into the hall, where Mrs. Norris is. The cat meows and begins to follow him. Harry runs around a corner, just as Snape and Quirrell appear. Snape pushes Quirrell into the wall.\n\n¬†\n\nQuirrell: Severus...I-I thought...\n\nSnape: You don't want me as your enemy, Quirrell.\n\nQuirrell: W-what do you m-mean?\n\nSnape: You know perfectly well what I mean. {Snape senses something. Harry stops breathing. Snape reaches out to grab somethingbut doesn't. He whips his finger back in front of Quirrell's face.} We'll have another chat soon...when you've had time to decide where your loyalties lie.\n\n¬†\n\nFilch appears, carrying the broken lamp.\n\n¬†\n\nFilch: Oh, Professors. I found this, in the Restricted Section. It's still hot. That means there's a student out of bed.\n\n¬†\n\nThey all dart off. A door opens, and closes. On the other side, there is a vast, empty room that has a large mirror in the center. Harry appears and walks over to the mirror. In it, he sees two people appear.\n\n¬†\n\nHarry: Mum? {the woman nods and smiles} Dad? {nods and smiles. Harry reaches out to touch thembut only gets the mirror. Then, his mother puts her hand on his shoulder. He puts his own hand on his own shoulders, as if trying to feel her there.\n\n¬†\n\nScene:\n\nThe boys' room. Harry comes whipping in, invisible.\n\n¬†\n\nHarry: Ron! You've really got to see this! Ron! You've got to see this! {pulls back covers. Ron wakes up.} Ron, Ron, come on. Get out of bed!\n\nRon: Why?\n\nHarry: There's something you've got to see. Now, come on!\n\n¬†\n\nScene:\n\nBack in the mirror room. Harry and Ron appear as if magically and Harry runs to the mirror.\n\n¬†\n\nHarry: Come on. Come. Come look, it's my parents!\n\nRon: I only see me.\n\nHarry: {moves over} Look in properly. Go on. Stand there. There. You see them, don't you? Thats my dad\n\nRon: That's me! Only, I'm head boy...and I'm holding the Quidditch cup! And bloody hell, I'm Quidditch Captain too! I look good. Harry, do you think this mirror shows the future?\n\nHarry: How can it? Both my parents are dead. {Harry smiles sadly.}\n\n¬†\n\nScene:\n\nAnother night. Harry is sitting in front of the mirror. Dumbledore appears behind him.\n\n¬†\n\nDumbledore: Back again, Harry? {Harry turns around and stands up.} I see that you, like so many before you, have discovered the delights of the Mirror of Erised. I trust by now you realize what it does. Let me give you a clue. The happiest man on earth would look into the mirror and see only himself, exactly as he is.\n\nHarry: So, then it shows us what we want? Whatever we want?\n\nDumbledore: Yes...and no. It shows us nothing more or less than the deepest, most desperate desires of our hearts. Now you, who have never known your family, you see them standing beside you. But remember this, Harry. This mirror gives us neither knowledge or truth. Men have wasted away in front of it, even gone mad. That is why tomorrow it will be moved to a new home, and I must ask you not to go looking for it again. It does not do to dwell on dreams, Harry, and forget to live. {Harry looks back at the mirror.}\n\n¬†\n\nScene:\n\nDaytime. It is all snowy. Harry is out in a main courtyard, bundled up, with Hedwig on his arm. He stops and she lifts off, soaring away into the sky. When she returns, it is spring time.\n\n¬†\n\nScene:\n\nIn the library. Harry and Ron are seated, reading. Hermione comes up with a huge book. She thumps it onto the table. Harry jumps.\n\n¬†\n\nHermione: I had you looking in the wrong section! How could I be so stupid? I checked this out a few weeks ago for a bit of light reading.\n\nRon: This is light?\n\nHermione: {glares} Of course! Here it is! \"Nicholas Flamel is the only known maker of the Philosopher's Stone!\"\n\nRon and Harry: The what?\n\nHermione: Honestly, don't you two read? \"The Philosopher's Stone is a legendary substance with astonishing powers. It will turn any metal into pure gold and produces the Elixir of Life, which will make the drinker immortal.\"\n\nRon: Immortal?\n\nHermione: It means you'll never die.\n\nRon: I know what it means!\n\nHarry: Shh!\n\nHermione: \"The only stone currently in existence belongs to Mr. Nicholas Flamel, the noted alchemist, who last year celebrated his 665th birthday!\" That's what Fluffy's guarding on the 3rd floor. That's what's under the trapdoor...the Philosopher's Stone!\n\n¬†\n\nThey all look at each other.\n\n¬†\n\nScene:\n\nNighttime. Hermione, Ron and Harry are running across the wet ground to Hagrids hut. They knock on the door and it opens.\n\n¬†\n\nHarry: Hagrid!\n\nHagrid: {clad in oven mitts and an apron} Oh, hello. Sorry, don't wish to be rudebut I'm in no fit state to entertain today. {Closes door.}\n\nAll 3: We know about the Philosopher's Stone!\n\n{Door reopens.}\n\nHagrid: Oh.\n\n{They all come into Hagrid's small hut.}\n\nHarry: We think Snape's trying to steal it.\n\nHagrid: Snape? Blimey, Harry, you're not still on about him, are you?\n\nHarry: Hagrid, we know he's after the Stone. We just don't know why.\n\nHagrid: Snape is one of the teachers protecting the Stone! He's not about to steal it!\n\nHarry: What?\n\nHagrid: You heard. Right. Come on, now, I'm a bit preoccupied today.\n\nHarry: Wait a minute. {Ron and a big black boarhound, FANG, meet. Fang sniffs Ron.} One of the teachers?\nHermione: {sitting in a large chair} Of course! There are other things defending the Stone, aren't there? Spells, enchantments.\n\nHagrid: That's right. Waste of bloody time, if you ask me.\n\n{Hermione looks at Ron, who is being sniffed in the face by Fang. Ron shuffles away.} Ain't no one gonna get past Fluffy. Hehe, not a soul knows how. Except for me and Dumbledore. I shouldn't have told you that. I shouldn't have told you that. {A cauldron over a fire begins to rattle.} Oh! {Hagrid hurries over and grabs something} Ooh! Ooh! Ooh! Ooh! {puts the thing, an egg, on the table. The group crowds around.}\n\nHarry: Uh, Hagrid, what exactly is that?\n\nHagrid: That? It's a ... its um...\n\nRon: I know what that is! But Hagrid, how did you get one?\n\nHagrid: I won it. Off a stranger I met down at a pub. Seemed quite glad to be rid off it, as a matter of fact.\n\n¬†\n\nThe egg rattles and cracks. Pieces fly off as a dragon emerges. It squeaks and slips on an egg piece.\n\n¬†\n\nHermione: Is that...a dragon?\n\nRon: That's not just a dragon. That's a Norwegian Ridgeback! My brother Charlie works with these in Romania.\n\nHagrid: Isn't he beautiful? Oh. Bless him, look. He knows his mummy. Hehe. Hallo, Norbert. {The dragon squeaks as it looks at Hagrid.}\n\nHarry: Norbert?\n\nHagrid: Yeah, well, he's got to have a name, doesn't he?\n\nRon: {laughs}\n\nHagrid: Don't you, Norbert? {raises fingers back and forth across Norberts chin} Dededede.\n\n¬†\n\nNorbert backs away, hiccups and blows a fireball of fire into Hagrid's beard.\n\n¬†\n\nHagrid: Ohh! Oooh, ooh, ooh, well...he'll have to be trained up a bit, of course. {Norbert hiccups. Hagrid sees someone looking in the window.} Who's that? {The person scampers away.}\n\nHarry: Malfoy.\n\nHagrid: Oh, dear.\n\n¬†\n\nScene:\n\nThe three are walking back through a corridor. An owl screeches.\n\n¬†\n\nHarry: Hagrid always wanted a dragon. He told me so the first time I met him.\n\nRon: It's crazy. And worse, Malfoy knows.\n\nHarry: I don't understand. Is that bad?\n\nRon: It's bad.\n\n¬†\n\nThey stop as McGonagall, in her nightgown, appears.\n\n¬†\n\nMcGonagall: Good evening.\n\n¬†\n\nMalfoy appears smugly beside her.\n\n¬†\n\nScene:\n\nMcGonagall's classroom. The three accused are standing in front of McGonagall's desk, while Malfoy is feet away, smirking.\n\n¬†\n\nMcGonagall: Nothing, I repeat, nothing gives a student the right to walk about the school at night. Therefore, as punishment for your actions, 50 points will be taken.\n\nHarry: 50?!\n\nMcGonagall: Each. And to ensure it doesn't happen again, all four of you will receive detention.\n\n¬†\n\nMalfoy nods, then his smile vanishes.\n\n¬†\n\nDraco: Excuse me, Professor. Perhaps I heard you wrong. I thought you said...\"the four of us.\"\n\n¬†\n\nMcGonagall: No, you heard me correctly, Mr. Malfoy. You see, as honorable as your intentions were, you too were out of bed after hours. You will serve detention with your classmates.\n\n¬†\n\nHarry, Ron and Hermione grin, and Draco sags.\n\n¬†\n\nScene:\n\nOutside, at night, the four students are being led to Hagrid's hut by Mr. Filch.\n\n¬†\n\nFilch: A pity they let the old punishments die. There was a time detention would find you hanging by your thumbs in the dungeons. God, I miss the screaming. {Draco gulps, and Hermione rushes by.} You'll be serving detention with Hagrid tonight. He's got a little job to do inside the dark forest. {Hagrid appears with a crossbow. He sniffles.} A sorry lot this, Hagrid. Oh, good God, man, you're not still on about that bloody dragon, are you?\n\n¬†\n\nHagrid: {sniffs and sighs} Norbert's gone. Dumbledore sent him off to Romania to live in a colony.\n\nHermione: Well, that's good, isn't it? He'll be with his own kind.\n\nHagrid: Yeahbut what if he don't like Romania? {Filch rolls eyes.} What if the other dragons are mean to him? He's only a baby, after all.\n\nFilch: Oh, for Gods sake, pull yourself together, man. You're going into the forest, after all. Got to have your wits about you.\n\nDraco: The forest? I thought that was a joke! We can't go in there. Students aren't allowed. And there are...{a howl sounds}...werewolves!\n\nFilch: There's more than werewolves in those trees, lad. You can be sure of that. {Draco looks frightened.} Nighty-night. {Exit.}\n\nHagrid: Right. Let's go.\n\n¬†\n\nScene: In the forest. The group walks along a path to a tree. Hagrid stops, bends down and dips his fingers in a silver puddle. He pulls out his fingers and rubs them together. A silver trail smears with his fingers.\n\n¬†\n\nHarry: Hagrid, what's that?\n\nHagrid: What we're here for. See that? That's unicorn's blood, that is. I found one dead a few weeks ago. Now, this one's been injured bad by something. {Harry suddenly sees a large cloaked figure walking through the trees. He looks at Hagrid.} So, it's our job to find the poor beast. Ron, Hermione, you'll come with me.\n\nRon: {weakly} Okay.\n\nHagrid: And Harry, you'll go with Malfoy. {Draco grimaces, and Harry nods.}\n\nDraco: Okay. Then I get Fang!\n\nHagrid: Fine. Just so you know, he's a bloody coward. {Fang whines.}\n\n¬†\n\nScene:\n\nHarry and Draco are walking through the forest, Fang leading. Draco has the lamp.\n\n¬†\n\nDraco: You wait till my father hears about this. This is servant's stuff.\n\nHarry: If I didn't know better, Draco, I'd say you were scared.\n\nDraco: Scared, Potter?! {Scoffs} {howl} Did you hear that? Come on, Fang. Scared.\n\n¬†\n\nScene:\n\nThe group approaches a flat ground with gnarled roots all over. Fang stops, then growls.\n\n¬†\n\nHarry: What is it, Fang?\n\n¬†\n\nUp ahead, a cloaked figure is crouched over a dead unicorn, drinking its blood. The figure raises its head, silver blood dripping from its mouth.\n\n¬†\n\nHarry gasps and grabs his scar, which is hurting.\n\n¬†\n\nDraco: {A look of pure fear} AHHHHHHHHH!!! AHHH! {runs away, with Fang} HELP!!!!!\n\n¬†\n\nHarry is left by himself. The figure slides over the unicorn and rises erect. It advances towards Harry, who backs upbut trips. He crawls backwards. Suddenly, there is the sound of hoofbeats. A figure leaps over Harry and lands near the cloaked figure. It is a silver centaur, FIRENZE. It rears, and the cloaked figure retreats, flying away.\n\n¬†\n\nFirenze: Harry Potter, you must leave. You are known to many creatures here. The forest is not safe at this time. Especially for you.\n\nHarry: {rises} But what was that thing you saved me from?\n\nFirenze: A monstrous creature. It is a terrible crime to slay a unicorn. Drinking the blood of a unicorn will keep you alive even if you are an inch from death. But at a terrible price. You have slain something so pure that the moment the blood touches your lips, you will have a half-life. A cursed life.\n\nHarry: But who would choose such a life?\n\nFirenze: Can you think of no one?\n\nHarry: Do you mean to say...that that thing that killed the unicorn...that was drinking its blood...that was Voldemort?\n\nFirenze: Do you know what is hidden in the school at this very moment?\n\nHarry: The Philosopher's Stone.\n\n¬†\n\nSuddenly, a dog (Fang) barks. Harry looks up and sees Hagrid, Hermione, Ron and Draco appear.\n\n¬†\n\nHermione: Harry!\n\nHagrid: Hello there, Firenze. I see you've met our young Mr. Potter. You all right there, Harry? {Harry nods}\n\nFirenze: Harry Potter, this is where I leave you. You're safe now. Good luck.\n¬†\n{Close up on the dead unicorn.}\n\n¬†\nScene:\n\nGryffindor common room. Right after 'attack.' The group is around the fire. Hermione and Ron are seatedbut Harry stands.\n\n¬†\n\nHermione: You mean, You-Know-Who's out there, right now, in the forest?\n\nHarry: But he's weak. He's living off the unicorns. Don't you see? We had it wrong. Snape doesn't want the stone for himself, he wants the stone for Voldemort. With the Elixir of Life, Voldemort will be strong again. He'll He'll come back. {Sits down.}\n\nRon: But if he comes back, you don't think he'll try to kill you, do you?\n\nHarry: I think if he'd had the chance, he might have tried to kill me tonight.\n\nRon: {Gulp} And to think, I've been worrying about my Potions final!\n\nHermione: Hang on a minute. We're forgetting one thing. Who's the one wizard Voldemort always feared?\n\n{The boys shrug.} Dumbledore! As long as Dumbledore's around, you're safe. As long as Dumbledore's around, you can't be touched. {Harry smiles slightly.}\n\n¬†\n\nScene:\n\nSome time later. In the outdoor courtyard. The three are walking.\n\n¬†\n\nHermione: I've always heard Hogwarts' end of the year exams were frightfulbut I found that rather enjoyable.\n\nRon: Speak for yourself. All right there, Harry?\n\nHarry: My scar. It keeps burning.\n\nHermione: It's happened before.\n\nHarry: Not like this.\n\nRon: Perhaps you should see the nurse.\n\nHarry: I think it's a warning. It means dangers coming. Uhh! {He rubs scar and then sees Hagrid across the field, at his hut.} Oh. Of course! {runs for hut.}\n\nHermione: What is it?\n\nHarry: Don't you think it's a bit odd that what Hagrid wants more than anything is a dragon, and a stranger shows up and just happens to have one? {They approach Hagrid, who is playing the Harry Potter theme on his flute.} I mean, how many people wander around with dragon eggs in their pockets? Why didn't I see it before? Hagrid, who gave you the dragon egg? {Hagrid stops playing.} What did he look like?\n\nHagrid: I don't know. I never saw his face. He kept his hood up.\n\nHarry: The stranger, though, you and he must have talked.\n\nHagrid: Well, he wanted to know what sort of creatures I looked after. I told him. I said, \"After Fluffy, a dragon's gonna be no problem.\"\n\nHarry: And did he seem interested in Fluffy?\n\nHagrid: Well, of course he was interested in Fluffy! How often do you come across a three headed dog, even if you're in the trade? But I told him. I said, \"The trick with any beast is to know how to calm him. Take Fluffy, for example, just play him a bit of music and he falls straight to sleep.\"\n\n¬†\n\nThe three gape.\n\n¬†\n\nHagrid: I shouldn't have told you that. {The three take off.} Where you going?! Wait!\n\n¬†\n\nScene:\n\nMcGonagall's classroom. The three come tearing in and run up the aisles between desks. They pass a ghost and stop at the desk.\n\n¬†\n\nHarry: We have to see Professor Dumbledore, immediately!\n\nMcGonagall: I'm afraid Professor Dumbledore is not here. He received an urgent owl from the Ministry of Magic and left immediately for London.\n\nHarry: He's gone?! Now? But this is important! It's about...the Philosopher's Stone.\n\nMcGonagall: {shocked} How do you know\n\nHarry: Someone's going to try and steal it.\n\nMcGonagall: I don't know how you three found out about the stonebut I can assure you it is perfectly well-protected. Now would you go back to your dormitories? Quietly. {They leave.}\n\n¬†\n\nScene:\n\nAfter exiting McGonagall's class, they walk down the hallway.\n\n¬†\n\nHarry: That was no stranger Hagrid met in the village. It was Snape, which means he knows how to get past Fluffy.\n\nHermione: And with Dumbledore gone\n\n{Snape suddenly appears behind them}\n\nSnape: Good afternoon. Now, what would three young Gryffindors such as yourselves be doing inside on a day like this?\n\nHermione: Uh...we were just...\n\nSnape: You want to be careful. People will think you're {Harry glares madly at Snape, who looks shocked} up to something. {Exit.}\n\nHermione: Now what do we do?\n\nHarry: We go down the trapdoor. Tonight.\n\n¬†\n\nScene: Nighttime. In the Gryffindor Common Room. The three friends come down the stairs and begin to walk across the floor. They stop when they hear croaking.\n\n¬†\n\nHarry: Trevor.\n\nRon: Trevor shh! Go, you shouldn't be here!\n\nNeville: {appears behind a chair} Neither should you. You're sneaking out again, arent you?\n\nHarry: Now, Neville, listen. We were\n\nNeville: No! I won't let you! {stands} You'll get Gryffindor in trouble again! I-I'll fight you. {holds out fists.}\n\nHermione: Neville, I'm really, really sorry about this...{takes out wand} Petrificus Totalus.\n\n¬†\n\nNeville is frozen and falls backwards onto the ground. Hermione puts her wand back.\n\n¬†\n\nRon: {Gulp} You're a little scary sometimes...you know that? Brilliantbut scary.\n\nHarry: Let's go. {Walks by Neville} Sorry.\n\nHermione: Sorry.\n\nRon: It's for your own good, you know. {Exit.}\n\n¬†\n\nScene: The three are under the Invisibility cloak, sneaking along the corridor.\n\n¬†\n\nHermione: Ow! You stood on my foot!\n\nRon: Sorry. {A flame lights. Hermione draws out her wand and points it at the door.}\n\nHermione: Alohomora.\n\n¬†\n\nThe door opens and they go in.\n\n¬†\n\nRon: Wait a minute...he's....{a blow of air, and the cape flutters off them.} Sleeping.\n\nHarry: Snape's already been here. He's put a spell on the harp. {They approach the sleeping dog.}\n\nRon: Uh. It's got horrible breath!\n\nHarry: We have to move its paw.\n\nRon: What?!\n\nHarry: Come on! {grabs paw, which is blocking the door.} Okay. Push! {They strain and move it. They open the door.} I'll go first. Don't follow until I give you a sign. {Fluffy's eyes open.} If something bad happens, get yourselves out...Does it seem a bit...quiet?\n\nHermione: The harp. It stopped playing.\n\n¬†\n\nDrool from one head comes down on Ron's shoulder.\n\n¬†\n\nRon: Ew! Yuck! Ugh. {All three kids look up and see Fluffy standing there. Fluffy barks and growls, thrashing. It breaks the harp and dives at the three.}\n\nHarry: Jump! Go! {They all jump through the trapdoor.}\n\nRon: Ahh! {gasps as he lands on some mushy black ropelike vines.} Whoa. Lucky this plant-thing is here, really.\n\nHarry: Whoa! {The plant begins to move towards them.} Oh. Ahh! {The plant ties them up.}\n\nHermione: Stop moving, both of you. This is Devil's Snare. You have to relax. If you don't, it will only kill you faster.\n\nRon: Kill us faster?! Oh, now I can relax!\n\n¬†\n\nHermione manages a smile as she is sucked down below.\n\n¬†\n\nRon and Harry: Hermione!!\n\nRon: Now what are we gonna do?!\n\nHermione's voice: Just relax!\n\nHarry: Hermione! Where are you?!\n\nHermione (from below): Do what I say. Trust me.\n\n¬†\n\nHarry relaxes and is sucked through.\n\n¬†\n\nRon: Ahh! Harry!\n\n¬†\n\nHarry falls through and lands on the hard ground. Hermione goes over to him and he stands up.\n\n¬†\n\nRon: Harry!\n\nHermione: Are you okay?\n\nHarry: Yeah, yeah, I'm fine.\n\nRon: Help!\n\nHermione: He's not relaxing, is he?\n\nHarry: Apparently not.\n\nRon: Help! Help me!\n\nHermione: We've got to do something!\n\nHarry: What?\n\nHermione: Uh! I remember reading something in Herbology. {Ron: Help!} Um Devil's Snare, Devil's Scare, {The snare shuts Ron's mouth} it's deadly fun...but will sulk in the sun! That's it! Devil's Snare hates sunlight! {takes out wand and points upwards.} Lumus Solem! {A beam of light shoots out. The Snare shrieks and recoils. Ron falls below.}\n\nRon: Ahhh!\n\nHarry: Ron, are you okay?\n\nRon: Yeah.\n\nHarry: Okay.\n\nRon: {stands} Whew. Lucky we didn't panic!\n\nHarry: Lucky Hermione pays attention in Herbology.\n\n¬†\n\nThere is a sound.\n\n¬†\n\nHermione: What is that?\n\nHarry: I don't know. Sounds like wings.\n\n¬†\n\nThey enter into a room filled with golden \"birds.\"\n\n¬†\n\nHermione: Curious. I've never seen birds like these.\n\nHarry: They're not birds, they're keys. And I'll bet one of them fits that door. {They come upon a broomstick, suspended in the air.}\n\nHermione: What's this all about?\n\nHarry: I don't know. Strange.\n\n{Ron creeps over to the door and takes out his wand.}\n\nRon: {rattles lock.} Alohomora! {Shrugs} Well, it was worth a try.\n\nHermione: Ugh! What're we going to do? There must be 1000 keys up there!\n\nRon: We're looking for a big old fashioned one. Probably rusty like the handle.\n\nHarry: There! I see it! {points} The one with the broken wing! {He looks at the broom.}\n\nHermione: What's wrong, Harry?\n\nHarry: It's too simple.\n\nRon: Oh, go on, Harry! If Snape can catch it on that old broomstick, you can! You're the youngest seeker in a century!\n\n¬†\n\nHarry nods and grabs the broom. All the keys suddenly go one direction, right at Harry. He climbs on, swiping at them.\n\n¬†\n\nRon: This complicates things a bit!\n\n¬†\n\nHarry pushes off into the air. He flies off, after the key. The others follow him. Harry grabs the key.\n\n¬†\n\nHarry: Catch the key!\n\n¬†\n\nHe zooms by and throws the key to Hermione, who catches it and heads for the lock while Harry distracts the other keys. Hermione puts it in the lock.\n\n¬†\n\nRon: Hurry up!\n\n¬†\n\nThe door opens, and Hermione and Ron rush through, followed by Harry. They shut the door just as the keys slam up against it.\n\n¬†\n\nScene:\n\nThey enter a dark room, with broken pieces all around it.\n\n¬†\n\nHermione: I don't like this. I don't like this at all.\n\nHarry: Where are we? A graveyard.\n\nRon: This is no graveyard. {sighs} It's a chessboard. {Walks out onto the marble board and flames light, illuminating the board and GIANT players. Harry and Hermione come up with him.}\n\nHarry: There's the door.\n\n¬†\n\nThey walk across the board, towards the door. Suddenly, as they reach a line of pawns, the pawns bring up their swords. The three jump and back up.\n\n¬†\n\nHermione: Now what do we do?\n\nRon: It's obvious, isn't it? We've got to play our way across the room. All right. Harry, you take the Bishop's square. Hermione, you'll be the Queen's side castle. As for me, I'll be a knight. {They all take their places.}\n\nHermione: What happens now?\n\nRon: {aboard a horse.} Well, white moves first, and then...we play. {A pawn on the other side moves forward. Ron studies the game.}\n\nHermione: Ron, you don't suppose this is going to be like...real wizard's chess, do you?\n\nRon: You there! D-5! {A black pawn moves forward, diagonal to the white pawn. The white pawn raises its swords and smashes the black one. The three jump.} Yes, Hermione, I think this is going to be exactly like wizard's chess!\n\n¬†\n\nThe game continues. Pieces smash each other, boom! Boom!\n\nRon: Castle to E-4! Smash! Ron: Pawn to C-3! Smash! Boom! The Queen turns, and smashes a piece! Harry, Ron and Hermione wince. The Queen turns again. Both Ron and Harry study the game.\n\n¬†\n\nHarry: Wait a minute.\n\nRon: You understand right, Harry. Once I make my move, the Queen will take me...then you'll be free to check the King.\n\nHarry: No, Ron! No!\n\nHermione: What is it?\n\nHarry: He's going to sacrifice himself!\n\nHermione: No, Ron, you can't! {Ron closes his eyes.} There must be another way!\n\nRon: {turns to face Hermione.} Do you want to stop Snape or not? Harry, it's you that has to go on. I know it. Not me, not Hermione, you. {Harry nods.} Knight...to H-3.\n\n¬†\n\nRon's horse moves forward, slides and stops.\n\n¬†\n\nRon: Check.\n\n¬†\n\nThe Queen turns and advances. Ron breathes faster, clutching the steel reins. The Queen stops. SMASH! Ron goes flying off the horse and lands on the floor, unconscious.\n\n¬†\n\nRon: Ahhhh!\n\nHarry: RON! {Hermione starts walking to him.} NO! Don't move! Dont forget, we're still playing. {Hermione moves back. Harry walks the diagonal in front of the King.} Checkmate. {The Kings sword falls onto the ground victory. Harry breathes out and then the two run to Ron. They bend beside him.} Take care of Ron. Then, go to the owlery. Send a message to Dumbledore. Ron's right...I have to go on.\n\nHermione: You'll be okay, Harry. You're a great wizard, you really are.\n\nHarry: Not as good as you.\n\nHermione: {smile} Me? Books and cleverness? There are more important things. Friendship, and bravery. And Harry, just be careful.\n\n¬†\n\nHarry nods and stands, walking away.\n\n¬†\n\n\n¬†\nScene:\n\nHarry walks down a long staircase to an empty room with pillars around it. The Mirror of Erised is in the middle of the room, and a man is standing before it. It is Quirrell. Harry yelps and grabs his scar.\n\n¬†\n\nHarry: You? {Quirrell turns around.} No. It can't be...Snape. He was the one\n\nQuirrell: Yes. He does seem the type, doesn't he? Next to me, who would suspect, \"p-p-poor s-stuttering Professor Quirrell?\"\n\nHarry: B-but, that day, during the Quidditch Match, Snape tried to kill me.\n\nQuirrell: No, dear boy. I tried to kill you! And trust me, if Snape's cloak hadn't caught fire and broken my eye contact, I would have succeeded. Even with Snape muttering his little counter-curse.\n\nHarry: Snape was trying to...save me?\n\nQuirrell: I knew you were a danger right from the off. Especially after Halloween.\n\nHarry: Th-then you let the troll in.\n\nQuirrell: Very good Potter, yes. Snape, unfortunately, wasn't fooled. While everyone else was running to the dungeon, he went to the 3rd floor to head me off. He, of course, never trusted me again. He rarely left me alone. {Quirrell turns back to the mirror and Harry's scar hurts.} But he doesn't understand. I'm never alone. Never. Now...what does this mirror do? I see what I desire. I see myself holding the stone. But how do I get it?\n\n{A raspy voice, VOLDEMORT, calls.}: Use the boy.\n\nQuirrell: Come here, Potter, now!\n\n¬†\n\nHarry walks forward shakily.\n\n¬†\n\nQuirrell: Tell me. What do you see?\n\n¬†\n\nHarry looks in the mirror. He sees himself. His mirror self brings his hand into his pocket and takes out a red stone! The mirror self winks and puts the stone back. Very subtly, Harry reaches to his pocket. There is a lump. He gasps.\n\n¬†\n\nQuirrell: What is it?! What do you see?!\n\nHarry: I-I'm shaking hands with Dumbledore. I've won the house cup.\n\nVoldemort's voice: He lies.\n\nQuirrell: Tell the truth! What do you see?!\n\nVoldemort's voice: Let me speak to him.\n\nQuirrell: Master, you are not strong enough.\n\nVoldemort's voice: I have strength enough for this. {Quirrell unwraps his turban and on the side opposite his face, another face is planted. It is Voldemort who appears kind of like a snake. He stretches out and faces Harry via the mirror.} Harry Potter. We meet again.\n\nHarry: Voldemort.\n\nVoldemort: Yes. You see what I have become? See what I must do to survive? Live off another. A mere parasite. Unicorn blood can sustain mebut it cannot give me a body of my own. But there is something that can. Something, that conveniently enough, lies in your pocket!\n\n¬†\n\nHarry turns and runs.\n\n¬†\n\nVoldemort: Stop him! {Quirrell snaps his fingers and fire erupts all around the room. Harry is stuck.} Don't be a fool! Why suffer a horrific death when you can join me and live?!\n\nHarry: {shakes his head} Never!\n\nVoldemort: Haha. Bravery. Your parents had it too. Tell me, Harry, would you like to see your mother and father again? Together, we can bring them back. {In the mirror, Harrys parents faces appear.} All I ask for is something in return. {Harry takes the stone from his pocket.} That's it, Harry. There is no good and evil. There is only power, and those too weak to seek it. Together, we'll do extraordinary things. Just give me the stone! {Mother and father vanish.}\n\nHarry: You liar!\n\nVoldemort: Kill him!\n\n¬†\n\nQuirrell soars into the air and smashes into Harry, one hand on Harrys throat. They fall to the steps. The stone falls out of Harry's reach as Quirrell chokes him. Harry strains and squeaks. Suddenly, Harry puts his hand on Quirrell's, trying to get him off. Smoke furls from under his hand.\n\n¬†\n\nQuirrell: Ahh! Ahh! {backs up. His hand is crumbling into a mountain of black ash.} What is this magic? {hand dissipates.}\n\nVoldemort: Fool! Get the stone!\n\nQuirrell: {Walks forwardbut Harry puts both hands on his face.} Ahhhhhhhhhh!\n\n¬†\n\nQuirrell backs up, then his face, which is horrendously burned, crumbles as he walks forward. His whole body is ash. He falls to the floor. Harry gasps. He looks at his own hands and hurries over to the stone. He picks it up and sighs, when he hears something. Turning, Harry sees a dust clouds with Voldemort's face. The cloud rushes forward, right through Harry!\n\n¬†\n\nVoldemort: Arrrhhhhhh!\n\nHarry: Ahhhhhhhhh! {Voldemort flies away. Harry falls to the ground, unconscious. He holds the stone in an outstretched hand.}\n\n¬†\n\nScene:\n\nThe hospital wing. Harry is bandaged, lying in bed. He awakens, puts on his glasses, and sits up. There are cards and candy all over. Dumbledore approaches him.\n\n¬†\n\nDumbledore: Good afternoon, Harry. Ah. Tokens from your admirers?\n\nHarry: Admirers?\n\nDumbledore: What happened down in the dungeons between you and Professor Quirrell is a complete secret, so, naturally, the whole school knows. {Both smile.} Ah, I see your friend Ronald has saved you the trouble of opening your Chocolate Frogs.\n\nHarry: Ron was here? Is he all right? What about Hermione?\nDumbledore: Fine. They're both just fine.\n\nHarry: But, what happened to the Stone?\n\nDumbledore: Relax, dear boy. The stone has been destroyed. My friend Nicholas and I had a little chat and agreed it was best all around.\n\nHarry: But Flamel, he'll die, won't he?\n\nDumbledore: {sits on the bed.} He has enough Elixir to set his affairs in order. But yes, he will die.\n\nHarry: How is it I got the Stone, sir? One minute I was staring in the mirror, and the next...\n\nDumbledore: Ah. You see, only a person who wanted to find the Stone, find itbut not use it, would be able to get it. That is one of my more brilliant ideas. And between you and me thats saying something. {Smile both.}\n\nHarry: Does that mean, with the Stone gone, I mean, that Voldemort can never come back?\n\nDumbledore: Ah, I'm afraid there are ways in which he can return. Harry, do you know why Professor Quirrell couldn't bear to have you touch him? {Harry shakes his head.} It was because of your mother. She sacrificed herself for you, and that kind of act leaves a mark. {Harry touches his scar.} No, no, this kind of mark cannot be seen. It lives in your very skin.\n\nHarry: What is it?\n\nDumbledore: Love, Harry, love. {Pats Harry's head and stands up.} Ah. Bertie Bott's Every Flavour Beans. I was most unfortunate in my youth to come across a vomit flavoured one, and since then I have lost my liking for them. But I think I could be safe with a nice toffee...{takes brown bean and eats it.} Mm. Alas. Earwax.\n\n¬†\n\nScene:\n\nHarry approaches a room where up on a stairwell balcony Hermione and Ron are talking. They stop when they see Harry and lean over the railing.\n\n¬†\n\nHarry: All right there, Ron?\n\nRon: All right? You?\n\nHarry: {shrug} All right. Hermione?\n\nHermione: {smile} Never better.\n\n¬†\n\nScene:\n\nIn the great hall. All students are seated, and green banners with snakes on them are around the ceiling.\n\nDumbledore, at the head table, nods to McGonagall.\n\nShe dings her glass and the chatter stops. Dumbledore rises.\n\n¬†\n\nDumbledore: Another year gone. And now, as I understand it, the house cup needs awarding, and the points stand thus. In fourth place, Gryffindor with 312 points. {Clapping. Harry and Hermione hide their heads.} Third place, Hufflepuff, with 352 points. {Clapping.} In second place, Ravenclaw, with 426 points. {Clapping.} And in first place, with 472 points, Slytherin House.\n\n¬†\n\nThere is immense cheering.\n\n¬†\n\nStudents: Whoo! Yeah!\n\nDraco: Nice one, Mate! {sees Ron looking at him and sneers.}\n\nDumbledore: Yes, yes, well done Slytherin, well done Slytherin. However, recent events must be taken into account. And I have a few last minute points to award. {The Gryffindor students look up.} To Miss Hermione Granger, for the use of cool intellect when others were in great peril, 50 points. {Applause.}\n\nHarry: {Pats} Good job.\n\nDumbledore: Second, to Mr. Ronald Weasley, for the best played game of chess {Ron looks at Harry and mouths, 'Me?' Harry nods, and mouths, 'You!'} that Hogwarts has seen these many years...50 points. {Applause} And third, to Mr. Harry Potter, for pure nerve and outstanding courage, I award Gryffindor house 60 points. {Immense cheering.}\n\nHermione: We're tied with Slytherin!\n\nDumbledore: And finally, it takes a great deal of bravery to stand up to your enemiesbut a great deal more to stand up to your friends. I award 10 points to Neville Longbottom.\n\n¬†\n\nImmense cheering erupts. Neville is unbelieving, and sits there while cheering gets louder. Draco is downfallen.\n\n¬†\n\nDumbledore: Assuming that my calculations are correct, I believe that a change of direction is in order. {Claps. The green banners change to Gryffindor red and yellow.} Gryffindor wins the House Cup!\n\n¬†\n\nCheering.\n\n¬†\n\nHagrid: Yes! {grins}\n\n¬†\n\nAll students stand and throw their hats into the air, except Draco, who smashes his down onto the table.\n\n¬†\n\nSeamus: Neville! {Shakes his hand.}\n\n¬†\n\nAll rub each other's hair and jump around, cheering and laughing.\n\n¬†\n\nLee: Yeah! We won!! {Jumps with Harry, who looks back and grins very widely.}\n\n¬†\n\nScene:\n\nThe outdoor train station. Students are walking around, getting in the train.\n\n¬†\n\nHagrid: Come on now, hurry up. You'll be late. Train's leaving. Go on. Go on. Come on. Hurry up.\n\n¬†\n\nHarry hands Hedwig to a train man, and walks to an open door of the train with Hermione. Hermione waves to Hagrid, who waves back. Hermione gets in the train.\n\n¬†\n\nHermione: Come on, Harry.\n\nHarry: One minute. {He walks over to Hagrid.}\n\nHagrid: Thought you were leaving without saying good-bye, didja? {Hagrid takes a red album out of his coat pocket and hands it to Harry.} This is for you.\n\n¬†\n\nHarry opens the album and sees a picture, moving, of him as a baby with his parents. They are all smiling and waving. Harry smiles.\n\n¬†\n\nHarry: Thanks, Hagrid. {Shakes Hagrid's hand, then hugs him tightly.}\n\nHagrid: Oh. Go on...on with you. {Harry lets go.} Oh, listen, Harry, if that dolt of a cousin of yours, Dudley, gives you any grief, you could always, um, threaten him with a nice pair of ears to go with that tail of his.\n\nHarry: But Hagrid, we're not allowed to do magic away from Hogwarts. You know that.\n\nHagrid: I do. But your cousin don't, do he? Eh? {chuckle} Off you go.\n\n¬†\n\nHarry walks away, back to the train door where Hermione and Ron are waiting.\n\n¬†\n\nHermione: Feels strange to be going home, doesn't it?\n\nHarry: I'm not going home. Not really.\n\n¬†\n\nThe train whistles and they climb aboard. As the train starts to leave and the camera pans up over the whole scene, Harry waves out the window to Hagrid, who waves back and then waves more to other students as the camera pans far back, then the credits begin.",
