            "id": "UgwJwJ1VJ3FBM8yCrfJ4AaABAg.9Albrp9voR79Ao9AYIy3_A",
            "snippet": {
              "videoId": "yuD34tEpRFw",
              "textDisplay": "@Tim Lewis &quot;  I was trying to find the mass of an object at different speeds. Because E = mc^2 you can convert the energy to mass.  &quot;\u003cbr\u003eThis would not work the way you tried . If you use E = mc^2 to convert energy to mass, you have to use the TOTAL ENERGY , not just the kinetic energy.   E refers to total energy. TOTAL ENERGY  = KINETIC ENERGY + REST MASS ENERGY\u003cbr\u003eAlso m in the formula refers to relativistic mass, not the rest mass.\u003cbr\u003e\u003cbr\u003e&quot; Something else I&#39;ve thought of though is kinetic energy and thus mass depends on the frame of reference, as we have nothing to define fixed or stationary.\r &quot;\u003cbr\u003eYes, KE depends on frame of reference. Relativistic mass depends on frame of reference. Rest mass does not.\u003cbr\u003e\u003cbr\u003e&quot; The other thing I was thinking about is with a simple doppler shift it is possible for each person&#39;s time to look slower to each otherbut with an actual lasting time dilation this would seem like a paradox.\r &quot;\u003cbr\u003eYes, with time dilation, it would seem like a paradox. But with careful analysis of the different frames of reference , all paradoxes have been resolved\u003cbr\u003e\u003cbr\u003e&quot;  But if they are also experiencing humans to age more slowly since the humans are at nearly the speed of light from the point of view of the particle, then I&#39;m not sure which one actually ages first.  &quot;\u003cbr\u003eYou used the term &quot;actually&quot; . This is a loaded term in relativity and is vague ,ambiguous  and a dangerous term that can lead to conceptual mistakes. Since, there is no absolute fixed or stationary, there is no &quot;actually&quot;. Humans age slower in the particle&#39;s frame and particle ages slower in  the human&#39;s frame. There is no one frame which is an &quot;actual&#39; frame where the &quot;actual&quot; real thing happens.",
              "textOriginal": "@Tim Lewis \"  I was trying to find the mass of an object at different speeds. Because E = mc^2 you can convert the energy to mass.  \"\nThis would not work the way you tried . If you use E = mc^2 to convert energy to mass, you have to use the TOTAL ENERGY , not just the kinetic energy.   E refers to total energy. TOTAL ENERGY  = KINETIC ENERGY + REST MASS ENERGY\nAlso m in the formula refers to relativistic mass, not the rest mass.\n\n\" Something else I've thought of though is kinetic energy and thus mass depends on the frame of reference, as we have nothing to define fixed or stationary.\r \"\nYes, KE depends on frame of reference. Relativistic mass depends on frame of reference. Rest mass does not.\n\n\" The other thing I was thinking about is with a simple doppler shift it is possible for each person's time to look slower to each otherbut with an actual lasting time dilation this would seem like a paradox.\r \"\nYes, with time dilation, it would seem like a paradox. But with careful analysis of the different frames of reference , all paradoxes have been resolved\n\n\"  But if they are also experiencing humans to age more slowly since the humans are at nearly the speed of light from the point of view of the particle, then I'm not sure which one actually ages first.  \"\nYou used the term \"actually\" . This is a loaded term in relativity and is vague ,ambiguous  and a dangerous term that can lead to conceptual mistakes. Since, there is no absolute fixed or stationary, there is no \"actually\". Humans age slower in the particle's frame and particle ages slower in  the human's frame. There is no one frame which is an \"actual' frame where the \"actual\" real thing happens.",
              "parentId": "UgwJwJ1VJ3FBM8yCrfJ4AaABAg",
              "authorDisplayName": "silverrahul",
              "authorProfileImageUrl": "https://yt3.ggpht.com/ytc/AMLnZu-OfAwDoITIZ9NnMSACd0cEwiWMsRPPus8LZbA9=s48-c-k-c0x00ffffff-no-rj",
              "authorChannelUrl": "http://www.youtube.com/channel/UC8IQd0mpWJDVXSHBfR11ECw",
              "authorChannelId": {
                "value": "UC8IQd0mpWJDVXSHBfR11ECw"
              },
              "canRate": true,
              "viewerRating": "none",
              "likeCount": 0,
              "publishedAt": "2020-07-07T10:53:14Z",
              "updatedAt": "2020-07-07T10:59:23Z"
            }
          },
          {
            "kind": "youtube#comment",
            "etag": "CVHhhu-H-VwqgtTjBNvnxFMWhEU",
            "id": "UgwJwJ1VJ3FBM8yCrfJ4AaABAg.9Albrp9voR79Ao5BAPUv7s",
            "snippet": {
              "videoId": "yuD34tEpRFw",
              "textDisplay": "\u200b@silverrahul I was trying to find the mass of an object at different speeds. Because E = mc^2 you can convert the energy to mass. Heating a drink in a microwave increases its mass from the energy added, although the amount of steam coming off it probably reduces the mass by far more. With kinetic energy though, this would add extra inertia making the object more resistant to acceleration.\u003cbr\u003eA classical formula in a world of infinite possible speed and fixed rate of time everywhere would have it be 1/2*mc^2but as energy actually has mass, it would be added to the object. On a speeding car it only adds a few trillionths of a kilogram so it&#39;s negligible.\u003cbr\u003eSomething else I&#39;ve thought of though is kinetic energy and thus mass depends on the frame of reference, as we have nothing to define fixed or stationary.\u003cbr\u003eThe other thing I was thinking about is with a simple doppler shift it is possible for each person&#39;s time to look slower to each otherbut with an actual lasting time dilation this would seem like a paradox.\u003cbr\u003eTests were done with subatomic particles with normally fast decay rates. They appeared to decay much more slowly when they were accelerated to almost the speed of light. But if they are also experiencing humans to age more slowly since the humans are at nearly the speed of light from the point of view of the particle, then I&#39;m not sure which one actually ages first.",
              "textOriginal": "\u200b@silverrahul I was trying to find the mass of an object at different speeds. Because E = mc^2 you can convert the energy to mass. Heating a drink in a microwave increases its mass from the energy added, although the amount of steam coming off it probably reduces the mass by far more. With kinetic energy though, this would add extra inertia making the object more resistant to acceleration.\nA classical formula in a world of infinite possible speed and fixed rate of time everywhere would have it be 1/2*mc^2but as energy actually has mass, it would be added to the object. On a speeding car it only adds a few trillionths of a kilogram so it's negligible.\nSomething else I've thought of though is kinetic energy and thus mass depends on the frame of reference, as we have nothing to define fixed or stationary.\nThe other thing I was thinking about is with a simple doppler shift it is possible for each person's time to look slower to each otherbut with an actual lasting time dilation this would seem like a paradox.\nTests were done with subatomic particles with normally fast decay rates. They appeared to decay much more slowly when they were accelerated to almost the speed of light. But if they are also experiencing humans to age more slowly since the humans are at nearly the speed of light from the point of view of the particle, then I'm not sure which one actually ages first.",
              "parentId": "UgwJwJ1VJ3FBM8yCrfJ4AaABAg",
              "authorDisplayName": "Tim Lewis",
              "authorProfileImageUrl": "https://yt3.ggpht.com/ytc/AMLnZu_yWzfC2x3-fINcK0YrtRScDklXpqwzoQnlBg=s48-c-k-c0x00ffffff-no-rj",
