              "textDisplay": "@Tim Lewis Secondly, ignoring the wrong formula, i still do not understand what you are trying to do with the infinite geometric progression thing\u003cbr\u003eSpecifically if KE at speed of light were to be 1/2Mc^2 , why would Mass of kinetic energy at speed of light be 1/2*M ?",
              "textOriginal": "@Tim Lewis Secondly, ignoring the wrong formula, i still do not understand what you are trying to do with the infinite geometric progression thing\nSpecifically if KE at speed of light were to be 1/2Mc^2 , why would Mass of kinetic energy at speed of light be 1/2*M ?",
              "parentId": "UgwJwJ1VJ3FBM8yCrfJ4AaABAg",
