            "id": "UgwJwJ1VJ3FBM8yCrfJ4AaABAg.9Albrp9voR79AnzA-YqoPB",
            "snippet": {
              "videoId": "yuD34tEpRFw",
              "textDisplay": "\u200b@silverrahul that&#39;s another aspect I was confused about. When I tried the &quot;weighing the kinetic energy and adding it in an infinite geometric progression&quot; method I ended up with the &quot;infinite mass limiting speed&quot; being the square root of 2 x the speed of light.\u003cbr\u003eHere is the math I did which probably has mistakes.\u003cbr\u003eMass of object = M\u003cbr\u003eKinetic energy at speed of light = 1/2*M*c^2\u003cbr\u003eMass of kinetic energy at speed of light = 1/2*M\u003cbr\u003eKinetic energy of mass of kinetic energy = 1/4*M*c^2\u003cbr\u003eMass of kinetic energy of mass of kinetic energy = 1/4*M\u003cbr\u003eKinetic energy of mass of kinetic energy of mass of kinetic energy = 1/8*M*c^2\u003cbr\u003eMass of kinetic energy of mass of kinetic energy of mass of kinetic energy = 1/8*M\u003cbr\u003e.............\u003cbr\u003eTotal mass = M + 1/2*M + 1/4*M + 1/8*M + 1/16*M + ........\u003cbr\u003e= M/(1 - 1/2) = 2M\u003cbr\u003eWhereas at the square root of 2 x the speed of light I get M + M + M + M + ......... = infinite.\u003cbr\u003eWhereas the limiting value should be the speed of light so I&#39;m wondering what error I&#39;ve made in the maths.\u003cbr\u003e\u003cbr\u003eThe other thing is I got through university and never saw an equation relating gravitational field strength to time dilation. I&#39;m not sure if it&#39;s the actual value in m/s^2 that&#39;s important or the &quot;escape energy&quot; because escape energy is also dependent on the total distance the field acts on. A small piece of neutron star could have earth&#39;s gravity if you got close enoughbut its escape velocity would be lower than earth&#39;s (obviously the entire star&#39;s would be much greater)",
              "textOriginal": "\u200b@silverrahul that's another aspect I was confused about. When I tried the \"weighing the kinetic energy and adding it in an infinite geometric progression\" method I ended up with the \"infinite mass limiting speed\" being the square root of 2 x the speed of light.\nHere is the math I did which probably has mistakes.\nMass of object = M\nKinetic energy at speed of light = 1/2*M*c^2\nMass of kinetic energy at speed of light = 1/2*M\nKinetic energy of mass of kinetic energy = 1/4*M*c^2\nMass of kinetic energy of mass of kinetic energy = 1/4*M\nKinetic energy of mass of kinetic energy of mass of kinetic energy = 1/8*M*c^2\nMass of kinetic energy of mass of kinetic energy of mass of kinetic energy = 1/8*M\n.............\nTotal mass = M + 1/2*M + 1/4*M + 1/8*M + 1/16*M + ........\n= M/(1 - 1/2) = 2M\nWhereas at the square root of 2 x the speed of light I get M + M + M + M + ......... = infinite.\nWhereas the limiting value should be the speed of light so I'm wondering what error I've made in the maths.\n\nThe other thing is I got through university and never saw an equation relating gravitational field strength to time dilation. I'm not sure if it's the actual value in m/s^2 that's important or the \"escape energy\" because escape energy is also dependent on the total distance the field acts on. A small piece of neutron star could have earth's gravity if you got close enoughbut its escape velocity would be lower than earth's (obviously the entire star's would be much greater)",
              "parentId": "UgwJwJ1VJ3FBM8yCrfJ4AaABAg",
              "authorDisplayName": "Tim Lewis",
              "authorProfileImageUrl": "https://yt3.ggpht.com/ytc/AMLnZu_yWzfC2x3-fINcK0YrtRScDklXpqwzoQnlBg=s48-c-k-c0x00ffffff-no-rj",
              "authorChannelUrl": "http://www.youtube.com/channel/UCm-IrMI7kd8x7kiDFf_UhZg",
              "authorChannelId": {
                "value": "UCm-IrMI7kd8x7kiDFf_UhZg"
              },
              "canRate": true,
              "viewerRating": "none",
              "likeCount": 0,
              "publishedAt": "2020-07-07T09:17:03Z",
              "updatedAt": "2020-07-07T09:22:12Z"
            }
