            "snippet": {
              "videoId": "yuD34tEpRFw",
              "textDisplay": "if your time looks 100x slower to them, then their time would also look 100x slower to you.\u003cbr\u003eTime dilation is different from the doppler effects. Doppler effects are real , and they happen separate to this effect. So, clocks are already slowed down by time dilation and doppler effect make them seem EVEN MORE  slow. \u003cbr\u003eIrrespective of  whoever is moving, IF no one is accelerating and all motion is uniform, then each person will see the other person&#39;s time move slower.\u003cbr\u003eIn your advanced spacecraft, you will never reach light speed. The closer you reach light speed, the more energy you will need to keep accelerating.",
              "textOriginal": "if your time looks 100x slower to them, then their time would also look 100x slower to you.\nTime dilation is different from the doppler effects. Doppler effects are real , and they happen separate to this effect. So, clocks are already slowed down by time dilation and doppler effect make them seem EVEN MORE  slow. \nIrrespective of  whoever is moving, IF no one is accelerating and all motion is uniform, then each person will see the other person's time move slower.\nIn your advanced spacecraft, you will never reach light speed. The closer you reach light speed, the more energy you will need to keep accelerating.",
