          "snippet": {
            "videoId": "yuD34tEpRFw",
            "textDisplay": "Equivalence of Mass Time Dilation AND Speed Time Dilation\u003cbr\u003eBy Csaba A. Bodor; March 1, 2022\u003cbr\u003e\u003cbr\u003eThe twin paradox disappears if viewed in this context.\u003cbr\u003e\u003cbr\u003e   In both the things that are in common are (1) the aether, and; (2) gravity.\u003cbr\u003eBaryonic matter, including electromagnetic waves,  and the aether cannot mix.  The aether is pushed aside by the matter BUT pushes back against the matter in the form of, what we call, gravity.  The greater the mass, the greater the push.  Even with this push there is a large amount of space between the components of the matter.  The push, gravity, however, affects those components by pressing on them and slowing down all the properties of matter.   Wave length, frequency, spin, speed of movement, everything.    Including time.  So, the greater the push back of the aether, the greater the time dilation or slower movement of time.  Yes, time is a indirect component of baryonic matter.\u003cbr\u003e\u003cbr\u003eWith speed dilation there are similarities and  differences.  The, as i said, aether resists change.  Matter disrupts the aether&#39;s symmetry and the aether fights back with a push.  The aether also dislikes matter when the matter pushes against it in the form of motion or speed.  Moving matter is like something moving through air or water; both mediums resist the motion.  The aether pushes back against the push of matter causing the same disruptions it does with baryonic matter.  Everything is slowed down including time.  Time dilation, again, comes into being.  Gravity comes into being, as with when the mass disrupts the aether.  Here it is speed that disrupts the aether and creates gravity, not mass.\u003cbr\u003e\u003cbr\u003eTime dilation, whether caused by mass or speed, is caused by the gravity created by the aether pressing on &quot;stationary&quot; mass or a moving mass.  The time dilation is proportional to the amount and-or speed of the mass.\u003cbr\u003e\u003cbr\u003eCan speed time dilation and its associated gravity be created artificially?\u003cbr\u003e\u003cbr\u003eIf an element or isotope if an element were to be massive enough AND it could be sped up enough, perhaps.  How?  Manufacturing such element into a disk that could spin at a high enough speed would not be practical; the centripetal forces and vibrations would probably tear the apparatus apart.   What if a sufficiently large amount of such element, however, could be forced to vibrate at a very high frequency?   The motion of the protons and neutrons moving and vibrating, even though in extremely small sub atomic distances, might get fast enough to affect the aether inside and outside that element to create the gravity needed to cause time dilation.  The frequency would need to be very high.\u003cbr\u003e\u003cbr\u003ePerhaps such a setup could create speed induced artificial gravity.\u003cbr\u003eBob Lazar, if you read this, hope it helps.",
            "textOriginal": "Equivalence of Mass Time Dilation AND Speed Time Dilation\nBy Csaba A. Bodor; March 1, 2022\n\nThe twin paradox disappears if viewed in this context.\n\n   In both the things that are in common are (1) the aether, and; (2) gravity.\nBaryonic matter, including electromagnetic waves,  and the aether cannot mix.  The aether is pushed aside by the matter BUT pushes back against the matter in the form of, what we call, gravity.  The greater the mass, the greater the push.  Even with this push there is a large amount of space between the components of the matter.  The push, gravity, however, affects those components by pressing on them and slowing down all the properties of matter.   Wave length, frequency, spin, speed of movement, everything.    Including time.  So, the greater the push back of the aether, the greater the time dilation or slower movement of time.  Yes, time is a indirect component of baryonic matter.\n\nWith speed dilation there are similarities and  differences.  The, as i said, aether resists change.  Matter disrupts the aether's symmetry and the aether fights back with a push.  The aether also dislikes matter when the matter pushes against it in the form of motion or speed.  Moving matter is like something moving through air or water; both mediums resist the motion.  The aether pushes back against the push of matter causing the same disruptions it does with baryonic matter.  Everything is slowed down including time.  Time dilation, again, comes into being.  Gravity comes into being, as with when the mass disrupts the aether.  Here it is speed that disrupts the aether and creates gravity, not mass.\n\nTime dilation, whether caused by mass or speed, is caused by the gravity created by the aether pressing on \"stationary\" mass or a moving mass.  The time dilation is proportional to the amount and-or speed of the mass.\n\nCan speed time dilation and its associated gravity be created artificially?\n\nIf an element or isotope if an element were to be massive enough AND it could be sped up enough, perhaps.  How?  Manufacturing such element into a disk that could spin at a high enough speed would not be practical; the centripetal forces and vibrations would probably tear the apparatus apart.   What if a sufficiently large amount of such element, however, could be forced to vibrate at a very high frequency?   The motion of the protons and neutrons moving and vibrating, even though in extremely small sub atomic distances, might get fast enough to affect the aether inside and outside that element to create the gravity needed to cause time dilation.  The frequency would need to be very high.\n\nPerhaps such a setup could create speed induced artificial gravity.\nBob Lazar, if you read this, hope it helps.",
