            "textDisplay": "The one part of this that will never click in my brain is the concept of aging differently based on what speed you are travelling, I&#39;ve never seen that part of the law explained in a way that makes any logical sense at all.. I understand relativity, I understand that the faster you travel away from something (say, Earth for example) then the slower in time it appears to move, up until you travel at light speed where everything you observe back on earth shall appear to stop in time - I get that no problem. What I don&#39;t understand is that surely the moment you travel back towards earth at the speed of light, then wouldn&#39;t you just observe everything on earth moving much faster now, therefore technically &quot;undoing&quot; the slowed/stopped time that you previously observed..? How is time dilation anything more than a mere observation, how can it possibly be an absolute change in time if you end up travelling back to where you began your journey? I want to make sense of this and have tried for years but I&#39;ve never seen or heard an explanation that does it justice.",
