e dilation caused by gravity and speed (think back to the trampoline and example). the guy in the drone will see the man fall faster(think back to the car and bus again) since he is moving through space at a slower time. \u003cbr\u003e\u003cbr\u003e\u003cbr\u003eto think deeper, space IS reality. when light and sound moves, they&#39;re moving through space. when you move to this minute, space and time is moving past you right now. when you go into a car it does something brilliant. It changes the movement of space when the car starts moving. if your doing something while in the passenger or back seat such as reading or on your phone, they dont just randomly fly off into your face. notice that it stays put. If you open your window and let go of the object, you can the the difference within how the space outside and in your car is different. the object you let go of flows back into the speed of the outside. When you feel the wind on your hand sticking out from outside the car, thats space and time. The air molecules are moving fast on your hands because the movement of space within the car is so much faster than that of outside. Your hand was literally brushing past the slower objects of the outside such as air molecules and dust particles just like putting your hand into the water from a moving boat. when the window goes back up, you can no longer feel the difference of movement of space  between you and the outside. Remember that when space is sped up, time slows down. The same thing goes for the other way around with as time speeds up, space slows down. To put this into perspective, the movement of space within the car is sped up but it doesnt feel like it. That&#39;s because the time within the car is slowed down. Its the same inversely. The movement of space outside is decreased but the time is faster than in the car. When Albert Einstein realized that the clock would have stopped but the buildings would have kept moving past the train in a blur of movement ( \u0