k correctly adjusted it would appear for Time to be moving in the same fixed rate as it was before. Not everything in the Universe moves at the speed of light so Time has to be a fixed constant\u003cbr\u003e\u003cbr\u003e\u003cbr\u003eI&#39;m having a really hard time understanding this as well as gravity affecting time, if you were on the surface of another planet for 1 Earth hour, it&#39;s equal to 7 Earth Years to gravity? If you were on that heavy gravity planet for 1 Earth hour how many times would your heart beat? Would it be significantly different compared to if you were on Earth?\u003cbr\u003e\u003cbr\u003e\u003cbr\u003eTime is one&#39;s own perception of objects existing in a forward motion; Time can only be linear because time = existence. Time is the perception of objects moving through space. Covering distance relative to perception is time; going in reverse is still going forwards, just backwards. Time is a constant and fixed forward motion of existence.\u003cbr\u003e\u003cbr\u003e\u003cbr\u003eI think of the movie Click with Adam Sandler\u003cbr\u003e\u003cbr\u003e\u003cbr\u003eLet&#39;s say we have 3 people, the first guy is moving the slowest through space, snail syndrome, in his own existence he is perceiving time to being a fixed rate of existing, he knows that he is existing in a fixed rate as he remember&#39;s the past, feels the now, and feels to be moving forwardbut is moving slower through space than the second guy. The second guy is watching the snail like person move and his perception of time is a fixed rate of existing like the first guy, only he is moving faster through space than the first guy and so the only difference is distance through space judged by one&#39;s own perception of that. Then there is the 3rd guy and he is watching both of the other guys moving but is extremely faster than both of them, and so he is also perceiving time to being a fixed rate of existing as well, only his coverage of distance through space is at a much faster rate, although time itself has remained the same, however you choose to measure it, it is linear and a constant, relative to existence itself?\u003cbr\u003e\u003cbr\u003e\u003cbr\u003eAnd maybe perception changes depending on one&#39;s lifetime expectancy; if you live longer naturally, your perception of time is probably moving slower than one&#39;s that don&#39;t live for very long.",
            "textOriginal": "Is Einstein's theory correct? Or was Newton's... I wouldn't say time changed though... he just was moving faster? or am I missing something? Time has to be fixed... If you move very very quickly let's say around the entire earth, your Time of completion would simply be let's say 30 seconds, a regular person would be much longer. Time of completion is different But that doesn't mean that Time itself was altered in any way. Time is just a measurement of forward existing.  \n\n\nAnd maybe the expansion of the Universe isn't real, it's only your mind expanding. \n\n\n\nGosh I'm so confused... if the train is moving 40 km per hour, in respect to the train moving 20 km per hour it would appear the 40 km train is only moving 20 km faster than the 20 km moving train but is still moving at the constant fixed speed of 40 km per hour.. relative to object vs space movement. \n\n\nIf a train were to move at the speed of light, it would appear for the trains to hardly move at all. Time for that person in the train traveling at the speed of light has not slowed down... they're just moving faster... one's perception.\n\n\nTime has to be a constant... time we use today is a fixed measurement, perceptions are different than reality of another perception. If we constantly moved at the speed of light AND THEN created a measurement of Time in the form of a clock, we would  have to increase the time the hand ticks to adjust to our new speed of travel. So our new \"seconds\" and milliseconds\" forms of measurement would change..but this is just perception. Our bodies does not operate at the speed of light unfortunately so maybe these measurements are irrelevant to us. If we do this then when you are moving at the speed of light and watching our new Clock correctly adjusted it would appear for Time to be moving in the same fixed rate as it was before. Not everything in the Universe moves at the speed of light so Time has to be a fixed constant\n\n\nI'm having a really hard time understanding this as well as gravity affecting time, if you were on the surface of another planet for 1 Earth hour, it's equal to 7 Earth Years to gravity? If you were on that heavy gravity planet for 1 Earth hour how many times would your heart beat? Would it be significantly different compared to if you were on Earth?\n\n\nTime is one's own perception of objects existing in a forward motion; Time can only be linear because time = existence. Time is the perception of objects moving through space. Covering distance relative to perception is time; going in reverse is still going forwards, just backwards. Time is a constant and fixed forward motion of existence.\n\n\nI think of the movie Click with Adam Sandler\n\n\nLet's say we have 3 people, the first guy is moving the slowest through space, snail syndrome, in his own existence he is perceiving time to being a fixed rate of existing, he knows that he is existing in a fixed rate as he remember's the past, feels the now, and feels to be moving forwardbut is moving slower through space than the second guy. The second guy is watching the snail like person move and his perception of time is a fixed rate of existing like the first guy, only he is moving faster through space than the first guy and so the only difference is distance through space judged by one's own perception of that. Then there is the 3rd guy and he is watching both of the other guys moving but is extremely faster than both of them, and so he is also perceiving time to being a fixed rate of existing as well, only his coverage of distance through space is at a much faster rate, although time itself has remained the same, however you choose to measure it, it is linear and a constant, relative to existence itself?\n\n\nAnd maybe perception changes depending on one's lifetime expectancy; if you live longer naturally, your perception of time is probably moving slower than one's that don't live for very long.",
