          "snippet": {
            "videoId": "yuD34tEpRFw",
            "textDisplay": "So gravity and time are connected but the faster I go the slower everything else does?\u003cbr\u003e\u003cbr\u003eDoes that mean if I live on a fat planet and always ran, I would age slower then someone that lived on a skinny planet and didn‚Äôt move? \u003cbr\u003e\u003cbr\u003eSomeone please tell me if this is true.\u003cbr\u003e\u003cbr\u003eEdit: sorry for extremely bad wording but really curious",
            "textOriginal": "So gravity and time are connected but the faster I go the slower everything else does?\n\nDoes that mean if I live on a fat planet and always ran, I would age slower then someone that lived on a skinny planet and didn‚Äôt move? \n\nSomeone please tell me if this is true.\n\nEdit: sorry for extremely bad wording but really curious",
            "authorDisplayName": "James Browne",
            "authorProfileImageUrl": "https://yt3.ggpht.com/ytc/AMLnZu8ykYzE_IzNb2tQ3DKuy8g_fwcp_THTal3hNzAdaw=s48-c-k-c0x00ffffff-no-rj",
            "authorChannelUrl": "http://www.youtube.com/channel/UCB7AEH-Hq821pIeFdzh50nA",
