    {
      "kind": "youtube#commentThread",
      "etag": "XILr0sc_NQ3ZjSZ0wXTJUr2AGTg",
      "id": "UgyE0gQHEpYiy4Xtmrp4AaABAg",
      "snippet": {
        "videoId": "yuD34tEpRFw",
        "topLevelComment": {
          "kind": "youtube#comment",
          "etag": "7Dm0TaekdHGkB_2bahdsJALKsGo",
          "id": "UgyE0gQHEpYiy4Xtmrp4AaABAg",
          "snippet": {
            "videoId": "yuD34tEpRFw",
            "textDisplay": "To an atheist &#39;living forever&#39; is ridiculous, nonetheless as we move faster through space, time goes increasingly slower:-\u003cbr\u003e\u003cbr\u003e¬†\u003cbr\u003e\u003cbr\u003eFacts\u003cbr\u003e\u003cbr\u003e¬†\u003cbr\u003e\u003cbr\u003eEarth takes 24 hours for one complete rotation. Venus takes 5,832 hours ie 243 days whereas Mars takes 25 hours.\u003cbr\u003e\u003cbr\u003e¬†\u003cbr\u003e\u003cbr\u003eWe have determined astronauts in a Space Station, age a little slower than us on earth. But is there a condition where time does not exist? Yes, the speed of light.\u003cbr\u003e\u003cbr\u003e¬†\u003cbr\u003e\u003cbr\u003eLight\u003cbr\u003e\u003cbr\u003e¬†\u003cbr\u003e\u003cbr\u003eLight consists photons: Photons? Electromagnetic energy that makes light. Space, time and speed re linked. And the closer we move to light speed, the less time and distance we experience. Units for time and distance approach zero. \u003cbr\u003e\u003cbr\u003e¬†\u003cbr\u003e\u003cbr\u003eAccording to &#39;relativity&#39;, mass cannot reach light speed. Why? Toward light speed mass increases to infinity. Therefore the amount of energy required is Infinite. Again, If an object accelerates toward 300, 0000 Kms per second, its mass becomes infinite, ad does the energy required to move it. Thus no normal object can travel as fast or faster than the speed of light. But only light photons experience zero distance and zero time.\u003cbr\u003e\u003cbr\u003e¬†\u003cbr\u003e\u003cbr\u003eThus if we, like Jesus, are spirit (weightless, raptured ) we can move at speed of light (glorified) and so experience timelessness. And so live forever!!\u003cbr\u003e\u003cbr\u003e¬†\u003cbr\u003e\u003cbr\u003e&quot;There it was, the true Light coming into the world.&quot; John 1:9, Isa. 49:6. \u003cbr\u003e\u003cbr\u003e¬†\u003cbr\u003e\u003cbr\u003e&quot;In a moment, in the twinkling of an eye (speed of light), at the last trumpet call. For a trumpet will sound, and the dead [in Christ] will be raised imperishable (free and immune from decay), and we shall be changed (transformed).&quot; 1 Cor\u003ca href=\"https://www.youtube.com/watch?v=yuD34tEpRFw&amp;t=15m52s\"\u003e15:52\u003c/a\u003e \u003cbr\u003e\u003cbr\u003e¬†\u003cbr\u003e\u003cbr\u003eChrist spiritually is Light! It is written :-\u003cbr\u003e\u003cbr\u003e¬†\u003cbr\u003e\u003cbr\u003eHe transfigured before them. His face shining like the sun, and His clothes as white as the light Matthew 17:2 His clothes became shining, exceedingly white, like snow, such as no launderer on earth can whiten. Mark 9:3 \u003cbr\u003e\u003cbr\u003e¬†\u003cbr\u003e\u003cbr\u003eIs Christ a rainbow, because white comprises colours and Christ also is a ‚Äòpromise of God‚Äô? Rainbow appears in Genesis and Revelation. Revelation reveals a rainbow is around Christ. Rainbows require rains. It is written ‚ÄúIn the latter days I will pour out my spirit‚Äù.\u003cbr\u003e\u003cbr\u003e¬†\u003cbr\u003e\u003cbr\u003eOne of the purposes of space (a vacuum) is, to facilitate the speed of light, a speed where time and distance do not exist. \u003cbr\u003e\u003cbr\u003e¬†\u003cbr\u003e\u003cbr\u003e(To state the obvious: light travels at the speed of light. So the question is how can it do this, and why doesn&#39;t it need infinite energy to go that fast? The answer is that particles of light (called photons) don‚Äôt have any mass. However, a photon emitted from a star in Andromeda and heading out towards the Earth travels in a vacuum and, because it&#39;s a photon, travels at the speed of light. Because the photon is moving at the speed of light it has a 100% time dilation factor. To the photon time does not exist¬†until it strikes the upper atmosphere of our planet and even then is only slowed down by a tiny fraction. According to a photon in free space, time, or for that matter distance, has no meaning whatsoever, and it gets from wherever it is to wherever it is going instantly)",
            "textOriginal": "To an atheist 'living forever' is ridiculous, nonetheless as we move faster through space, time goes increasingly slower:-\n\n¬†\n\nFacts\n\n¬†\n\nEarth takes 24 hours for one complete rotation. Venus takes 5,832 hours ie 243 days whereas Mars takes 25 hours.\n\n¬†\n\nWe have determined astronauts in a Space Station, age a little slower than us on earth. But is there a condition where time does not exist? Yes, the speed of light.\n\n¬†\n\nLight\n\n¬†\n\nLight consists photons: Photons? Electromagnetic energy that makes light. Space, time and speed re linked. And the closer we move to light speed, the less time and distance we experience. Units for time and distance approach zero. \n\n¬†\n\nAccording to 'relativity', mass cannot reach light speed. Why? Toward light speed mass increases to infinity. Therefore the amount of energy required is Infinite. Again, If an object accelerates toward 300, 0000 Kms per second, its mass becomes infinite, ad does the energy required to move it. Thus no normal object can travel as fast or faster than the speed of light. But only light photons experience zero distance and zero time.\n\n¬†\n\nThus if we, like Jesus, are spirit (weightless, raptured ) we can move at speed of light (glorified) and so experience timelessness. And so live forever!!\n\n¬†\n\n\"There it was, the true Light coming into the world.\" John 1:9, Isa. 49:6. \n\n¬†\n\n\"In a moment, in the twinkling of an eye (speed of light), at the last trumpet call. For a trumpet will sound, and the dead [in Christ] will be raised imperishable (free and immune from decay), and we shall be changed (transformed).\" 1 Cor15:52 \n\n¬†\n\nChrist spiritually is Light! It is written :-\n\n¬†\n\nHe transfigured before them. His face shining like the sun, and His clothes as white as the light Matthew 17:2 His clothes became shining, exceedingly white, like snow, such as no launderer on earth can whiten. Mark 9:3 \n\n¬†\n\nIs Christ a rainbow, because white comprises colours and Christ also is a ‚Äòpromise of God‚Äô? Rainbow appears in Genesis and Revelation. Revelation reveals a rainbow is around Christ. Rainbows require rains. It is written ‚ÄúIn the latter days I will pour out my spirit‚Äù.\n\n¬†\n\nOne of the purposes of space (a vacuum) is, to facilitate the speed of light, a speed where time and distance do not exist. \n\n¬†\n\n(To state the obvious: light travels at the speed of light. So the question is how can it do this, and why doesn't it need infinite energy to go that fast? The answer is that particles of light (called photons) don‚Äôt have any mass. However, a photon emitted from a star in Andromeda and heading out towards the Earth travels in a vacuum and, because it's a photon, travels at the speed of light. Because the photon is moving at the speed of light it has a 100% time dilation factor. To the photon time does not exist¬†until it strikes the upper atmosphere of our planet and even then is only slowed down by a tiny fraction. According to a photon in free space, time, or for that matter distance, has no meaning whatsoever, and it gets from wherever it is to wherever it is going instantly)",
            "authorDisplayName": "Edgar Alfred",
            "authorProfileImageUrl": "https://yt3.ggpht.com/ytc/AMLnZu91JDegOi5o1ZdpeGG7iDSX4QyzDY0pJ1_G4-lsMw=s48-c-k-c0x00ffffff-no-rj",
